CREATE USER UKOUG_TECH_15 IDENTIFIED BY UKOUG_TECH_15;
GRANT RESOURCE, CONNECT TO UKOUG_TECH_15;

CONNECT UKOUG_TECH_15/UKOUG_TECH_15;

DROP TABLE ATTENDANCE;
DROP TABLE PRESENTATION;
DROP TABLE SPEAKER;
DROP TABLE ATTENDEE;

CREATE TABLE "SPEAKER" 
(
"ID" NUMBER NOT NULL ENABLE, 
"FIRSTNAME" VARCHAR2(200 BYTE), 
"LASTNAME" VARCHAR2(200 BYTE), 
"COMPANY" VARCHAR2(200 BYTE), 
"SPEAKER_BIO" CLOB, 
CONSTRAINT "SPEAKER_PK" PRIMARY KEY ("ID")
) 
LOB ("SPEAKER_BIO") STORE AS BASICFILE;

CREATE TABLE "PRESENTATION" 
(	
"ID" NUMBER NOT NULL ENABLE, 
"TITLE" VARCHAR2(200 BYTE) NOT NULL ENABLE, 
"CO_PRESENTER" VARCHAR2(200 BYTE), 
"CO_PRESENTER_EMAIL" VARCHAR2(200 BYTE), 
"STREAM" VARCHAR2(200 BYTE), 
"TOPIC" VARCHAR2(200 BYTE), 
"PRESENTATION_FORMAT" VARCHAR2(200 BYTE), 
"ABSTRACT" CLOB, 
"EXPERIENCE" VARCHAR2(200 BYTE), 
"PREFERRED_LENGTH" VARCHAR2(200 BYTE), 
"CONTENT_LEVEL" NUMBER, 
"DAY" VARCHAR2(200 BYTE), 
"SESSION_DATE" DATE, 
"TRACK" VARCHAR2(200 BYTE), 
"START_TIME" VARCHAR2(200 BYTE), 
"END_TIME" VARCHAR2(200 BYTE), 
"LENGTH" NUMBER, 
"HALL" VARCHAR2(200 BYTE), 
"PRESENTATION_STATUS" VARCHAR2(200 BYTE), 
"SPEAKER_ID" NUMBER NOT NULL ENABLE, 
CONSTRAINT "PRESENTATION_PK" PRIMARY KEY ("ID"),
CONSTRAINT "PSN_SKR_FK" FOREIGN KEY ("SPEAKER_ID")
REFERENCES "SPEAKER" ("ID") ENABLE
)
LOB ("ABSTRACT") STORE AS BASICFILE;

CREATE TABLE "ATTENDEE" 
(	
"ID" NUMBER NOT NULL ENABLE, 
"NAME" VARCHAR2(200 BYTE), 
"COMPANY" VARCHAR2(200 BYTE), 
CONSTRAINT "ATTENDEE_PK" PRIMARY KEY ("ID")
);

CREATE TABLE "ATTENDANCE" 
(
"ID" NUMBER NOT NULL ENABLE, 
"PRESENTATION_ID" NUMBER NOT NULL ENABLE, 
"ATTENDEE_ID" NUMBER NOT NULL ENABLE, 
"STATUS" VARCHAR2(100 BYTE), 
"EVALUATION" VARCHAR2(100 BYTE),
"EVALUATION_TIMESTAMP" TIMESTAMP,
CONSTRAINT "ATTENDANCE_PK" PRIMARY KEY ("ID"),
CONSTRAINT "PSN_ATE_UK" UNIQUE ("PRESENTATION_ID", "ATTENDEE_ID"),
CONSTRAINT "ATE_PSN_FK" FOREIGN KEY ("PRESENTATION_ID")
REFERENCES "UKOUG_TECH_15"."PRESENTATION" ("ID") ENABLE, 
CONSTRAINT "ATE_ATE_FK" FOREIGN KEY ("ATTENDEE_ID")
REFERENCES "UKOUG_TECH_15"."ATTENDEE" ("ID") ENABLE
);





COMMIT;