INSERT INTO SPEAKER VALUES (1,'Ahmed','Aboulnaga','Raastech','Ahmed Aboulnaga is an Oracle ACE whose professional focus is in technical management, architecture, and consulting within the Oracle Fusion Middleware stack. Ahmed has implemented enterprise solutions for commercial, government, and international customers throughout the years leveraging technologies such as WebLogic Server, SOA Suite, OSB, B2B, WebCenter, OEM, Exalogic, and more. Ahmed is an OCE and OCA and has presented at OpenWorld, Collaborate, UKOUG, GLOC, DOAG, and various Oracle users groups in the past. Ahmed has multiple publications in the area of Oracle Fusion Middleware and is currently president of the West Michigan Oracle Users Group (WMOUG).');
INSERT INTO SPEAKER VALUES (2,'Bruno','Alves','eProseed','Bruno has worked with Oracle Fusion Middleware technologies for the last 10 years. He holds several Oracle certifications and is experienced as SOA/BPM Senior Architect, Consultant, Technical Team Leader and Presales. Currently performing the role of managing partner and Technical Director at eProseed UK, Bruno is co-author of the Oracle Fusion BPM ' || CHR(38) ||' SOA Blog, speaker on conferences, and publisher on Oracle Technology Network (OTN) and other SOA related publications. By being at eProseed since it’s early days, Bruno, together with the team at eProseed, have received 9 Oracle Awards the last 5 years, amongst which multiple times the Oracle Middleware Partner of the Year, Industry Partner of the Year, and Oracle Fusion Middleware Global Innovation.”');
INSERT INTO SPEAKER VALUES (3,'Vikas','Anand','Oracle','Vikas Anand is Senior Director, Integration Products at Oracle. He leads overall product management ' || CHR(38) ||' strategy for Oracle SOA Suite and Integration Cloud Service. Mr. Anand leads a team of seasoned Product Managers in charge of Oracle Fusion Middleware integration products:Integration Cloud Service, SOA Suite, BPEL, Service Bus, B2B, Stream Explorer, MFT, API Management, Oracle SOA Suite for Healthcare, Adapters for Cloud and Applications integration etc. Since joining Oracle in 2003, Mr. Anand has held various positions in product development, product management and strategy positions in different geographies. Prior to Oracle, Mr. Anand has worked in product ' || CHR(38) ||' project development, and IT in Fortune 100 firms. In these roles he worked across diverse domains like Supply Chain Integration, Sales ' || CHR(38) ||' Marketing Automation, Global Marketplaces ' || CHR(38) ||' Industry verticals.  He also developed software products as a part of a startup. Mr. Anand holds a bachelor''s degree in Computer Science ' || CHR(38) ||' Engineering.');
INSERT INTO SPEAKER VALUES (4,'James','Anthony','RedStack Tech','James Anthony is currently the Technology Director for e-DBA Ltd. James spends the majority of his time evangelising new technologies to customers, with databases being one of his specialist areas. Before joining e-DBA, James held the position of UK Technical Director for Core Technology at Oracle. Having worked with Oracle Technology for over 15 years, James holds the prestigious titles of ‘Oracle Certified Master’ and ‘Oracle ACE’. Now working for e-DBA, James’s role involves working closely with customers and helping them evaluate and implement new Oracle Technologies such as Oracle NoSQL.');
INSERT INTO SPEAKER VALUES (5,'Christian','Antognini','Trivadis AG','Since 1995, Christian Antognini has focused on understanding how the Oracle database engine works. His main interests include logical and physical database design, the integration of databases with Java applications, the query optimizer and basically everything else related to application performance management. He is currently working as a senior principal consultant and trainer at Trivadis in Zürich, Switzerland.If Christian is not helping one of his customers get the most out of Oracle, he is somewhere lecturing on application performance management or new Oracle Database features for developers. In addition to classes and seminars organized by Trivadis, he regularly presents at conferences and user-group meetings. He is a proud member of the OakTable Network and an Oracle ACE Director. Christian is the author of Troubleshooting Oracle Performance (Apress, 2008/2014) and the co-author of Der Oracle DBA (Hanser, 2011).');
INSERT INTO SPEAKER VALUES (6,'René','Antúnez','Pythian','Oracle ACE,Oracle Open World and Collaborate Presenter , DBA, Movie Fanatic, Music Lover and Bringing the best from México (Mexihtli) to the rest of the world and in the process photographing it :)');
INSERT INTO SPEAKER VALUES (7,'Jason','Arneil','Accenture Enkitec Group','Jason has been in IT as a Database and Systems Administrator for some 16 years and has worked exclusively with the Exadata platform for the last 3 1/2 years. Jason has a range of exadata experience across a broad range of industries, including finance, retail and online web transaction systems. Jason is an Oracle Ace and has presented many times at the UKOUG and at Oracle OpenWorld. Jason blogs regularly on Exadata at: http://jarneil.wordpress.com, and tweets regularly @jarneil.');
INSERT INTO SPEAKER VALUES (8,'Stew','Ashton','BNP Paribas','Stew is a Technical Architect and Oracle Development Expert at BNP Paribas. With over 30 years experience as developer, technical sales representative and technical architect, Stew has spent much of the last 10 years focusing on Oracle Database development and performance. He is the author of several internal studies and “Good Practice” documents concerning SQL and PL/SQL development in OLTP and batch modes. Stew contributes to asktom.oracle.com and the OTN “SQL and PL/SQL” forum, and he blogs about SQL and PL/SQL techniques at stewashton.wordpress.com.For an independent assessment of Stew’s SQL abilities, see https://asktom.oracle.com/pls/apex/f?p=100:11:0::::P11_QUESTION_ID:4725668677832#4596743800346033936');
INSERT INTO SPEAKER VALUES (9,'Jagan','Athreya','Oracle','Jagan Athreya is Senior Director of Database Manageability ' || CHR(38) ||' IT Analytics for Oracle Enterprise Manager at Oracle. He started his career at Oracle advising Fortune 500 companies on deployment strategies for high availability and performance for their database applications. Jagan has an MBA from Wharton School and has studied electrical engineering at Dartmouth College and Indian Institute of Technology, Chennai.');
INSERT INTO SPEAKER VALUES (10,'Martin','Bach','Accenture Enkitec Group','Martin is a consultant working for @Enkitec and author. He has specialized in the Oracle DBMS since 2001, with his main interests in high availability and disaster recovery solutions for mission critical 24x7 systems. Over the last years he spent more and more time discovering the benefits of virtualisation technologies for Oracle products. After joining @Enkitec Martin was lucky to have the opportunity to work with the widest range of Engineered Systems, specifically the Exadata Database Machine, the Super Cluster T5-8, and many others. Books he contributed to are Expert Consolidation in Oracle Database 12c, Pro Oracle RAC 11g on Linux as well as Expert Oracle Exadata (2nd edition). In addition to these Martin has his own blog at martincarstenbach.wordpress.com where he shares his latest discoveries with the Oracle community.When not trying to get the best out of the Oracle database for his clients, or working on understanding its internals, Martin can be found presenting or attending Oracle user group meetings, mainly in the UK. In the remaining spare time, Martin contributes to the Oracle Scene and DOAG news, the UK and German Oracle User Group publications as well as the iX magazine.');
INSERT INTO SPEAKER VALUES (11,'Paul','Bainbridge','Fujitsu','A solution architect with strong background in Oracle Middleware / Development. Somewhat of an expert in Oracle Licensing and architectures to reduce the total cost of Ownership.Deputy Chair of the Middleware SIG. Speaker at both Tech conference and SIGs.');
INSERT INTO SPEAKER VALUES (12,'John','Baker','The Hackett Group','A Director in The Hackett Group''s UK EPM-BI transformation team, John has over 16 years experience with the Hyperion tools and associated reporting tools (OBIEE, etc). An active member of the User Group, John continues to help clients gain value out of their EPM-BI estates.');
INSERT INTO SPEAKER VALUES (13,'Zbigniew','Baranowski','CERN','Zbigniew Baranowski is an Oracle DBA working at the European Organization for Nuclear Research(CERN). He is responsible for providing database services for engineers and core LHC control components. Additionally he is in charge of world wide data replication between Oracle databases within LHC Computing Grid project.');
INSERT INTO SPEAKER VALUES (14,'Jon','Barwell','Celesio UK','Solution Architect for world leading Healthcare provisioning organisation.Celesio UK has the largest community pharmacy network in the UK and the leading national pharmaceutical distribution operation.Personally using Apex for the last 10 years since HTMLdb 1.6 to develop multiple internal applications.');
INSERT INTO SPEAKER VALUES (15,'Tammy','Bednar','Oracle','Tammy has worked in the computer industry for more than 35 years. Oracle hired her in the Database Support Organization 19 years ago and she has been involved with database releases since version 6.0.36. Tammy started her product management career on the database High Availability team with Recovery Manager (RMAN), database backup and recovery,  and Database Security development team, focusing on auditing, Oracle Audit Vault and Oracle Database Firewall and now focuses on the Oracle Database Appliance.');
INSERT INTO SPEAKER VALUES (16,'Charles','Berger','Oracle','Charlie Berger is Sr. Director of Product Management, for Data Mining and Advanced Analytics at Oracle.  He has over 30 years of experience in data analysis software including Oracle, Thinking Machines Corporation, Bolt, Beranek and Newman, Palladian (expert systems) and IBM.  He is responsible for product management and direction of Oracle’s in-databases'' data mining and predictive analytics technology including data mining, text mining and SQL based statistical functions. He holds a MS in Manufacturing Engineering and an MBA both from Boston University.   He holds a BS in Industrial Engineering and Operations Research from the University of Massachusetts at Amherst.');
INSERT INTO SPEAKER VALUES (17,'Luc','Bors','eProseed','Luc is Managing Partner and Technical Director at eProseed NL and member of the global eProseed CTO Office. He is an Oracle ACE and Certified Specialist in both Oracle ADF and Oracle MAF. With over 18 years of experience as a principal consultant, architect and trainer Luc is recognised globally as one of the authorities in his area of expertise. Luc is the Author of the Oracle Mobile Application Framework book published by Oracle Press in 2014. He also regularly writes articles for international magazines, web sites and his personal blog');
INSERT INTO SPEAKER VALUES (18,'Julie','Bowen','Hubble','Julie Bowen was a Management Accountant before joining Hubble 9 years ago as a UK Business Development Manager.  With her extensive knowledge of accounting best practices Julie is able to advise companies on strategies and techniques to empower the finance team to deliver real-time answers to the business and transform them into a high performing individuals.');
INSERT INTO SPEAKER VALUES (19,'Matt','Brasier','C2B2 Consulting','Matt is a Principal Consultant at C2B2. He has eleven years experience working with Java, Oracle, RedHat / JBoss and VMware/ SpringSource middleware technologies and eight years experience as a professional services consultant. He has worked with C2B2 customers, and on behalf of BEA professional services on many high profile projects and has extensive experience in performance tuning and trouble-shooting large enterprise systems. Matt has presented at a number of technical forums, including The Server Side Java Symposium and JUDCon, and teaches training courses on a variety of Java EE related topics. Matt is the author of the "Oracle SOA Suite 11g Performance Tuning Cookbook"');
INSERT INTO SPEAKER VALUES (20,'Peter','Brink','Credit Suisse','Peter has over 15 years of experience in developing applications on Oracle databases within the financial service industry with a strong focuses on performance, capacity and DevOps topics.');
INSERT INTO SPEAKER VALUES (21,'Philip','Brown','Red Stack Tech','Philip Brown is a Principal Senior Consultant at e-DBA currently acting as the Group Database Architect for a global retail client.  He has been working with Oracle for around 15 years and has gained an array of experience having always worked within the consultancy arena.  His technology specialities currently are database architecture, security and 12c OEM however he also has experience in MAA, ETL, Performance Tuning, Migrations etc.  He is a regular blogger predominantly focusing around 12c OEM (Saving You 15 Minutes…), presenter (UKOUG, TECH014) and was recently published in the OTECH magazine.');
INSERT INTO SPEAKER VALUES (22,'Bill','Brunt','Dell Software','TBD');
INSERT INTO SPEAKER VALUES (23,'Andrew','Bulloch','Oracle','Andrew has worked with Oracle technology for over 20 years.  Currently working in Server Technology Development he works for the Enterprise Manager Development Group.');
INSERT INTO SPEAKER VALUES (24,'Ludovico','Caldara','Trivadis AG','Ludovico is an Oracle ACE and database specialist with more than 15 years of experience on the full Oracle stack (Clusterware, DataGuard, RAC, ASM, EM). He has administered literally thousands of databases in big datacenters so he has developed a natural leaning to automatization, monitoring and high availability. He is certified on Oracle 12c (OCP,OCE) and MySQL 5 (OCP). He is an active blogger, frequent speaker and a confirmed Community contributor: member of the board of the Swiss Oracle User Group, Europe Chair of the RAC Special Interest Group and co-founder of the Italian Oracle User Group.Ludovico is currently working as a senior consultant for Trivadis in Lausanne, Switzerland, where he can cultivate his passion for technology, bike, snowboard and family.');
INSERT INTO SPEAKER VALUES (25,'Nelson','Calero','Pythian','Nelson Calero is a professional Database Specialist based in Montevideo, Uruguay. He has been working with Oracle technology since 1996 specialized in architecture, administration, and performance for VLDBs and HA environments. After a few years as teacher and researcher in the Computer Science Institute (InCo-UdelaR) in Uruguay, Nelson focused on providing industry consulting in both the private and public sector throughout Latin America, from Argentina to Mexico. Currently he works as Database Consultant for The Pythian Group and is an acvtive member of the Oracle user community having presented at Oracle Open World, Collaborate, MySQL Cloud conference Latin America, and Oracle RACSIG among others.');
INSERT INTO SPEAKER VALUES (26,'Larry','Carpenter','Oracle','Master Product Manager at Oracle USA and is a member of the Maximum Availability Architecture Product Management team in Server Technologies with a focus on Oracle’s High Availability and Disaster Recovery technologies. Larry has 41 years of experience in the computer industry, with the last 29 years focused on the business continuity needs of critical databases and applications. He is recognized by the Oracle user community as a Data Guard expert, an HA Technical Evangelist, and a consultant to diverse Enterprise customers worldwide. Larry''s expertise is insuring the successful deployment of Oracle Disaster Recovery Solutions in diverse computing environments and bringing constantly evolving customer requirements to Oracle’s development teams. Larry is conversant in English, Italian, French, and German and is also the lead author of the Oracle Data Guard 11g Handbook from McGraw-Hill.');
INSERT INTO SPEAKER VALUES (27,'Tony','Cassidy','Peak Indicators','Chair of BA ' || CHR(38) ||' Big Data SIG in IrelandCommittee for OUG Ireland ConferenceManaging Director of Peakindicators in Ireland');
INSERT INTO SPEAKER VALUES (28,'Neil','Chandler','Chandler Systems','Neil has been working in IT since 1988, and and DBA-ing all releases of Oracle since v6.0.29. sometime around 1991, both in a Production and Development capacity. He has designed, developed, administered and upgraded dozens of systems for many clients in fields as diverse as Finance and Airport Logistics.Neil is kind to animals and loves his mum.');
INSERT INTO SPEAKER VALUES (29,'Andrew','Clarke','Result Set','I have been working with Oracle databases since 1992.  My speciality is "classic" database development (SQL, PL/SQL, data modelling).  From time to time I also do business analysis, software architecture and database admin.');
INSERT INTO SPEAKER VALUES (30,'Michelle','Clarke','Codec-dss','Michelle Clarke is the BI ' || CHR(38) ||' EPM Practice Lead within Codec-dss. She has been working with Codec-dss for 11 years implementing Business Intelligence, Data Warehouse, and Enterprise Performance Management solutions; along with a host of other tools. She has a strong background in Finance and banking; and while working for Codec-dss has implemented Financial Management tools for a number of well-known institutions including Permanent TSb, Regus, AIB ' || CHR(38) ||' RBS.');
INSERT INTO SPEAKER VALUES (31,'Maria','Colgan','Oracle','Maria Colgan is a master product manager at Oracle Corporation and has been with the company since version 7.3 was released in 1996. Maria’s core responsibility is the Oracle Database In-Memory Option.  She is responsible for evangelizing the new functionality and getting the feedback from our customers and partners incorporated into future releases of the product.  Prior to this role, she was the product manager for the Oracle Database query optimizer.  Based on Maria’s extensive experience in Oracles Server Technology Performance Group - where she conducted competitive customer benchmarks and tuning sessions - Maria creates material and lectures on the Oracle Database In-Memory Option and the best practices for incorporating it into Oracle environments.  She is also a contributing author to the Oracle Optimizer blog http:blogs.oracle.comoptimizer and the new Oracle Database In-Memory blog http:blogs.oracle.comIn-Memory. She is also a member of the OakTable.');
INSERT INTO SPEAKER VALUES (32,'Oscar','Colino Garcia','Oracle','Currently Oscar is responsible for EMEA Business Development for Analytic Applications covering On Premise BI Apps and Cloud Analytic Applications (OTBIE) across the different horizontals HCM, CX and ERP.For the past 18 years Oscar has been working as a consultant on the Business Analytics space across EMEA for the specialized providers Microstrategy, Siebel and Oracle.As a consultant Oscar is a recognized BI Apps expert and solution architect that in the past has formed part of the Oracle EMEA BI Apps competency center where he was primarily engaged with strategic accounts providing  technical leadership in different horizontals and industries.');
INSERT INTO SPEAKER VALUES (33,'Tom','Dale','Fivium','Oracle Specialist since 1994, working on every version since 7.1.1');
INSERT INTO SPEAKER VALUES (34,'Steven','Davelaar','Oracle','Steven Davelaar is a member of the Oracle Mobile ' || CHR(38) ||' Cloud A-Team. Steven has 20+ years experience with custom development in an Oracle environment. Steven is an expert on Oracle’s Mobile Application Framework (MAF) and Oracle ADF, working with both products since their first release. He is the creator of productivity tools like Oracle JHeadstart for ADF, the ADF EMG Task Flow Tester and the A-Team mobile persistence accelerator (AMPA). ');
INSERT INTO SPEAKER VALUES (35,'Luke','Davies','Pythian','I have been using Oracle since 1991 (V6) as a DBA and have been working with Pythian for the last 7 years.  My main interests are performance, coding and problem solving.');
INSERT INTO SPEAKER VALUES (36,'Peter','de Vaal','Transfer Solutions','Peter de Vaal is Principal Consultant at Transfer Solutions, an Oracle Technology partner based in Leerdam, the Netherlands. With 20+ years’ experience in Oracle technologies he now focuses mainly on Fusion Middleware. He is lead of the Fusion Middleware Cloud Application Foundation SIG of Oracle User group Holland (OGh). He is a frequent presenter at conferences such as UKOUG TECH and ODTUG.');
INSERT INTO SPEAKER VALUES (37,'Lisa','Dearnley-Davison','Oracle','Lisa Dearnley-Davison has been with Oracle since 2001, working on a significant number of analytics projects utilizing a wide range of Oracle BI technologies and performing a wide range of project functions with exposure to a variety of industries. Prior to joining Oracle, Lisa worked for Informix Software on large data warehouses before moving into developing media solutions. From there, she joined Macromedia utilizing click-stream and basket analysis tools. As a Domain Architect within the Western Europe Business Analytics team, she is a trusted advisor and recognized point of contact for Business Analytics and Big Data.');
INSERT INTO SPEAKER VALUES (38,'Frédéric','Desbiens','Oracle','Frédéric Desbiens is a Product Manager for Cloud and Mobility at Oracle Corporation, specializing in the Oracle Mobile Application Framework (MAF) and Oracle Cloud. His main focus areas are web services, mobile data storage and security.Frédéric regularly publishes video recordings and is a frequent conference speaker.');
INSERT INTO SPEAKER VALUES (39,'Steve','Devine','Nuage Solutions','');
INSERT INTO SPEAKER VALUES (40,'Mike','Dietrich','Oracle','Mike DietrichMaster Product Manager - Database UpgradesMike Dietrich has over twenty years experience in the information technology industry. Mr. Dietrich has spent the last seventeen years at Oracle Corporation where he has held senior and management roles in both the sales and support organizations. Currently, he is a Master Product Manager for Databases Upgrades and Migrations.He is responsible for evangelizing, influencing and demonstrating Oracle technology solutions related to database upgrades, migrations and consolidation to Oracle customers and partners. Besides that he works consistently with customers in key reference projects, both onsite and remotely. Mike Dietrich holds a graduate engineer degree of Georg-Simon-Ohm University of Appliend Sciences in Telecommunication Technologies and Computer Science. You''ll find more information on Mike''s blog:http://blogs.oracle.com/UPGRADE. ');
INSERT INTO SPEAKER VALUES (41,'Lonneke','Dikmans','eProseed','Lonneke Dikmans is managing partner at eProseed NL and works as an solution architect, analyst and developer on digital transformation and mobile applications using Oracle Fusion Middleware. Lonneke is an Oracle Ace Director in Oracle Fusion Middleware and a BPMN certified professional. Oracle Magazine awarded her the title of Oracle Fusion Middleware developer of the year in 2007. She publishes frequently online and shares her knowledge at conferences and other community events. ');
INSERT INTO SPEAKER VALUES (42,'Harold','Dost','Raastech','Harold Dost III has extensive experience designing, developing, and architecting integration and service-oriented applications leveraging various Oracle Fusion Middleware technologies that include SOA Suite, AIA, BAM, OSB, OWSM, and OAG. Harold is an Oracle ACE Associate and an OCE (Oracle SOA Foundation Practitioner) and has presented at various users groups such as the Collaborate, UKOUG, MOUS, and WMOUG.');
INSERT INTO SPEAKER VALUES (43,'Bertrand','Drouvot','Accenture Enkitec Group','Bertrand is an Oracle ACE and has been an Oracle DBA since 1999, mainly for financial or public sectors. He currently works for Accenture Enkitec Group. He has experience working in very large and very critical environments.He is an Oracle Exadata 11g Certified Implementation Specialist, Oracle Real Application Clusters (RAC) Administrator Certified Expert, and Oracle Database Administrator Certified Professional (OCP 9i/10g/11g).He has been active in the Oracle community since 2012: he is very active writing blog entries and regularly presents at user group meetings in Europe (Uk, Germany, France...).');
INSERT INTO SPEAKER VALUES (44,'Carl','Dudley','University of Wolverhampton','Carl Dudley has been active within the Oracle environment for the last 28 years, being a director of the UK Oracle User Group and speaking regularly at international conferences since 1991. He has also participated in the SQL Standards ISO group. In November 2002, Carl was selected as ‘DBA of the Year’ by Oracle Corporation. This worldwide award was given to him in recognition of his contribution to the Oracle user community and his work on innovative Oracle Server projects. Carl achieved Oracle ACE Director status in 2009 and is now a Fellow of the British Computer Society.');
INSERT INTO SPEAKER VALUES (45,'Susan','Duncan','Oracle','Susan leads the Oracle Mobile Development Program Office responsible for facilitating mobile development. After 4 years as an Oracle Consultant Susan moved to product management in the Tools Development group in 2001 initially on Oracle Designer ' || CHR(38) ||' UML followed by development of JDeveloper''s support for Web services, SOA, database modeling, ADF. In recent years she specialized in ALM, before moving into mobile development with MAF. She brings all these skills and experience to her mobile role: promoting good architecture, compliance with licensing and process, and helping define best practice for mobile development for both Oracle and Oracle developers');
INSERT INTO SPEAKER VALUES (46,'Drew','Edgar','Inoapps','Drew has been an Oracle developer for 9 years, and has built a wide range of applications using Oracle APEX and other tools. He is a frequent speaker at OUG events, and has presented papers on other customer case studies and projects. He is a member of the Oracle APEX feature advisory board. ');
INSERT INTO SPEAKER VALUES (47,'Maris','Elsins','Pythian','Maris Elsins is an experienced Oracle Applications DBA currently working as Lead Database Consultant at The Pythian Group. His main areas of expertise are troubleshooting and performance tuning of Oracle Database and e-Business Suite systems. He is a blogger and a frequent speaker at Oracle related conferences such as UKOUG, Collaborate, and others. Maris is an Oracle ACE, an Oracle Certified Master, and a coauthor of “Practical Oracle Database Appliance” (Apress, 2014). He''s also a member of the board at Latvian Oracle User Group.');
INSERT INTO SPEAKER VALUES (48,'Magnus','Fagertun','Oracle','Started out doing integration and BI, but wanted to work with databases. After years of focused database work I ended up at Oracle with Engineered systems, where I''m now doing sizing and solution architecture, but also troubleshooting and performance tuning.');
INSERT INTO SPEAKER VALUES (49,'Hilary','Farrell','Oracle','Hilary Farrell is a Principal Software Developer with the Oracle Application Express (APEX) Development team. She joined Oracle in 1998, porting Oracle 7 to the SGI IRIX platform, and prior to joining the Oracle APEX team in 2005, worked with the Migration Technology Group, developing tools to migrate 3rd party applications and database to Oracle, focusing on Microsoft Access migrations. Hilary works on many components of the core APEX product, in particular with responsibility for MS Access and Oracle Forms conversions to APEX, Charting, RESTful Services with Oracle REST Data Services, as well as having worked on various components of the Packaged Applications and Create Wizards, and most recently, the new Modal Dialog capabilities with APEX 5.0.');
INSERT INTO SPEAKER VALUES (50,'Michael','Ferrante','Oracle','Michael Ferrante is a Product Manager in Oracle''s Application Development Tools Division and is currently responsible for the Oracle Forms product. Joining Oracle in 1999, Michael has spent over 15 years in various roles associated with Oracle Forms, including as the Forms Global Technical Lead (GTL) for Oracle Support. Based on his involvement in the Forms community, Michael works with development teams at Oracle to bring the latest innovations to future versions of Oracle Forms.');
INSERT INTO SPEAKER VALUES (51,'Marc','Fielding','Pythian','Marc is a respected figure in the Oracle community both on- and offline. He is a frequent presenter at conferences and community events across North America and Europe and is a respected blogger. He is a proud member of the OakTable network, and Oracle ACE. He has worked with Oracle database products, operating systems and engineered systems since 2001. His broad technical experience also spans hardware and operating system infrastructure, storage, cloud, middleware, data integration, DevOps, NoSQL, and big data. ');
INSERT INTO SPEAKER VALUES (52,'Philippe','Fierens','FCP ','Philippe is an independent Oracle DBA and architect and Oracle Ace Associate and a regular speaker at Oracle Usergroup conferences As a consultant he helps his clients to find efficient, cost efficient ,performing and creative solutions, he likes to think with the client. The last 5 years he has been involved in various projects using SPARC technology : move M9000 to T5 and LDOMs and this year a move from M9000 to Sparc Supercluster, he is also interested in everything what happens in the SE area, it offers a great value and lots of opportunitiesWhen not working with oracle you can find him with his wife and  2 daughters or behind the camera taking pictures for various occasions and events. You can read more on his blog http://pfierens.blogspot.com or follow him on twitter, his handle is @pfierens');
INSERT INTO SPEAKER VALUES (53,'Pete','Finnigan','PeteFinnigan.com','Pete runs his own Oracle security consultancy, training and software company specialising in helping clients secure their databases. Pete is well known in the community and runs the longest running Oracle security blog, speaks regularly and has a passion for researching new and interesting ideas in securing data');
INSERT INTO SPEAKER VALUES (54,'Simone','Geib','Oracle','Simone Geib is Director at Oracle Corporation. She leads product management for the core SOA Suite, which includes BPEL Process Manager, Oracle Service Bus, Enterprise Manager FMWC, SOA infrastructure. She also coordinates the activities of the SOA Customer Advisory Board (CAB) and works closely with partners.Simone is an active tweeter and blogger and is responsible for the SOA Suite product web sites. Based in Redwood Shores at Oracle’s headquarters, Simone lives in San Francisco, where she spends her time exploring the diverse cultures and terrains the City has to offer.Before Simone joined Oracle, she worked with integration technologies at BEA as a consultant, sales engineer, and product manager.');
INSERT INTO SPEAKER VALUES (55,'Dimitri','Gielis','APEX R' || CHR(38) ||'D','Dimitri Gielis is a Director of APEX R' || CHR(38) ||'D, a company specializing in Oracle Application Express. Dimitri is a frequent presenter at all the major Oracle conferences and an Oracle ACE Director, and he was named Oracle APEX Developer of the Year in 2009.');
INSERT INTO SPEAKER VALUES (56,'Gustavo','Gonzalez','IT Convergence','In 2012, Gustavo was named as CTO, and started to lead two major initiatives at IT Convergence. As a program manager of the Oracle R12.2 beta program, was the first company worldwide joining the efforts with Oracle Development to test an upgrade of Oracle E-Business Suite Release 12.2. He was distinguee as Oracle ACE Director in November 2012 for his strong credentials as Oracle community enthusiast and advocate. Gustavo is co-author of the book “Oracle E-Business Suite Financials Handbook, Third Edition” published by McGraw-Hill and Oracle Press and has made the technical review of the book “Oracle Fusion Applications Development ' || CHR(38) ||' Extensibility Book".');
INSERT INTO SPEAKER VALUES (57,'Joel','Goodman','Oracle','Joel Goodman has been in the computing industry for 39 years after obtaining his degree in Computer Information Sciences. He has 21 years experience with Oracle DBA technology in support, consulting and training. He is the OU Global Team Leader for DBA Certification ExamDevelopment responsible for DBA OCA, OCP, OCE and OCM exam content. Joel also assists the product curriculum development team in courseware development and speakson a variety of advanced DBA topics at numerous conferences. Joel is a member of the Oak Tableand a Certified Master DBA.');
INSERT INTO SPEAKER VALUES (58,'Marco','Gralike','eProseed','Marco Gralike has experience as a DBA since 1994 (Oracle 6). He is also eager and skillful in other fields, like Operating System Administration and Application Servers, mainly to find working performing solutions. He has been specializing in Oracle XMLDB, unstructured data since 2003, focusing on his old love, database administration and performance. He is a dedicated contributor of the Oracle User Group community, OakTable member and ACE Director, helping people with their steep XMLDB, database or Unstructured Data learning curve. To this purpose, Marco devoted his personal blog site to XMLDB (www.xmldb.nl) and other Oracle (data) issues.');
INSERT INTO SPEAKER VALUES (59,'Svetoslav','Gyurov','Red Stack Tech','Svetoslav is Professional Services Team Lead at Red Stack Teck, UK. Svetoslav has been in IT for more than 12 years and has focused on Exadata, high availability and performance tuning for customers across the UK for the past two years. Svetoslav has a range of experience across a broad range of technologies - Oracle Database, Exadata, Linux and networking. He has presented at Open World 2014 and also regularly presents on BGOUG as well as e-DBA''s own events.');
INSERT INTO SPEAKER VALUES (60,'Maria','Gyurova','Peak Indicators','Maria is an Oracle consultant with over 10 years of experience with a primary focus on Oracle Database technology and data integration products. Maria is an OCP DBA 9i, 10g, 11g and has presented at the BGOUG and SIOUG. Maria has participated in a variety of projects implementing Data Warehouse and Business Intelligence solutions through the full project life cycle. Maria is a subject matter expert in Oracle Data Integration area and is open to share the knowledge to the audience.');
INSERT INTO SPEAKER VALUES (61,'Kyle','Hailey','Delphix','Kyle has worked on IT performance for over 20 years. He was a principle designer at Oracle on the Enterprise Manager performance pages which was implemented under waterfall methods. Following that he was the designer of DB Optimizer at Embarcadero using agile methodologies to deliver every version on schedule. Now he works at Delphix bringing agility to one of the biggest hurdles in IT efficiency which is managing large amounts of data when trying to implement agile practices and continuous integration to support rapid flow of features, from development to operations to the production. Kyle holds patents in database performance and speaks around the world at conferences.');
INSERT INTO SPEAKER VALUES (62,'Tim','Hall','oracle-base.com','Tim Hall is an Oracle DBA/Developer and well known Oracle blogger at http://oracle-base.com. If that isn''t enough, he''s written two books and over 700 articles, is an Oracle ACE Director, OakTable member and has presented at numerous user groups and conferences worldwide, as well as a series of 2-day presentations as part of the "Oracle University Celebrity Series".');
INSERT INTO SPEAKER VALUES (63,'Andy','Harrison','Oracle','Andy Harrison is a Principal Software Engineer working in Revenue Product Engineering supporting Solaris on Engineered Systems at Oracle which includes Exadata, Exalogic and SuperCluster. Throughout his 15 years at Sun/Oracle, he has gained a wealth of knowledge of Sun''s H/W and S/W portfolio which he puts to use in diagnosing complex interoperability issues with Solaris. He spends the majority of the time in Engineering developing software solutions, fixing customer issues and writing best practices for deploying ' || CHR(38) ||' configuring Solaris on Engineered Systems.In his spare time Andy enjoys spending time with his family, photography and Karate.Specialties: Solaris, SuperCluster, System Administration, Troubleshooting');
INSERT INTO SPEAKER VALUES (64,'Roel','Hartman','APEX Consulting','Roel is a experienced Oracle Software Architect. He started a long time ago using Oracle RDBMS 5, Oracle Forms 2.3, RPT/RPF and Oracle*Case 4.5. Since a few years he focuses mainly on Oracle Application Express.Roel has been a speaker on UKOUG, OOW, Collaborate, ODTUG''s KSCOPE and a number of local Oracle User Groups. He acts as the APEX Content Lead for the Kscope14 and KScope15 conferences and keeps an (APEX-related) blog on http://roelhartman.blogspot.com. In June 2009 Roel received an Oracle ACE award and in August 2010 he''s appointed as Oracle ACE Director. Roel is a co-writer of the "Expert Oracle Application Express" and "Oracle Application Express for Mobile Web Applications" books.Roel is Director at APEX Consulting in The Netherlands.');
INSERT INTO SPEAKER VALUES (65,'Simon','Haslam','Veriton','Simon is an Oracle ACE Director (Middleware ' || CHR(38) ||' SOA) with 20 years'' experience of using Oracle products. He is both a consultant, specializing in Oracle infrastructure (particularly Fusion Middleware high availability) and more recently the co-founder of O-box Products Ltd – a company developing  robust, secure and highly available Fusion Middleware appliances based on the Oracle Database Appliance Virtualized Platform.A long term volunteer for the UK Oracle User Group, Simon is chair of the Application Server and Middleware SIG and on the steering group for its Tech15 conference. He is a regular conference speaker, magazine author and blogger.');
INSERT INTO SPEAKER VALUES (66,'Tony','Hasler','Anvil Computer Services','Author of "Expert Oracle SQL", Tony is a full-time SQL tuning consultant and an established speaker at UKOUG conferences.');
INSERT INTO SPEAKER VALUES (67,'Sabine','Heimsath','its-people GmbH','Consultant at Oracle GermanyJava Development at DiamosSelf-employed Consultant (SQL, PL/SQL, Apex)');
INSERT INTO SPEAKER VALUES (68,'Antony','Heljula','Peak Indicators','Antony is an Oracle ACE for Business Intelligence.and is one of Europe''s leading BI architects with a focus on the Oracle BI and related database and middleware products including BI Foundation, Exalytics, BI Applications, Spatial, Real-Time Decisions (RTD), Big Data Discovery, Data-Mining, Endeca, SOA Suite and Oracle VM. He has over 15 years'' experience working with Oracle BI and Data Warehousing and is the Technical Director at Peak Indicators');
INSERT INTO SPEAKER VALUES (69,'Peter','Herdman-Grant','EMC','Peter is a Senior Oracle professional with over 15 years experience in Oracle Database Administration, Solutions Architecture and Technical Project Management at Deutsche Bank, Citi and Quest Software. Specialist in Oracle Backup ' || CHR(38) ||' Recovery and High Availability Solutions, with recent experience in Server and Database Virtualization. Strong focus on developing credibility and trust with partners and customers to deliver great technology solutions that address their current and future needs. Particularly interested in Cloud Computing, Converged Infrastructure and Information Lifecycle Management to meet the challenges of Big Data. Peter is from the United Kingdom, studied at Kingston University in London, graduating with BSc (Hons) in Information Systems, and now lives near Cologne/Bonn in Germany.');
INSERT INTO SPEAKER VALUES (70,'Uwe','Hesse','Oracle','20+ years in the IT businessSenior Principal Instructor at Oracle UniversityOracle Certified MasterMember of the Oak TableFrequent speaker at Oracle User Group conferencesRunning a popular blog at uhesse.com');
INSERT INTO SPEAKER VALUES (71,'David','Hickson','British Telecom','Working with Oracle Database products for more than 20 years specialising in RAC, Clusterware, ASM, Dataguard in an Enterprise scale environment with many thousands of deployments using software versions up to the latest available(Oracle 12c).');
INSERT INTO SPEAKER VALUES (72,'Frits','Hoogland','Accenture Enkitec Group','Frits Hoogland is an IT professional specializing in Oracle database performance and internals. Frits frequently presents on Oracle technical topics at conferences around the world. In 2009 he received an Oracle ACE award from the Oracle Technology Network and a year later became an Oracle ACE Director. In 2010 he joined the OakTable Network. In addition to developing his Oracle expertise, Frits works with PostgreSQL, and modern operating systems. Frits currently works at the Accenture Enkitec group.');
INSERT INTO SPEAKER VALUES (73,'Frank','Houweling','AMIS Services','Frank Houweling is an Oracle ADF and Java specialist with AMIS (The Netherlands). He focuses mainly on Oracle Fusion ADF, Java Enterprise development and performance management. During the past years he has been requested several times as troubleshooter of ADF projects with bad performance. As such he has been performing performance analysis, bottleneck detection and developing mitigating solutions based on these analysis. He is also the creator of the AMIS ADF Performance Monitor, an advanced monitor that can identify, report and help solve performance bottlenecks in ADF Fusion applications');
INSERT INTO SPEAKER VALUES (74,'Øyvind','Isene','Bicon','Øyvind Isene works as a DBA consultant in Oslo, Norway. He loves to work with the database, especially with optimisation. He enjoys networking (with people) and being part of the Oracle community. ');
INSERT INTO SPEAKER VALUES (75,'Ed','Jeavons','Inoapps','Ed joined Inoapps in 2015 and has several years of experience in the EPM and BI space having worked in a number of roles in Business Development, Sales, Pre-Sales and Consultancy. He has hands on experience implementing the Oracle Hyperion portfolio at several large global clients.Ed is an Oracle certified implementation specialist in both Hyperion and Business Intelligence solutions and is an approved Oracle University trainer. Ed has lead the creation and delivery of training programmes to large user bases on such projects, and has worked in integration and Hyperion system configuration.Ed has held a direct Sales role with a responsibility for several verticals including Financial Services, Defence, Construction and IT at both an independent Partner and leading global SI (Accenture).In his role at Inoapps, Ed is responsible for the growth of Enterprise Performance Management and Business Analytics both on-premise and in the Cloud.');
INSERT INTO SPEAKER VALUES (76,'Lasse','Jenssen','EVRY, Financial Services','I''m a Java developer and Oracle expert, focusing on relational database performance. The last 15 years I''ve worked with Oracle performance towards - for instance - electric power vendors, insurance, communication and banking companies, both in new and existing projects. Very often I''m hired to clean up after several attempts of solving performance issues. Former presenter at JavaZone (2013) and other events such as Oracle User Groups and webinars. The speaker has also been leading classroom courses through Oracle University, and different colleges ("Høgskolen i Hedmark" and "Høgskolen i Sør Trøndelag").');
INSERT INTO SPEAKER VALUES (77,'Mark','Johnston','Calderdale MBC','Oracle DBA and Solaris Sysadmin, for over 25 Years.  Local Government Site,  many inhouse developments using Forms and Apex. ');
INSERT INTO SPEAKER VALUES (78,'Klaas-Jan','Jongsma','VX Company','Klaas-jan has been working in IT since the early nineties. His career started out as an system ' || CHR(38) ||' network administrator working with a range of operation systems such as AIX, Solaris, Cisco IOS and Windows. He began to focus more and more on Oracle RAC databases and the infrastructures surrounding it, besides working with MySQL and SQL Server databases. Klaas-Jan currently works for VX Company, an Oracle Exadata partner in the Netherlands, as a senior Oracle DBA specializing on Oracle Exadata, RAC databases and Enterprise Manger. Klaas-jan is also an Oracle ACE associate since 2014.');
INSERT INTO SPEAKER VALUES (79,'Joel','Kallman','Oracle','Joel R. Kallman is Director of Software Development for Oracle''s Server Technologies division at Oracle America, Inc.  He is responsible for the development and product management of Oracle Application Express.  Joel has been at Oracle since 1996 and is the co-creator of Oracle Application Express.  He is a contributing author of several books on Oracle technology, including Expert One on One Oracle, Beginning Oracle Programming, and Mastering Oracle PL/SQL: Practical Solutions.   Joel holds a Bachelor of Science degree in Computer and Information Science from the College of Engineering, Ohio State University.');
INSERT INTO SPEAKER VALUES (80,'Edelweiss','Kammermann','Rittman Mead','Edelweiss Kammermann is an Oracle ACE, BI and DW specialist with over 18 years of consulting and project management experience in Oracle technology. Edelweiss has been an Oracle University trainer for 14 years and have taught a variety of courses including BI, BPM, Warehouse Builder and Data Integrator. She is currently working at Rittman Mead developing and delivery new courses as Training Materials Specialist.She is co-founder and Vice President of the Oracle User Group of Uruguay (UYOUG), writes blog posts and articles for OTN, and is a frequent speaker at many international conferences.');
INSERT INTO SPEAKER VALUES (81,'James','Kao','Oracle','James is a product manager in the Oracle Enterprise Manager team focusing on SOA and Fusion Middleware Management');
INSERT INTO SPEAKER VALUES (82,'Atul','Kumar','K21 Technologies','Atul Kumar is Oracle ACE, Author, Blogger, Speaker and Technical Architect specialised in Oracle Fusion Applications, E-Business Suite, Fusion Middleware ' || CHR(38) ||' Identity ' || CHR(38) ||' Access Management. He is author  of two books on Oracle Identity ' || CHR(38) ||' Access Management including integration with E-Business Suite R12 for SingleSign-On. He has 15+ years of experience working on Oracle Technologies (ERP/CRM, Fusion Applications, Middleware and Databases).  He is also found of K21 Technologies, Oracle Gold Partner specialising in Design, Implement(Install/Configure/Integrate), and Maintenance of Oracle products. Atul Kumar share his experience on his famous blog http://onlineAppsDBA.com (3400+ subscribers) .');
INSERT INTO SPEAKER VALUES (83,'Keith','Laker','Oracle','Data Warehouse Consultant and Product Manager with extensive experience of data warehouse and business intelligence market having worked in a variety of roles, including: post sales consultancy, customer support and product management. Worked in a number of locations across Europe and also in California at Oracle''s HQ in Redwood Shores.??Almost 15 years with Oracle. Worked in consulting, support, on-site Premium Support, and now product management. Currently I am part of ST Data Warehouse Product Management team, providing PM support to DW focused sales and Consulting services organization to help ensure the successful and effective delivery of DW solutions. ');
INSERT INTO SPEAKER VALUES (84,'Chris','Lawless','Dbvisit Software','Chris is a passionate VP Product Manager with 11 years experience in the replication space. His past experience in training DBAs and working in support have taught him the value of customer interaction. Chris likes working with customers to make sure that their business needs are being met with technical tools and requirements. Chris loves to read, hike and canoe.');
INSERT INTO SPEAKER VALUES (85,'Jason ','Lester','Capgemini UK Ltd','Jason has been working with Oracle for over 20 years as a developer, DBA and architect. He''s watched the product evolve, contributed in UKOUG events, and planning, and spoken at a number of events.');
INSERT INTO SPEAKER VALUES (86,'Jonathan','Lewis','JL Computer Consultancy','Jonathan Lewis is a well-known figure in the Oracle world with more than 27 years experience using the software. He has published three books about Oracle - the most recent being "Oracle Core" published by Apress Nov 2011 - and contributed to three others. He runs a couple of websites and contributes fairly regularly to newsgroups, forums, and User Group magazines and events around the world.Jonathan has been self-employed for most of his time in the IT industry. For more than t 20 years he has specialised in short-term assignments, typically of a design, review, or trouble-shooting nature - often spending no more than two or three days on a client site to address problems . He runs seminars about using Oracle all over the world and has visited more than 50 different countries (and more than a dozen US states) to talk about, or trouble-shoot, Oracle systems, but now spends more time in the UK using Internet technology to handle remote trouble-shooting assignments.');
INSERT INTO SPEAKER VALUES (87,'Niall','Litchfield','Markit','Niall is an internationally recognized Oracle professional and a longstanding member of the OakTable network. He has  almost 20 years experience with Oracle and has presented regularly at UKOUG events as well as in South Africa, Norway Switzerland.');
INSERT INTO SPEAKER VALUES (88,'Bryn','Llewellyn','Oracle','Bryn Llewellyn has worked in the software field for more than 35 years. He joined Oracle UK in 1990 at the European Development Center to work on the Oracle Designer team. He transferred to the Oracle Text team and then into consulting as the text specialist for Europe. He relocated to Redwood Shores in 1996 to join the Oracle Text Technical Marketing Group. He has been the product manager for PL/SQL since 2001. In 2005, he became responsible, additionally, for edition-based redefinition (EBR for short). This is the Oracle Database capability that supports online application upgrade.');
INSERT INTO SPEAKER VALUES (89,'Anthony','Macey','TMD Associates','Oracle Database, Big-Data ' || CHR(38) ||' Fusion professional with over 20 years of experience across public sector, finance, health, oil, and telecoms. Professional member of the BCS and Independent member of the UKOUG.');
INSERT INTO SPEAKER VALUES (90,'Fiona','Martin','KPMG','Fiona has over 19 years experience in Sales, Services Management and Business Development roles in the IT industry working within the Oracle Enterprise Applications marketplace. Her experience includes selling service, software and hardware solutions, ranging from complex multi-million dollar projects to small implementations. She has significant experience of defining and driving business growth initiatives across many lines of business, demonstrated by delivering consistent growth for one of the most complex IT Industry Alliances IBM ' || CHR(38) ||' OracleWithin the Oracle economy she her eminence is widely recognised. She is a member of UKOUG Board and chairs UKOUG Council, she chairs the UK Oracle User Group Partner Forum and sits on the Oracle UK Partner Advisory Board. ');
INSERT INTO SPEAKER VALUES (91,'Connor','McDonald','Oracle','Connor McDonald is an Oracle Ace Director and over the past 18 years, has worked with systems in Australia, the UK, Southeast Asia, Western Europe, and the United States. He has co-authored three books, and has been a popular speaker at Oracle conferences around the world, specializing in topics regarding the database engine and PL/SQL. He has twice won the Inspirational Speaker award by the UK Oracle User Group in 2009 and 2011.');
INSERT INTO SPEAKER VALUES (92,'Duncan','Mills','Oracle','Duncan Mills is senior director and architect for Oracle''s Application Development Framework within the Oracle Development Tools and mobility division. He has been working with Oracle in a variety of application development and DBA roles since 1988. For the past twenty years he has been working at Oracle in both support and product development, spending the last ten years in product management. Duncan is the co-author of the Oracle Press books "Oracle JDeveloper 11g Handbook: A Guide to Fusion Web Development and Oracle JDeveloper 10g for Forms" and "PL/SQL Developers: A Guide to Web Development with Oracle ADF."');
INSERT INTO SPEAKER VALUES (93,'Darren','Moffat','Oracle','Darren is a Senior Principal Engineer in the Solaris Core Technoglogiesgroup. He is one of the architects for Solaris Security, and has afocus on authentication, cryptography and application containment.  Hewas also the architect and lead developer for the encryptionfunctionality in ZFS.');
INSERT INTO SPEAKER VALUES (94,'Robin','Moffatt','Rittman Mead','Robin Moffatt is a Principal Consultant at Rittman Mead, and an Oracle ACE. He specialises in Exalytics and OBIEE, as well as ODI and more recently delving into the worlds of Hadoop and ElasticSearch. His particular interests are systems architecture, administration, and performance testing and optimisation. He blogs at http://ritt.md/rmoff and can be found tweeting grumpy geek thoughts as @rmoff.');
INSERT INTO SPEAKER VALUES (95,'Dermot ','Murray','Inoapps','Dermot has spent the best part of 20 years delivering solutions using Oracle technology.  From an initial role as an Oracle Forms developer, he has worked across a wide range of technology roles including analyst, consultant and project manager.He is now responsible for the the Inoapps Professional Services team, which consists of a team of specialists that deliver innovative solutions to Inoapps customers. Using Oracle database and middleware tools, Dermot’s team has worked on a variety of projects including Fusion Middleware and E-Business Suite integration.');
INSERT INTO SPEAKER VALUES (96,'Osama','Mustafa','Gurus Solutions','Osama Mustafa is Founder of Gurus Solutions Company, Oracle ACE Director , Creator/Director of Jordan Amman Oracle User Group the first Group in Jordan related to oracle technology,Author of the book Oracle Penetration Testing, Osama has been working on project and customer support in EMEA Region, Providing Database Implementation Solutions, his specialties Fusion middleware, In memory database Timesten, Exalytics and Exalogic machine, Include to this Osama Is frequently Speaker in Oracle User Groups around the world and one of RAC ATTACK event organizer, Fusion middleware ATTACK Organizer as well, he published articles in Oracle Magazine, OTECH magazine and UKOUG Oracle Scene magazine, Also he is Blogger and Certified Oracle Database and Fusion middleware, he  assists with sharing his knowledge at conferences, webinars, white papers ,slide share and blog posts to the Oracle community, Simply he is Oracle passionate.');
INSERT INTO SPEAKER VALUES (97,'Dev','Nayak','Dsp','Deputy chair of the Rac cia sig. Director of dsp the UKOUG database partner of the year.');
INSERT INTO SPEAKER VALUES (98,'Andrey','Nikolaev','RDTeX','Andrey Nikolaev was first met with Oracle 5 in 1988. Since that time, his professional interests have evolved from high performance particle physics computing, through application development, to database performance consulting, but always stay centered on performance. Working in RDTEX, Russian First Line Support company, he devotes his time to tuning and diagnosing the largest Oracle databases in Russia. Andrey also maintains specialized “Latch Mutex and Beyond” blog: http://andreynikolaev.wordpress.com/');
INSERT INTO SPEAKER VALUES (99,'Frank','Nimphius','Oracle','Frank Nimphius is a Senior Principal Product Manager for Oracle Corporation working in the Oracle Mobility and Development Tools organisation.  Frank joined Oracle Forms Product Management more than 15 years ago and since then moved on to Oracle JDeveloper, Oracle Application Development Framework (ADF) and the Mobile Application Framework (MAF) product. As part of his ADF and MAF community contribution Frank co-authored "Oracle Fusion Developer Guide", an ADF book published by McGraw Hill in 2010, writes for Oracle Magazine, frequently publishes whitepapers, blog articles and tutorials, and records ADF and MAF learning videos for YouTube amd Oracle University. Frank runs the ADF Code Corner and Mobile Code Corner websites and is a contributor to the ADF Architecture Square website. As a presenter, Frank represents Oracle at OOW and various user group events around the world.  Beyond this, Frank occasionally creates and teaches internal and external trainings on Oracle ADF, Mobile Application Framework and Oracle Mobile Cloud Services. ');
INSERT INTO SPEAKER VALUES (100,'Alex','Nuijten','Ordina','Alex Nuijten works as a key consultant for Ordina Oracle Solutions in The Netherlands. Besides his consultancy work, he conducts training classes, mainly in APEX, SQL and PL/SQL. Alex has been a speaker at numerous international conferences, such as ODTUG, Oracle Open World, UKOUG, IOUG, OUGF, BGOUG, OGH and OBUG. He was part of the Nordic ACE Directors Tour in 2012. He is also a frequent contributor at the Oracle Technology Network forum for SQL and PL/SQL. He wrote many articles in Oracle related magazines, and at regular intervals he writes about Oracle Application Express and Oracle database development on his blog "Notes on Oracle" (nuijten.blogspot.com). Alex is co-author of the book “Oracle APEX Best Practices” (published by Packt Publishers). In August 2010, Alex was awarded the Oracle ACE Director membership.');
INSERT INTO SPEAKER VALUES (101,'Kerry','Osborne','Accenture Enkitec Group','Kerry Osborne is an Oracle performance specialist. He is the founder of Enkitec; an expert model Oracle-focused consulting company that was acquired by Accenture in 2014. Kerry has co-authored two Oracle books, Pro Oracle SQL (with Karen Morton) and Expert Oracle Exadata (with Taenl Poder).');
INSERT INTO SPEAKER VALUES (102,'Franck','Pachot','DBi Services','Franck Pachot is senior consultant at dbi services in Switzerland. He has 20 years of experience in Oracle databases, all areas from development, data modeling, performance, administration, and training. Oracle Certified Master and Oracle ACE, he tries to leverage knowledge sharing in forums, publications, presentations. ');
INSERT INTO SPEAKER VALUES (103,'Simon','Pane','Pythian','Simon has worked as a DBA consultant for many years covering the Oracle Database from versions 6 through 12c.  His focus is on Oracle High Availability, Monitoring, Backup ' || CHR(38) ||' Recovery, Migration ' || CHR(38) ||' Consolidation, and Security and has experience with literally thousands of database environments at hundreds of client sites ranging from small single database implementations to large corporate enterprises.  Simon enjoys sharing technical knowledge and has presented at many user groups and conferences in Canada and the United States.Credentials include:* Oracle ACE Associate* Oracle Certified Expert (OCE)* Oracle Certified Database Administrator (OCP) - 8.0,8i,9i,10g,11g and 12c');
INSERT INTO SPEAKER VALUES (104,'Dhananjay','Papde','SITA','Extensive IT experience on Oracle databases, E-business Suite and BI.Lead Specialist ' || CHR(38) ||' Oracle Architect at SITAAuthor of “Oracle Enterprise Manager 12c Administration Cookbook”Technical Reviewer of Book “Pro Oracle Fusion Applications: Installation and Administration”Oracle ACE Associate  Won Oracle Fusion Middleware Innovation Award at Oracle Open World 2011Speaker at various Events* Oracle Open World 2013, 2014* UKOUG Tech13 * UKOUG Apps14* UKOUG Annual Conferences in 2012, Special Interest Groups* Oracle Data Innovation Forum in London ' || CHR(38) ||' Dublin');
INSERT INTO SPEAKER VALUES (105,'Pravin','Patil','Apps Associates','Pravin Patil is a BI/Analytics professional with 20+ years of industry experience, mainly around Oracle technologies. In the recent past my focus has been as BigData with Data Warehouse, Hadoop and Machine Learning solutions.He is the board of director for BIWA SIG -IOUG. He is Practice Director at Apps Associates. Pravin is regular speaker at Collaborate, regional OAUG, IOUG, BIWA Summit, Data Summit NYC and similar events.');
INSERT INTO SPEAKER VALUES (106,'Zoran','Pavlovic','Parallel d.o.o.','Zoran works for Parallel as an Oracle Technical Architect. He has been working as an instructor for Oracle University for more than 5 years. As an active member of the Oracle community and a long-time Oracle Database enthusiast, Zoran frequently delivers technical presentations and demonstrations about Oracle technologies. He is an author of upcoming book about security in Oracle Database 12c. Zoran is first member of Oracle ACE Program in Serbia, and a featured speaker/author at many conferences/magazines.');
INSERT INTO SPEAKER VALUES (107,'Fabio','Persico','Infomentum','After completing an MSc in Computer Science, Fabio began his career at Oracle. During his time at Oracle, Fabio worked with an array of products including the Java 2 Enterprise Edition (J2EE) platform, Database, Application Server and Collaboration Suite; particularly specialising in Oracle SOA Suite. Eight years of IT industry experience later, Fabio’s role at Infomentum sees him working as an Oracle SOA and Fusion Middleware Consultant. Fabio plays the developer/architect role in customer projects based on these technologies. Fabio is very passionate about technology and takes every opportunity to improve and challenge himself.');
INSERT INTO SPEAKER VALUES (108,'Tanel','Poder','Gluent, Inc','Tanel Poder is one of the leading Oracle Database performance specialists in the world, having helped solve complex problems for customers in 25 countries on five continents. He focuses on advanced Linux, Oracle and Hadoop topics, including optimization of Oracle''s Big Data Appliance and Exadata systems. Tanel has received the "Oracle ACE Director" recognition for his community contribution, research and publications, he is also a co-author of the Expert Oracle Exadata book.');
INSERT INTO SPEAKER VALUES (109,'Gautam','Prakash','PricewaterhouseCoopers','Gautam is an Oracle GRC Advanced Controls (OAC) Suite and Oracle E-Business Suite Controls specialist in the IT Assurance practice based out of Leeds, England. He has more than 9 years of experience in helping clients identify and limit their ERP risks, both from a project implementation and from a controls point of view. Gautam has end-to-end experience in implementing Oracle OAC Suite of applications as a Project Manager, Functional Consultant and the Technical Architect. He has also supported clients by carrying out Proof of Concept (PoC) projects to determine suitability and by reviewing OAC implementations. Of late, Gautam has also been heavily involved in developing GRC accelerators to offer greater value to the firm’s clients.');
INSERT INTO SPEAKER VALUES (110,'Toby','Price','Claremont','Toby has worked in the Oracle domain for nearly thirty years, from within Oracle, with partners and as an independent management consultant. He has a diverse range of experience including IT Architect, Project Manager and Salesperson. In the last 7 years, he has focussed on Oracle Analytics solutions, blogging and tweeting regularly. He’s also had exposure to many vertical industry sectors and co-wrote Oracle’s Agile methodology. Toby has spoken at many conferences including Oracle Openworld and many UKOUG and other conferences.');
INSERT INTO SPEAKER VALUES (111,'Marcin','Przepiorowski','Delphix',' I''m working with Oracle technology stack since 2001. I''m interested in two areas - high availability (DataGuard, RAC, etc) and performance monitoring and troubleshooting. For last 10 years I''m involved in OUG community and blogger community. I presented on UKOUG, Polish OUG, Irish and BGOUG conferences. I''m a proud member of OakTable Network since March 2013.');
INSERT INTO SPEAKER VALUES (112,'Zulfikar','Qureshi','Oracle','My name is Zulfikar Qureshi and I am a Presales consultant at Oracle Corporation UK, working within the Data Integration Solutions team. I graduated from Westminster University with a BSc in Business Information Technology with honors in 2001. After graduating, I have held Presales roles in different organizations with over 14 years experience working within the database and data integration domain; data modeling, database administration and real-time data movement technologies. The last 7 years I have spent at Oracle specializing in the real-time data movement space working with Oracle GoldenGate to help customers with their high availability/disaster recovery, moving from batch orientated process to more agile real time operational data warehousing and migration/upgrading requirements. ');
INSERT INTO SPEAKER VALUES (113,'Peter','Raganitsch','FOEX GmbH','Peter Raganitsch, co-founder and director FOEX GmbH in Austria, has long term experience with Oracle APEX and has been developing Applications with Oracle Products since 1995. The APEX community knows him for his work in improving Oracle Application Express with things like the APEX Developer Addon, Plugins, and the ApexLib Framework.Peter is an Oracle Ace Director and active Speaker on the international conference circuit and initiator of the orclapex Vienna Meetup.');
INSERT INTO SPEAKER VALUES (114,'Shakeeb','Rahman','Oracle','Shakeeb Rahman is a Principal Software Developer at Oracle and leads user interface design for Oracle Application Express (APEX), packaged apps, and themes.  Shakeeb strives to empower APEX developers with the tools they need to build clean, beautiful, responsive applications and regularly presents at industry conferences including Oracle OpenWorld and ODTUG KScope. You can gain insights into what Shakeeb is up to by following @shakeeb on Twitter.');
INSERT INTO SPEAKER VALUES (115,'Anthony','Rayner','Oracle','Anthony Rayner works for the Application Express (APEX) development team at Oracle. Joining Oracle in 2005, Anthony worked in consulting for 3 years, before moving over to his current role in the APEX team. Anthony works in different areas across the product, with primary focus on Interactive Reports, Dynamic Actions, JavaScript code and accessibility.');
INSERT INTO SPEAKER VALUES (116,'Antony','Reynolds','Oracle','Antony has worked with Oracles Integration products for more than 10 years and is the author of the Oracle SOA Suite 11g Developers Guide and the SOA Suite 11g Developers Cookbook.');
INSERT INTO SPEAKER VALUES (117,'Mark','Rittman','Rittman Mead','Mark Rittman is an Oracle ACE Director, CTO and co-founder of Rittman Mead, and has worked with Oracle BI+DW technology for 15+ years. Mark writes regularly for Oracle Magazine and wrote the Oracle Press Book "Oracle Business Intelligence Developers Guide"');
INSERT INTO SPEAKER VALUES (118,'Grant','Ronald','Oracle','Grant Ronald is Director of Oracle Product Management for Mobility and Development Tools responsible for customers successfully adopting Oracle technologies. He has been with Oracle for 18 years working on Forms, JDeveloper, ADF and mobile technologies. Previously he spent 7 years as a developer at EDS Defence. He is author of the McGrawHill book "The Quick Start Guide to Fusion Development", a regular magazine contributor, has spoken over 50 times at OUGs and Oracle World, and has won three awards from UKOUG for presenting and writing.');
INSERT INTO SPEAKER VALUES (119,'Bjoern','Rost','portrix Systems GmbH','Oracle ACE Director Björn Rost is the co-founder of portrix Systems, a service provider and consulting company focused on Oracle Technology, including servers, storage, Oracle Linux and Solaris to Real Application Cluster databases. He enjoys working with software developers to tightly integrate with existing Oracle features, oversees the operation operations for a number of cloud or SaaS platforms and consults on high availability, performance tuning and OS and DB management. He is passionate about sharing knowledge and is a regular speaker at user group conferences around the world with more than 42 presentations on five continents. He also serves as the president of IOUG''s RAC special interest group.');
INSERT INTO SPEAKER VALUES (120,'Mike','Salins','Actifio, Inc.','Mike Salins is a 25-year veteran in the IT industry, with hands-on experience working in Global IT organizations as well as Technology Vendors.  With experience working with both infrastructure and application teams, he has developed the ability to see the "big picture".  Mike is currently a Principal Product Manager for Actifio, with a focus on leveraging Actifio''s unique data virtualisation technology to improve the DevOps and Test-Data-Management processes.');
INSERT INTO SPEAKER VALUES (121,'Chris','Saxon','Oracle','Chris has built up expertise in SQL over the past ten years working as an Oracle developer, DBA and architect. During this time he''s built up a passion for interacting with data using SQL and helping others do the same. Combining this with a love of games and quizzes, Chris started the design quiz on the PL/SQL Challenge in 2013. He’s now joined Steven Feuerstein’s Developer Advocate team to help people get the best out of their Oracle databases. Chris also posts daily tips for SQL on Twitter at @sqldaily.');
INSERT INTO SPEAKER VALUES (122,'Danilo','Schmiedel','Optiz Consulting','Danilo follows his passion to deliver SOA and BPM solutions based on new technologies ' || CHR(38) ||' trends. He is one of the leading BPM and SOA Architects at OPITZ CONSULTING Deutschland GmbH – a German Oracle Platinum Partner. He is involved in large integrations, business process automations and BPM / SOA development projects where he implemented well accepted solutions for various customers. Danilo is an Oracle ACE Director (ACE=Acknowledged Community Expert), a frequent speaker at IT conferences and he has written numerous articles in various technical journals. Before joining OPITZ CONSULTING he worked as Software Engineer in several international projects. The Leipzig University of Applied Science has awarded his outstanding reputation in 2009. ');
INSERT INTO SPEAKER VALUES (123,'Peter','Scott','Accenture Digital','Peter is an expert level Oracle BI and Data warehousing consultant specialising in high-performance ETL, data warehouse design and data quality, When he is not working for his customers he is blogging, tweeting or speaking on Oracle, Big Data or life in general');
INSERT INTO SPEAKER VALUES (124,'Pete','Sharman','Oracle','Pete is the database architect for the DBaaS / DBLM team in the Enterprise Manager product management group.  He has over 20 years Oracle experience, and has presented at many conferences.');
INSERT INTO SPEAKER VALUES (125,'Noel','Sidebotham','Oracle','Noel Sidebotham, Business Development Manager for Oracle Data Integration Solutions EMEA and an Oracle Certified Specialist in Oracle Data Integration. Noel brings over 15 years of experience in data integration, real-time data movement and replication, high availability solutions, heterogeneous systems management and application performance manager. He has spoken at UK OUG and SIGs, BI Summit and Data Innovation Forum');
INSERT INTO SPEAKER VALUES (126,'Mark','Simpson','Griffiths Waite','In addition to being an Oracle ACE Director, Mark leads the Fusion Middleware development team at Griffiths Waite, with a focus on UX, BPM and SOA.  He has worked with these technologies for over 10 years, having successfully delivered a first BPEL project back in 2004 and first BAM dashboards in 2005 for a leading Financial Services organisation.  Recently Mark has been the architect on a design focussed ADF and Webcenter project delivering increased customer insight through data visualisations with a SOA backbone to ensure consistency in process, services and data.');
INSERT INTO SPEAKER VALUES (127,'Ann','Sjökvist','SE - JUST LOVE IT','My passion is Oracle database, and specially the Standard Edition Database, since it has kept me innovative and creative, and will continue to challenge me in many ways. 2007-2013 - Creator' || CHR(38) ||'Admin of a Standard Edition DB HealthCareService "Zero2Production" - a preventive and proof-of-concept Service for a PDM systemOCP11,OCA11,OCS11,SqlExpert - cerified');
INSERT INTO SPEAKER VALUES (128,'Terry','Smith','Oracle','Terry is a pre-sales consultant providing pre-sales support for the SPARC processor based range of systems. Terry joined Oracle as part of the Sun acquisition and has been in the combined organization for over 20 years. He has a wide range of experience in SPARC hardware, starting with the E10K in 1995, was involved with the launch of the E15K in 2001 and the M-series launch in the UK in 2005. More recently he has gained experience of Chip-Multithreaded based systems and the virtualisation technologies used in them. Terry wrote the prototype for Dynamic Resource Management, which first appeared in the 1.3 version of the Logical Domain software.');
INSERT INTO SPEAKER VALUES (129,'Paddy','Spencer','Premier Farnell','Having spent more than a decade in Middleware and SOA consultancy, first with BEA and (following the 2008 acquisition) with Oracle, in 2011 I decided to get a real job and joined Premier Farnell as Global Integration Architect. Here I hold responsibility for all integration technologies, Oracle Fusion Middleware and otherwise, and am defining and steering the move from message-based integration to a services based architecture.');
INSERT INTO SPEAKER VALUES (130,'Craig','Sykes','Explorer','Development Consultant at Explorer. Craig has an MSc in Computing Science and is an experienced software engineer, utilising development tools such as PL/SQL and APEX to provide bespoke ERP software to both UK and international businesses. Craig has experience developing solutions to connect Oracle systems to a wide range of existing external applications within business environments.');
INSERT INTO SPEAKER VALUES (131,'Kiran','Tailor','CIMA','Over 15 years experience as a Senior Oracle Database Administrator in Oracle 8i,9i,10g,11g on Linux,Solaris 9 ' || CHR(38) ||' 10 and Windows comprising of installations, configurations and upgrades. This has allowed me to build up my skills and knowledge in Oracle ASM,Oracle RAC, Dataguard, Application Sql Tuning, Backup ' || CHR(38) ||' recovery through RMAN.The drop in prices of memory and growth of DRAM capacity has enabled a new type of database: an in-memory database. Recently I have been extensively working with Oracle Exalytics comprising of OBIEE configuration and full integration of Times Ten DB (In-Memory) to Oracle DAC.');
INSERT INTO SPEAKER VALUES (132,'Brendan','Tierney','Oralytics','Brendan Tierney, Oracle ACE Director, is an independent consultant and lectures on Data Mining and Advanced Databases in the Dublin Institute of Technology in Ireland. He has 22+ years of extensive experience working in the areas of Data Mining, Data Warehousing, Data Architecture and Database Design. Brendan has worked on projects in Ireland, UK, Belgium and USA. Brendan is the editor of the UKOUG Oracle Scene magazine and deputy chair of the OUG Ireland BI SIG. Brendan is a regular speaker at conferences across Europe and the USA and has written technical articles for OTN, Oracle Scene, IOUG SELECT Journal and ODTUG Technical Journal. Brendan has published his Oracle Press book called Predictive Analytics using Oracle Data Miner, in 2015 and is currently writing a book titled Oracle R Enterprise.email               : brendan.tierney@oralytics.comtwitter             : @brendantierneyblog                 : www.oralytics.combook on Amazon: http://tinyurl.com/orovpv8');
INSERT INTO SPEAKER VALUES (133,'Paul','Toal','Oracle','Paul is a very passionate and capable IT security consultant specialising in the field of Information Security. He has worked in IT for over 18 years and built up a wide-ranging and in-depth level of knowledge and skills. Working at all levels from board-level business cases and architecture of solutions, through to delivery, training and post-sales support, Paul has worked in both pre-sales and consulting delivery roles.Paul’s current focus is on security related to Cloud and Enterprise Mobility.');
INSERT INTO SPEAKER VALUES (134,'Juris','Troshins','DBA Competence Center','I’m co-owner and expert at DBA Competence Center LTD. I have more than 14 years experience with Oracle Technologies and hold worldwide recognized OCP, OCE and OCM certification. Our company acted first as Oracle First Line Support and now we are delivering our own services and helping people to solve their problems with Oracle products. I’m also delivering Oracle University training courses on regular basis and frequent speaker at our own tech seminars like Oracle Days and LVOUG events. Speaker for Harmony 2011, 2012, 2015 and UKOUG 2011-2014.');
INSERT INTO SPEAKER VALUES (135,'Mia','Urman','AuraPlayer','Mia Urman is an Oracle ACE Director and a world-class expert in Oracle Forms,  ADF and Oracle Mobile solutions with over 16 years of experience presenting, supporting, training, and consulting Oracle products. Mia became intimately familiar with some of the leading challenges facing Oracle Forms/ERP clients and co-founded AuraPlayer (formerly OraPlayer), a development house providing solutions in the mobile, SOA, integration, auditing, and monitoring fields. AuraPlayer creates web services from Oracle Forms business logic that can be exposed and run from mobile, cloud computing, or SOA systems. She currently serves as AuraPlayer''s CEO.Mia is a seasoned presenter on Oracle technologies and has presented at various conferences including Oracle OpenWorld, Kscope, UKOUG, and IOUG Collaborate.');
INSERT INTO SPEAKER VALUES (136,'Wilfred','van der Deijl','The Future Group','Oracle ACE Director Wilfred van der Deijl is an independent Oracle contractor with a focus on Fusion Middleware and ADF. He brings more than fifteen years of development and technical experience to his role. Wilfred is an active member of the Oracle community; he runs his own Oracle Fusion Middleware blog at redheap.com, is a member of two of Oracle''s Customer Advisory Boards, was featured in Oracle Magazine, is an OTN author, and a frequent (award winning) speaker at events including ODTUG KScope, UKOUG Tech, and Oracle OpenWorld.');
INSERT INTO SPEAKER VALUES (137,'Robert','van Mölken','AMIS','Robert is a Senior Oracle Integration Specialist with an emphasis on building service-oriented business processes. Robert has over 7 years of experience in Oracle''s SOA Suite and Oracle''s Service Bus (10g, 11g and 12c). Where his specialty is with BPEL, SCA, SOAP, XPath, XQuery, XML, Java, JAX-WS, Advanced Queueing, and PL / SQL. Robert is a frequent author of blog-articles and a SIG leader for SOA Suite at AMIS and for the Oracle Dutch User Group (OGh). Robert participates in various SOA Suite 12c Beta programs and organizes most of the activities around the Beta programs at AMIS.');
INSERT INTO SPEAKER VALUES (138,'Maja','Veselica','Parallel d.o.o.','Maja Veselica, MSc in Software Engineering, works for Parallel d.o.o. as a Consultant.She is an instructor for numerous Oracle courses and a regular speaker at Oracle-related conferences. Maja is also a member of Oracle ACE program, an author of upcoming book (Oracle Database 12c Security Cookbook) and has more than 20 Oracle certificates.');
INSERT INTO SPEAKER VALUES (139,'Sten','Vesterli','Scott/Tiger A/S','Sten Vesterli is one of Europe''s leading experts on successfully using Oracle technology. His special focus is Oracle ADF, and his book "Oracle ADF Enterprise Application Development - Made Simple" is just out in 2nd edition. Additionally, he has written "Developing Web Applications with Oracle ADF Essentials" and "Extending and Customizing TIA7 with Oracle ADF"He is recognized by Oracle with the title of Oracle ACE Director, is a Fusion User Experience Advocate for Oracle and sits on the Oracle Usability Advisory Board.  Sten is the recipient of the ODTUG 2009 Best Speaker award and is a frequent speaker at Oracle conferences. As a Senior Principal Consultant for Scott/Tiger, he works with customers world-wide both remotely and on-site.He is an Ironman triathlete and lives in Denmark. Follow Sten on his blog at http://www.vesterli.com or on twitter @stenvesterli');
INSERT INTO SPEAKER VALUES (140,'Hans','Viehmann','Oracle','Hans Viehmann is working for ORACLE Corporation as Product Manager for the Oracle Spatial and Graph option and the „Location Products“. In his first role he came across GIS Systems and Spatial Databases for the first time. He specialized in this subject and after various positions in Presales and Presales Management he joined the Product Management Team in 2011. Since then he represents the ORACLE Spatial and Graph Development Team in Europe, Middle East and Africa and is a regular speaker at conferences and symposia in the region.');
INSERT INTO SPEAKER VALUES (141,'Mark','Waite','Griffiths Waite','Mark has been working in the Oracle technology field since 1989. He co-founded Griffiths Waite in 1994 to focus on building enterprise business critical solutions on the Oracle platform. Griffiths Waite is now recognised as one of the UK’s leading technology consultancies providing Oracle WebCenter, ADF, Mobile, SOA and BPM solutions to UK enterprises.');
INSERT INTO SPEAKER VALUES (142,'Ben','Weber','Barclays','An Oracle developer and DBA, working with all versions of Oracle since 7.3 in 1995.');
INSERT INTO SPEAKER VALUES (143,'Luis','Weir','HCL','Luis Weir is an Oracle Ace Director and a Digital Principal Architect for HCL technologies  With several years of experience implementing IT solutions across the globe, Luis has successfully delivered several large and complex Service Oriented Architecture (SOA) and API solutions for Fortune 500 companies. He has led SOA and other middleware capabilities for different renowned SIs such as CSC, Cognizant and Capgemini.  Luis is currently focused in creating digital solutions and strategies to key global HCL customers adopt and realise the full benefits that technologies such as APIs, mobile frameworks, cloud integration platforms and IoT can bring to the business. <BR><BR>Luis is very passionate about technology. He has co-authored 2 books (<a href="https://www.packtpub.com/application-development/oracle-soa-governance-11g-implementation" target=_blank>Oracle SOA Governance 11g Implementation</a> and Oracle API Management 12c Implementation), a blogger and also a regular speaker in major conferences and events. A well-known industry expert especially when it comes to Oracle middleware technologies Luis is also an Oracle ACE and OTN certified SOA black belt.');
INSERT INTO SPEAKER VALUES (144,'Nick','Whitehead','Oracle','As Functional Lead for Business Analytics, Nick is responsible for defining Oracle’s go-to-market strategy in Europe, Middle East and Africa.During his tenure in Oracle, Nick has seen the solution portfolio expand into data warehousing, advanced analytics ' || CHR(38) ||' big data, Business Intelligence platform, Analytic Applications including EPM and Real Time Decisions. Most recently he sees developments in Information Discovery with Visual Analyzer and Big Data Discovery and in-memory analytics with Exalytics.Prior to joining Oracle Corporation, Nick has worked in sales management and technical marketing for global players in Business Intelligence and computer aided software engineering');
INSERT INTO SPEAKER VALUES (145,'Martin','Widlake','ORA600','Martin has been working with Oracle technology since 1992, mostly as a performance and database design expert as well as a PL/SQL programmer. He presents regularly on these topics, both across the UK and internationally. He is passionate about user groups and sharing knowledge and does more of that now than real work. Martin is an Oracle ACE Director and member of the OakTable. He likes cats, beer and genetics.');
INSERT INTO SPEAKER VALUES (146,'Frances','Zhao-Perez','Oracle','As Director of Product Management for Oracle Fusion Middleware Cloud Solution, Frances Zhao-Perez is responsible for developing and delivering the products in a few major areas, including Middleware as a Service private cloud, Oracle Hybrid Cloud, Bringing PaaS services into ExaLogic private cloud platform, WebLogic on Oracle Database Appliance, Oracle Maximum Available Architecture and Cloud DR. Frances has over 15 years of industry experience in product development, and product management. She has been a frequent speaker for Oracle Open World, JavaOne, Oracle Open World Japan, China, UKOUG, DOAG, IOUG, and other industry conferences. Ms. Zhao-Perez holds MBA and M.S. in Computer Science.');
INSERT INTO SPEAKER VALUES (147,'Ronald','van Luttikhuizen','eProseed','Ronald is a Fusion Middleware expert and Managing Partner at eProseed NL. He has experience in IT in various roles such as coach, architect, (lead) designer/developer, analyst, and team lead. Ronald focuses on information and solution architectures in SOA and BPM environments. Ronald is a frequent blogger, author and presenter at national and international conferences. Ronald is Oracle ACE Director for Middleware ' || CHR(38) ||' SOA. - See more at: http://www.supersunday15.ukoug.org/default.asp?p=14169' || CHR(38) ||'dlgact=shwprs' || CHR(38) ||'prs_prsid=11732' || CHR(38) ||'day_dayid=101#sthash.pf9rJCsb.dpuf');
INSERT INTO PRESENTATION VALUES(1,'99 Problems but a Theme Ain''t One','','','APEX '||CHR(38)||' Database Development','APEX','Live Demo','You already have to think about data modeling, security, application logic, performance, deployment, etc, etc. What if I told you that didn''t have to worry about UI? Universal Theme, introduced in APEX 5, enables developers to build modern, beautiful, responsive applications that can be deeply customized. All without requiring you to become an expert in HTML, CSS or Javascript. This session will provide an in-depth look at the many features of Universal Theme, as well as what''s planned for APEX 5.1. With APEX 5 and Universal Theme, you may have 99 problems, but your theme ain''t one.','All Experience Levels','50 Minutes',3,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'APEX '||CHR(38)||' Database Development','09:00:00','09:50:00',50,'Hall 6A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Shakeeb' AND LASTNAME ='Rahman'));
INSERT INTO PRESENTATION VALUES(2,'An Introduction to RAC (12c)','','','Database','High Availability and Replication','Traditional Presentation','An introduction to RAC (12c)    RAC is regarded as a commodity, but so many organizations implement it incorrectly.    This talk goes trough the basics of what you need to know about RAC on Oracle (12c):    - What is RAC for, exactly?  - Understanding the archtecture  - ASM basics  - Understanding services and GDS  - How the Scan listener works  - Fast Connect Failover  - Memory;   - What apps do wrong  - What happens when a node crashes  - Troubleshooting','Beginner/Exploratory','50 Minutes',4,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Database 3','09:00:00','09:50:00',50,'Hall 11A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Neil' AND LASTNAME ='Chandler'));
INSERT INTO PRESENTATION VALUES(3,'API Management: Provide Security '||CHR(38)||' Visibility to APIs','Simone Geib - Oracle','simone.geib@oracle.com','Integration '||CHR(38)||' Collaboration','Integration','Traditional Presentation','Mobile applications increasingly use Application Programming interfaces (APIs) in addition to enterprise systems of record in their development. The importance of an API economy is growing by the day. As the number of APIs produced and consumed by enterprises increases, the management and visibility of these APIs becomes increasingly important. Oracle API Catalog, Manager '||CHR(38)||' Gateway allow organizations to easily secure and manage their APIs, providing visibility and control to the enterprise and a social catalog to API consumers for application development. In this session we deep-dive into the (abstract) scenario that took place at the dutch department of justice to increase visibility '||CHR(38)||' security on their APIs.','Beginner/Exploratory','50 Minutes',3,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Integration '||CHR(38)||' Collaboration','09:00:00','09:50:00',50,'Hall 10A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Robert' AND LASTNAME ='van Mölken'));
INSERT INTO PRESENTATION VALUES(4,'Command Your Systems Like Clone Troopers with Puppet','','','Operating Systems','System/Application Deployment (i.e. Puppet, Chef, Docker, Vagrant)','Traditional Presentation','Organizations are struggling to manage and standardize an ever increasing number of database deployments. This presentation shows how the devops tool puppet and open source modules from puppetforge that can be used to provision databases including Oracle RAC and to manage resources like users, tablespaces, instance parameters and settings in general. With this setup one can manage a large range of systems from a very small set of descriptive text based configuration files. Moreso, these configs are easily managed in a revision control system like git enabling agile workflows for database change management.','Beginner/Exploratory','30 Minutes',2,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Systems 2','09:00:00','09:50:00',50,'Media Suite A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Bjoern' AND LASTNAME ='Rost'));
INSERT INTO PRESENTATION VALUES(5,'DBaaS at Scale: Engineered Systems Consolidation in Banking','','','Engineered Systems','Exadata','Case Study/Real Life Experience','This presentation will show the design decisions taken and the engineering work that was required for a large scale DBaaS implementation project at a global investment bank. The bank had decided to consolidate it’s entire oracle estate of several thousand databases onto a collection of Exadata racks and ODA’s. This presentation will focus on the engineering challenges that were faced in ensuring these new engineered systems were production ready for use within the bank. After attending this presentation attendees will have an idea of what design decisions are required when performing an engineered systems consolidation at scale and will be better placed to avoid some of the pitfalls when using engineered systems for your consolidation project.','All Experience Levels','50 Minutes',3,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Systems 1','09:00:00','09:50:00',50,'Hall 11B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Jason' AND LASTNAME ='Arneil'));
INSERT INTO PRESENTATION VALUES(6,'If You Don''t Have a Mobile Strategy You Don''t Have a Strategy','','','Web '||CHR(38)||' Mobile Apps','Mobile','Traditional Presentation','Regardless of how you slice and dice the figures, facts or opinions, mobile is the “internet” of today’s Millennial generation.   So what is your strategy with dealing with a cloud-embracing, socially-involved, always-connected, mobile consumer base?   The very people who are not only your future customers and employees, are probably already the majority of your consumers today.    In this presentation I’m going to give an insight of the challenges presented by mobile then take a dive into the tools and technologies that we are developing here at Oracle to allow you to implement that strategy.  I’ll show you how you can build on-device mobile applications.  I’ll discuss the challenges of web applications on mobile. I’ll ditch the powerpoints  and demo some of our current and future cloud based offerings for exposing your existing legacy assets to mobile consumers.  And I’ll even show you how you can develop mobile and cloud based applications, from a mobile device!    The future is here, its mobile and if you don’t have mobile strategy you don’t have a strategy.','All Experience Levels','50 Minutes',4,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Web '||CHR(38)||' Mobile Apps','09:00:00','09:50:00',50,'Media Suite B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Grant' AND LASTNAME ='Ronald'));
INSERT INTO PRESENTATION VALUES(7,'Is Oracle the Best Language for Statistics?','','','APEX '||CHR(38)||' Database Development','Big Data','Traditional Presentation','Did you know that Oracle comes with over 280+ statistical functions? and that these statistical functions are available in all version of the Database?  Most people do not seem to know this. When we hear about people performing statistical analytics we can hear them talking about Excel and R. But what if we could do statistical analysis in the database, without having to extract any data onto client machines. That would be really good and just think of the possible data security issues with using Excel, R and other tools. This presentation will explore the various statistical areas available in SQL and I will give a number of demonstrations on some of the more commonly used statistical techniques. With the introduction of Big Data SQL we can now use these same 280+ Oracle statistical functions on all our data including Hadoop and NoSQL.  We can also greatly expand our statistical capabilities by using Oracle R Enterprise using the embedded capabilities in SQL.','Beginner/Exploratory','50 Minutes',4,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Analytics','09:00:00','09:50:00',50,'Hall 6B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Brendan' AND LASTNAME ='Tierney'));
INSERT INTO PRESENTATION VALUES(8,'Migrating from Streams to GoldenGate12c','','','Database','High Availability and Replication','Traditional Presentation','CERN decided to make a step forward and replace Oracle Streams with Oracle GoldenGate for all long-distance data replication flows in 2014.  The presentation will cover the main aspects for making a transition between mentioned technologies: test and validation procedures, requirements, deployment architecture and monitoring, converting of processes configuration and finally Streams2GoldenGate switching procedure.','All Experience Levels','50 Minutes',2,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Database 2','09:00:00','09:50:00',50,'Hall 9','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Zbigniew' AND LASTNAME ='Baranowski'));
INSERT INTO PRESENTATION VALUES(9,'Oracle Standard Edition is Awesome!','','','Database','Oracle Standard Edition','Traditional Presentation','A look at what you get with Oracle standard edition, what you don''t, what you need, and how to plug some of those holes!    Example Cost difference    Take a 14 core server (CPU E5-2697 v3)  Now look at the Oracle license options    (Prices from https://shop.oracle.com, termed 1 year costs including support)    Enterprise £75,196.59 per year (Without option packs)  Standard one £1,543.35 per year    In this talk we look at running, monitoring, backups and standby creation of databases up to 1 tb in size running on oracle standard one edition.    Including    - Building and maintaining stand by databases  - Why do you want multiple stand by databases?  - Running and monitoring stand by databases  - Tuning tools available, e.g. outlines, 100046 trace, performance views, snapping strategies  - RMAN, ZFS or PIGZ for backup compression?  - Separate backup server?  - Example server builds and costs.  - Example license costs  - Visualization patterns and costs  - HA and DR from the hypervisor (Oracle Standard)  - Oracle spatial in different versions of Oracle Standard  ','All Experience Levels','50 Minutes',3,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Standard Edition','09:00:00','09:50:00',50,'Hall 10B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Tom' AND LASTNAME ='Dale'));
INSERT INTO PRESENTATION VALUES(10,'The Oracle Database In-Memory Option: Challenges '||CHR(38)||' Possibilities','','','Database','12c New Features','Live Demo','Oracle Database In-Memory, which was introduced with version 12.1.0.2, promises to deliver in-memory performance without modifying the application’s code, increasing the complexity of database administration, or jeopardizing the utilization of other Oracle Database functionalities. The aim of this presentation, after explaining the key concepts the Oracle Database In-Memory option is based on, is to review what you can expect from this new technology. Specifically, we’ll take a look at the situations where you can take advantage of it and what kind of overhead you should expect when enabling it. ','Intermediate','50 Minutes',3,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Database 1','09:00:00','09:50:00',50,'Hall 1','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Christian' AND LASTNAME ='Antognini'));
INSERT INTO PRESENTATION VALUES(11,'UKOUG Independent Partner Roundtable','','','Roundtable','Agenda Theme - Embrace ','Roundtable','UKOUG has always had a vibrant community of Independent Consultants who support us and engage across all our portfolio of products and services. Many provide high valued expertise as speakers on our agendas, others are active volunteers in our communities and project teams. As part of UKOUG Strategy 2016 we have received a broad spectrum of feedback from those Independent Consultants engaged with UKOUG. Some are telling us that the traditional ways they have worked with UKOUG no longer bringing them value so they can''t justify their on going participation, others are looking for new ways to work with us to promote their individual brand, others would like us to provide a forum where by they can network and share experiences.      Independent consultants are an important part of the UKOUG community - we  need to hear from you! We are holding this roundtable to understand what you want from UKOUG - come along and share your ideas and influence what we can do to better support you in the future.','All Experience Levels','50 Minutes',3,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Roundtables','09:00:00','09:50:00',50,'Hall 4 Foyer Level 5','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Fiona' AND LASTNAME ='Martin'));
INSERT INTO PRESENTATION VALUES(12,'BA Community Keynote: Driving Digital Disruption Through Analytics – Oracle’s Strategy '||CHR(38)||' Roadmap','','','Business Analytics','Strategy','Traditional Presentation','Today’s hyper-competitive digital marketplace is no longer restricted to within a single industry or business segment. New nimble competitors with a total focus on digital can disrupt and unseat once great companies. Discovering and predicting insights about people, places and things allows companies to compete in new and innovative ways. Its one thing to find insight; but to be competitive you must also act on insight fast. Your ability to learn, grow and evolve your existing skills, processes and tools becomes essential to staying ahead. As you expand your pool of data used to gain insight with new and diverse sources – many from outside the organization - there comes an ever increasing responsibility to govern and secure all data, and analytic applications that access it.','All Experience Levels','30 Minutes',5,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Analytics','11:20:00','12:05:00',45,'Hall 1','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Nick' AND LASTNAME ='Whitehead'));
INSERT INTO PRESENTATION VALUES(13,'Choosing the Right Integration Tool for You','Yogesh Sontakke - Oracle','Yogesh.Sontakke@oracle.com','Integration '||CHR(38)||' Collaboration','Integration','Traditional Presentation','The skilled carpenter has a variety of hammers, chisels, planes and other tools in his workbox. He carefully selects the right tool for the job. In contrast as solution architects we all too quickly reach for the tool we know best. In this session we will examine the right tool to use for different integration requirements. SOA Suite alone includes a variety of different integration tools such as BPEL and Service Bus. Other tools in the Oracle architects toolbox include Oracle Data Integrator, Integratoin Cloud Service and Golden Gate. The benefits and drawbacks of using each tool for different scenarios will be explained with real world examples to help clarify the proposals.  We will also learn how Oracles new Integration Cloud Service changes the game for Integration by focusing on how your business differs from others. Learn how Integration Cloud Service accelerates integrating your applications by focusing on what is unique about your business.','All Experience Levels','50 Minutes',4,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Integration '||CHR(38)||' Collaboration','11:20:00','12:10:00',50,'Hall 10A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Antony' AND LASTNAME ='Reynolds'));
INSERT INTO PRESENTATION VALUES(14,'Cost Based Optimizer - Panel Session','Maria Colgan - Oracle, Nigel Bayliss - Oracle, Christian Antognini - Trivadis AG, ACE Director','maria.colgan@oracle.com, nigel.bayliss@oracle.com, christian.antognieni@trivadis.com','Database','Performance '||CHR(38)||' Internals','Panel Session','This is an opportunity for members of the user group to table questions for a group of subject experts. I expect to be accompanied by Christian Antognini, Maria Colgan and Nigel Bayliss (Optimizer group, UK), with a couple of old UKOUG hands to act as MCs. Attendees will be offered filing cards on arrival if they want to submit questions; and can email questions to me in advance of the event. "Concept" and "generic" questions will be favoured over requests for solutions to specific problems    Attendees will be offered filing cards on arrival if they want to submit questions; and can email questions to me in advance of the event.    "Concept" and "generic" questions will be favoured over requests for solutions to specific problems.  ','Beginner/Exploratory','50 Minutes',3,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Database 1','11:20:00','12:10:00',50,'Hall 5','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Jonathan' AND LASTNAME ='Lewis'));
INSERT INTO PRESENTATION VALUES(15,'Creating Hybrid Applications - With or Without APEX?','','','APEX '||CHR(38)||' Database Development','Mobile','Traditional Presentation','With APEX we can create web applications that run just fine on our mobile devices. With some more effort we can create hybrid APEX applications that run close to native on our mobile devices - with integration with other apps on our devices like Calendar, Contacts, FaceBook, Mail, Twitter, etc. "If all you have is hammer, everything looks like a nail" ... and is APEX such a hammer? Maybe we should do things differently and are other tools better equipped for the job? Or is APEX the overall winner? Maybe the truth lies in between? The Oracle Database Rest Services (ORDS) will play an important role in this discussion. And the proposed solutions - aimed at enhancing the user experience from a performance point of view- can be applied to other environments as well. ','Intermediate','50 Minutes',2,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'APEX '||CHR(38)||' Database Development','11:20:00','12:10:00',50,'Hall 11B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Roel' AND LASTNAME ='Hartman'));
INSERT INTO PRESENTATION VALUES(16,'My First 100 days with an Exadata','','','Engineered Systems','Exadata','Traditional Presentation','The biggest headine at the 2009 Oracle OpenWorld was when Larry Ellison announced that Oracle was entering the hardware business with a pre-built database machine, engineered by Oracle. Since then businesses around the world have started to use these engineered systems. This beginner/intermediate-level session will take you through my first 100 days of starting to administer an Exadata machine and all the roadblocks and all the success I had along this new path.    Attendee will be able to learn:  1. Exadata Architecture  a) Cell storage nodes  b) Infiniband  c) Smart Scans  d) Storage Indexes  e) Hybrid Columnar Compression (HCC)    2. Manage an Exadata  a) Database compute Node   b) Cell storage boxes : cellcli  c) Grid disk replacements    3. Patching an Exadata Machine  a) Patching RDBMS '||CHR(38)||' GI and Quaterly Full Stack Download Patch  b) Patching Exadata Cell Storage  c) One off patches','Beginner/Exploratory','50 Minutes',3,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Systems 1','11:20:00','12:10:00',50,'Hall 6A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='René' AND LASTNAME ='Antúnez'));
INSERT INTO PRESENTATION VALUES(17,'Oracle Data Guard 12c - Mini Course','Maja Veselica - Parallel, ACE Associate','maja.veselica@gmail.com','Database','High Availability and Replication','Traditional Presentation','This mini course session teaches you how Data Guard in Oracle Database 12.1.0.2 works. Throughout the presentation and live demonstration (or recordings, depends on time) you will be able to learn to:     1 - Create Active Data Guard in a Multitenant environment;   2 - Configure and use Data Guard Broker;   3 - Add/remove Pluggable Database(s) from Data Guard configuration;   4 - Use services in Data Guard and Multitenant environment.     It will also explain use of Temporary Undo in Active Data Guard for DML on Temporary tables.','All Experience Levels','50 Minutes',2,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Database 3','11:20:00','12:10:00',50,'Hall 11A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Zoran' AND LASTNAME ='Pavlovic'));
INSERT INTO PRESENTATION VALUES(18,'Oracle Linux 7 for DBAs-What''s New?','','','Operating Systems','Oracle Linux','Traditional Presentation','Oracle 12c and 11.2.0.4 are now certified on Oracle Linux, the next generation release of the most popular Linux derivative for Oracle deployments. However there are many changes that the Linux/Oracle administrator should know about, not the least in the way the network stack is implemented (now entirely based on NetworkManager), the startup process is managed (Upstart is dead-long live SystemD!) and many other tools have changed that made our lives easier. On the other hand Kernel UEK3 is implemented by default and it comes with a wealth of options for the Linux performance analyst that rival and/or surpass what is available on other platforms. At the end of this talk the Oracle DBA should be more familiar with the new major Linux release so that not every activity she wants to perform leads to a query to the favourite Internet search engine.','All Experience Levels','50 Minutes',3,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Systems 2','11:20:00','12:10:00',50,'Hall 10B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Martin' AND LASTNAME ='Bach'));
INSERT INTO PRESENTATION VALUES(19,'Standard Edition Something for the Enterprise?','Joel Goodman - Oracle','Joel.goodman@oracle.com','Database','Oracle Standard Edition','Traditional Presentation','In this presentation I will talk about Standard Edition Database, opportunities, pitfalls, Dos'||CHR(38)||'Don''ts, and how to simulate some Enterprise Edition features that are not available to a Standard Edition Database.  The Standard Edition Database is a member of the great Oracle Database Family. It is as solid'||CHR(38)||'fully Supported database as its "Big Brother" Enterprise Edition Database - Time to give it the spot in the sunlight that it deserves?','All Experience Levels','50 Minutes',3,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Standard Edition','11:20:00','12:10:00',50,'Media Suite A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Ann' AND LASTNAME ='Sjökvist'));
INSERT INTO PRESENTATION VALUES(20,'The Forecast is Cloudy','','','Web '||CHR(38)||' Mobile Apps','Cloud','Traditional Presentation','The role of the cloud as a deployment platform hosting your data and applications is quite clear, but are you confused by the proliferation of cloud services that Oracle is providing? Are you wondering how you can use Software (SaaS), Platform (PaaS), Data (DaaS), Integration (IaaS) services to help you build better applications faster while reducing costs and time to market? In this session we’ll review the new and upcoming cloud services that Oracle is offering for developers and IT shops. Whether you are looking for coding and development in the cloud all the way to business user empowerment Oracle has the right cloud service for you','All Experience Levels','50 Minutes',2,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Web '||CHR(38)||' Mobile Apps','11:20:00','12:10:00',50,'Media Suite B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Susan' AND LASTNAME ='Duncan'));
INSERT INTO PRESENTATION VALUES(21,'All About Table Locks: DML, DDL, Foreign Key, Online Operations,...','','','Database','Performance '||CHR(38)||' Internals','Traditional Presentation','Oracle locking behavior is changing at each release. Do you know exactly what is locked when you do an online or offline DDL? Do you know when and why you need to index foreign keys? Do you know the meaning of the lock modes (RS,RX,S,SRX,X)? Do you think that 12c has new features about it? We will explain all that with demos.','Intermediate','50 Minutes',1,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Database 3','12:20:00','13:10:00',50,'Hall 11A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Franck' AND LASTNAME ='Pachot'));
INSERT INTO PRESENTATION VALUES(22,'Analytic Functions: Unleash the SQL Power','','','APEX '||CHR(38)||' Database Development','SQL','Traditional Presentation','Analytic Functions have been around for quite a long time, and still they are a relatively unknown. If you are unfamiliar with these very powerful functions, you are missing out on something spectacular. Analytic Functions add inter-row calculations, aggregates over multiple dimensions, or rank assignment based on values within a group of values - all without a GROUP BY clause.  The syntax might seem daunting at first, but it is really not that scary. This session will focus on the syntax with tons of real world uses for Analytic Functions.','Beginner/Exploratory','50 Minutes',2,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Analytics','12:20:00','13:10:00',50,'Hall 6B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Alex' AND LASTNAME ='Nuijten'));
INSERT INTO PRESENTATION VALUES(23,'Deliver a Great User Experience for Mobile '||CHR(38)||' Web','','','Web '||CHR(38)||' Mobile Apps','Usability/UX','Case Study/Real Life Experience','This session will highlight a customer success story, who have changed its focus of IT delivery to one that is design led, ‘customer first’ and agile in nature in order to deliver the best online customer experience. We shall talk through the experiences and outcomes of the first project of this journey; a customer portal built using Oracle WebCenter Portal, ADF and SOA. We will share insight into the key challenges and project successes whilst demonstrating what was achieved with data visualizations. We’ll also discuss the importance of integration as part of a great user experience. UX is much more than just a nice looking application!    I will also introduce Oracle''s new UX design framework ALTA UI that we are using and show how a traditional Oracle Forms application may look rewritten in ALTA UI.    You will take away some key advice and practical examples of how a design led approach can be rewarding for the business.','Beginner/Exploratory','50 Minutes',4,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Web '||CHR(38)||' Mobile Apps','12:20:00','13:10:00',50,'Media Suite B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Mark' AND LASTNAME ='Simpson'));
INSERT INTO PRESENTATION VALUES(24,'Deploying to Oracle SOA Suite 12c - Everything You Need to Know','','','Integration '||CHR(38)||' Collaboration','SOA incl. BPEL','Traditional Presentation','This deep dive technical presentation focuses on deploying SOA composites, OSB services, MDS artifacts, and BAM objects to Oracle SOA Suite 12c, using the console, WLST, and Ant scripts. Taken from a snippet from my Oracle SOA Suite 12c Administrator''s Handbook from Packt Publishing, this is the most comprehensive explanation of deployment that administrators of Oracle SOA Suite 12c will find.','Intermediate','50 Minutes',1,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Integration '||CHR(38)||' Collaboration','12:20:00','13:10:00',50,'Hall 10A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Ahmed' AND LASTNAME ='Aboulnaga'));
INSERT INTO PRESENTATION VALUES(25,'Exadata Maintenance Tasks 101','','','Engineered Systems','Exadata','Traditional Presentation','You have been working as a DBA for years and are planning/starting to support an Exadata installation.  There are several planned and unplanned maintenance task that you will face, involving a lot of details on each one.   Don''t wait to master them with practice, on this session we will share our experience of working with Exadata installations during the last years, showing details of the most common maintenance tasks and best practices to make a better usage of your resources. This includes setting up ASR, replacing components (Hard and Flash drives, Batteries, Infiniband switches, etc.) and patching.','All Experience Levels','50 Minutes',2,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Systems 1','12:20:00','13:10:00',50,'Hall 11B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Nelson' AND LASTNAME ='Calero'));
INSERT INTO PRESENTATION VALUES(26,'Integrating with Cloud Applications - what are the options?','','','APEX '||CHR(38)||' Database Development','Integration','Traditional Presentation','Oracle’s Cloud Applications provide customers with huge benefits in terms of cost of ownership, speed of implementation and simplicity of delivery – but how do you prevent your Cloud Applications from becoming silos of data that prevent end to end business processing across your organisation?  There are many ways that Oracle Cloud solutions can be integrated with 3rd party products and legacy applications, but which is best for you and your needs? This session will review the range of choices and options available to customers for Cloud Application Integration, and will assist you in understanding which solution will best fit each scenario. And surprise surpise - Oracle Application Express represents a key component that can be used to deliver integration solutions that work','All Experience Levels','50 Minutes',5,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'APEX '||CHR(38)||' Database Development','12:20:00','13:10:00',50,'Hall 6A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Dermot ' AND LASTNAME ='Murray'));
INSERT INTO PRESENTATION VALUES(27,'Looking for Performance Issues in Oracle SE – Check what OraSASH Can do for You','','','Database','Performance '||CHR(38)||' Internals','Traditional Presentation','Oracle Standard Edition is commonly used database for small and middle size companies. One of the typical problems with Oracle SE is lack of proper monitoring build in database as Oracle Automatic Workload Repository is available for Enterprise Edition. DBA''s can use a Statspack to monitor database but in lot of cases there is a need to better monitoring granularity. This is an area where OraSASH can be used to establish monitoring on session level and provide like ?ASH? data for DBA. OraSASH is a free product created by Kyle Hailey and now maintained by myself on Github repository. It is a implementation of ?AWR/ASH? like repository. This session will guide DBA through OraSASH design, installation and maintenance process. OrsSASH is providing similar tables to AWR/ASH and same queries can be run against both repositories ? there will be examples how to monitor database and steps how to find out database bottlenecks.  ','All Experience Levels','50 Minutes',3,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Standard Edition','12:20:00','13:10:00',50,'Hall 10B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Marcin' AND LASTNAME ='Przepiorowski'));
INSERT INTO PRESENTATION VALUES(28,'Managing Operating System Resources Using Linux Resource Groups','','','Operating Systems','Oracle Linux','Traditional Presentation','One of the major problems on consolidated platforms built on shared infrastucture is to ensure that resource usage is managed properly and that no single database server can consume excessive resource such as I/O at the expense of other clients sharing the same infrastructure. On the BT Enterprise Cloud platform we have successfully used Linux Resource Groups to ensure that development, test and production RAC database environments can co-exist safely on the same Cloud platform     Top three things that the audience will take away from the presentation:   Installation and configuration of cgroups on Linux   How to use cgroups to control the amount of system resources used by Oracle users and processes   How to put limits on storage bandwidth (I/O throttling)    (This was presented at RAC SIG March 2015 and was well-received - it was suggested to me there by the SIG chair that I submit for conference. Above abstract from SIG).','Intermediate','50 Minutes',3,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Systems 2','12:20:00','13:10:00',50,'Media Suite A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='David' AND LASTNAME ='Hickson'));
INSERT INTO PRESENTATION VALUES(29,'OEM Roundtable','Tania Le Voi - Oracle','tania.levoi@oracle.com','Database','Oracle Enterprise Manager','Panel Session','This is an open question and answer session in which the audience can pose questions to the group and industry experts. The proposed opening topic is Oracle Enterprise Manager, in particular how it is used and can be used, but what will be discussed will be down to the audience. Thus if you have a burning question around Oracle Enterprise Management submit it early so we can try and get it into the discussion. Each year this session always generates very lively debate! So we are hoping this years will be even bigger and livelier.','All Experience Levels','50 Minutes',4,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Roundtables','12:20:00','13:10:00',50,'Hall 4 Foyer Level 5','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Dev' AND LASTNAME ='Nayak'));
INSERT INTO PRESENTATION VALUES(30,'Oracle APEX for the DBA','','','Database','Management and Administration','Traditional Presentation','Oracle Application Express (APEX) has become very powerful and popular among developers close to the database. Yet, many Oracle DBAs do not know about it, or have wrong perceptions of it, like it won''t fit into their secure architecture, or it will give extra work to the DBA, and so on. In this session one DBA will tell other DBAs  why they should start using APEX and let other explore it too. In sum both DBAs and developers will win by using APEX since volume of administration and effort to develop in APEX is much less than most other development platforms.','Intermediate','50 Minutes',3,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Database 2','12:20:00','13:10:00',50,'Hall 9','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Øyvind' AND LASTNAME ='Isene'));
INSERT INTO PRESENTATION VALUES(31,'Oracle Database Consolidation : It''s Not All About Oracle Database 12c!','','','Database','Management and Administration','Traditional Presentation','Database consolidation is a hot topic for anyone who is trying to reduce costs. Oracle database 12c introduced some new features to help with database consolidation, but there were already several methods available. This presentation gives an overview of the options for achieving database consolidation, highlighting their pros and cons.','Beginner/Exploratory','50 Minutes',4,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Database 1','12:20:00','13:10:00',50,'Hall 5','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Tim' AND LASTNAME ='Hall'));
INSERT INTO PRESENTATION VALUES(32,'Facilitating Innovation Through Analytics with Exalytics','Chris Jenkins - Oracle','chris.jenkins@oracle.com','Business Analytics','Agenda Theme - Embrace','Case Study/Real Life Experience','Having access to business intelligence in near real time is important for intelligent business decisions. Rather than simply using aggregates, CIMA fully embraced in-memory technology and put its entire data warehouse into an Oracle TimesTen In-Memory Database on Exalytics. Dramatic reductions in query response time were achieved for Oracle Business Intelligence Enterprise Edition dashboard reports with ''Zero Application Code changes’.  Based on this success, CIMA have been evolving their existing applications to further leverage in-memory technology and migrating other parts of the applications to use in-memory technology.  This approach has enabled previously unachievable analysis, leading to greater knowledge of customers and challenges across the company.','All Experience Levels','30 Minutes',3,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Analytics','13:50:00','14:40:00',50,'Executive Room 2','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Kiran' AND LASTNAME ='Tailor'));
INSERT INTO PRESENTATION VALUES(33,'Compliance '||CHR(38)||' Security for OpenStack Deployments','','','Operating Systems','Compliance, Audit '||CHR(38)||' Security','Traditional Presentation','Deploying OpenStack by following quickstart guides and default settings won''t always lead to a secure configuration that will pass compliance audits.    Using builtin Solaris security and compliance functionality we can build and audit for compliance a secure OpenStack deployment capable of hosting multiple tenants with strong isolation suitable for PCI-DSS and other security/compliance standards.','All Experience Levels','50 Minutes',3,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Systems 2','14:10:00','15:00:00',50,'Media Suite A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Darren' AND LASTNAME ='Moffat'));
INSERT INTO PRESENTATION VALUES(34,'Database Virtualisation Roundtable','Gerald Venzl - Oracle, Ron Ekins - Delphix, Oracle ACE ','gerald.venzl@oracle.com, ron.ekins@delphix.com','Database','Virtualisation','Roundtable','Round table discussion on all topics related to Database Virtualization. Discuss with experts how different technology choices work and what might be most suitable for your project. Explore how Database Virtualization  provides benefits to your business and how it changes your software development lifecycle by increasing productivity at lower cost. Hear from your peers about their experience when adopting Database Virtualization, what worked and what potential pitfalls to look out for.','All Experience Levels','50 Minutes',3,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Roundtables','14:10:00','15:00:00',50,'Hall 4 Foyer Level 5','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Peter' AND LASTNAME ='Brink'));
INSERT INTO PRESENTATION VALUES(35,'Going Digitally Native in the Enterprise - Extending Your Oracle ADF Applications to Mobile '||CHR(38)||' Cloud','','','Web '||CHR(38)||' Mobile Apps','Development Practices/Tips','Traditional Presentation','Cloud computing and mobile are two new horizons showing for Oracle ADF developers. If you like it or not, the world of information technology changes again, shifting its weight from web application development towards Mobile and Cloud. This session tells you the story behind this change, giving you a better insight to why things happen as they do and why your company or business cannot just sit and wait for it to be over. Though this presentation is not meant to be an Oracle ADF statement of direction, it discusses the impact this move has to Oracle ADF, as well as the possibilities and opportunities that are waiting for you, as an Oracle ADF developer or customer, when traveling towards a Mobile and Cloud horizon. Join this session. Come equipped with pen and paper and learn about the changes and the keeps to prepare for. Get a first-hand briefing on new techniques and technologies that every Oracle ADF developer should put onto his or her professional skill development wish-list"','All Experience Levels','50 Minutes',4,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Web '||CHR(38)||' Mobile Apps','14:10:00','15:00:00',50,'Media Suite B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Frank' AND LASTNAME ='Nimphius'));
INSERT INTO PRESENTATION VALUES(36,'Hidden Gems in Oracle Application Express 5.0','','','APEX '||CHR(38)||' Database Development','APEX','Traditional Presentation','Sure the Page Designer is sexy and the Universal Theme with ThemeRoller totally rocks, but we''ve also packed a heap of smaller features into APEX 5.0, that will help improve developer productivity. This session will cover some of the hidden gems in Application Express 5.0, such as linking supporting objects to database objects, parsing and generating JSON using the new APEX_JSON package, defining data redaction policies within the SQL Workshop, and rejoining sessions to take care of the age-old problem of multiple browser tabs to the same Application Express instance.','All Experience Levels','50 Minutes',3,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'APEX '||CHR(38)||' Database Development','14:10:00','15:00:00',50,'Hall 11B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Hilary' AND LASTNAME ='Farrell'));
INSERT INTO PRESENTATION VALUES(37,'Oracle Database In-Memory By Example','','','Database','12c New Features','Live Demo','With Oracle Database 12c comes a new In-Memory column store compatible with all existing applications. But how does it work and what steps do you need to take to get started with this new technology? Rather than answering these questions with a traditional PowerPoint presentation, this session will be conducted completely on the command line via SQL*Plus. Step by step examples will demonstrate how our in-memory dual format enables both superfast analytics and online transaction processing. We will also show how it integrates with Oracle''s existing performance features including the Optimizer, indexes, Materialized Views etc. By attending this session you will arm yourself with the necessary knowledge to not only get started with Database in-Memory but to dramatically improvement the performance of your analytical workload regardless of your Oracle environment.','All Experience Levels','50 Minutes',2,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Database 1','14:10:00','15:00:00',50,'Hall 11A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Maria' AND LASTNAME ='Colgan'));
INSERT INTO PRESENTATION VALUES(38,'Oracle Exadata Meets Elastic Configurations','','','Engineered Systems','Exadata','Traditional Presentation','With the release of Exadata Database Machine X5-2 Oracle announced elastic configurations to allow Oracle Exadata Racks to have custom combinations of database and storage servers. This session will introduce the Exadata Database Machine X5-2 and then focus on the elastic configurations options and details. We will go through the steps on real world implementation of Exadata X5-2 HC Eighth Rack plus one storage server configuration. ','All Experience Levels','50 Minutes',3,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Systems 1','14:10:00','15:00:00',50,'Hall 9','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Svetoslav' AND LASTNAME ='Gyurov'));
INSERT INTO PRESENTATION VALUES(39,'Security Design for Your Database Applications','','','Database','Compliance, Audit '||CHR(38)||' Security','Traditional Presentation','In this presentation Pete will explore some of the issues he has seen over many years reviewing Oracle databases security. Applications are in variably not designed with security in mind at the data and functional level. This talk explores some of the common issues; lack of granularity, separation of duties, least privileges and functional design. We will also explore the issues with function and data in the same schemas, definer rights and invoker rights code, separation of function from function (high risk, low risk code), contested based security in code and data and more. We will also explore the requirements for least privilege at design time and run time as these are different and can be managed differently. Finally we will also discuss design of users and also deployment and development of code and objects - who, how and what rights to use. This talk will include some simple demonstrations of how these ideas affect security','All Experience Levels','50 Minutes',3,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Database 3','14:10:00','15:00:00',50,'Hall 1','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Pete' AND LASTNAME ='Finnigan'));
INSERT INTO PRESENTATION VALUES(40,'Silent but Deadly : SE Deserves Your Attention','','','Database','Oracle Standard Edition','Traditional Presentation','The Oracle database has the reputation of being expensive, this doesn’t necessarily have to be the case.    Oracle SE gains more and more momentum each year and there is a big interest in this product.     This presentation will talk about why you should have a look it unites three angles in a very interactive session :  ·       Standard Edition DBA exploring opportunities    ·       Enterprise Edition DBA looking to prepare for SE    ·       Business Consultant looking at opportunities    During this interactive presentation you will find out when and why Oracle Standard Edition (One) can be a good option for your project. In a super interactive way the “presenters” will take you through a number of considerations like:    ·       Hardware    ·       Scalability, from SEO to EE    ·       Free options    ·       License considerations    ·       Do’s and Don’ts    ·       SE Wishlist    From their individual backgrounds, there will be different takes on the topics    The SE advocate lady Ann Sjokvist  The Business approach of Jan Karremans  The EE dba who wants to have a plan B if his customers would go for SE Philippe Fierens.','Intermediate','50 Minutes',3,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Standard Edition','14:10:00','15:00:00',50,'Hall 10B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Philippe' AND LASTNAME ='Fierens'));
INSERT INTO PRESENTATION VALUES(41,'We are Citizen Integrators!  Oracles New Integration Cloud Service.','','','Integration '||CHR(38)||' Collaboration','Integration','Traditional Presentation','Oracles new Integration Cloud Service is an exciting new way of integrating applications that simplifies the job of integration.  See how easy it is to use while learning that it is more powerful than appears at first glance. In this session we will explore some of the features of Integration Cloud Service including advanced features such as versioning and packages.  Also we will hear from early adopters of Oracles Integration Cloud Service. Discover what they are doing with Integration Cloud Service and learn the tips and tricks that could make your new Integration in the Cloud project a success.','All Experience Levels','50 Minutes',4,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Integration '||CHR(38)||' Collaboration','14:10:00','15:00:00',50,'Hall 10A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Antony' AND LASTNAME ='Reynolds'));
INSERT INTO PRESENTATION VALUES(42,'Empowering Business Users: OBIEE 12c Data Mashup '||CHR(38)||' Visual Analyzer','','','Business Analytics','OBI (Foundation Suite/Enterprise Edition)','Traditional Presentation','The demand from business users to have a more comprehensive and faster access to business data in order to take effective and faster decisions is growing rapidly. OBIEE 12c Mashups and Visual Analyzer allow business users to interact more effectively with data and also integrate new data, transform and visualise data in a very quick way without involving the IT team. This session will explain how to use these the Data Mashup feature to integrate new data from excel files and create new visualisations with the Visual Analyzer tool as well as perform predictive analyses in a very intuitive and quicker way, reducing drastically the time involved in the data visualisation creation.','All Experience Levels','50 Minutes',3,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Analytics','14:50:00','15:40:00',50,'Executive Room 2','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Edelweiss' AND LASTNAME ='Kammermann'));
INSERT INTO PRESENTATION VALUES(43,'5 Minute Tales of Apex','','','APEX '||CHR(38)||' Database Development','APEX','Roundtable','Open mic type session for delegates to come with their own experiences of Apex and talk/demo for 5 minutes.  Should be a great session for those who normally don''t present, want to show innovative ways of using the tool, show how technical and business challenges have been solved.  Inspire others, solicit questions and interact with the community.','All Experience Levels','50 Minutes',3,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Roundtables','15:10:00','16:00:00',50,'Hall 4 Foyer Level 5','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Jon' AND LASTNAME ='Barwell'));
INSERT INTO PRESENTATION VALUES(44,'DB12c: All You Need to Know About the Resource Manager','','','Database','Performance '||CHR(38)||' Internals','Traditional Presentation','Oracle Database 12c Multitenant provides the highest level of Oracle Database resource efficiency, driven by an improved resource manager. The 12c resource manager effectively allocates resources both within a single database and between multiple pluggable databases in a container. This presentation will review new features of the 12c resource manager, provide guidelines for migration of your current resource management plan to 12c, and will also look into how much overhead the resource manager introduces.','All Experience Levels','50 Minutes',3,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Database 2','15:10:00','16:00:00',50,'Hall 9','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Maris' AND LASTNAME ='Elsins'));
INSERT INTO PRESENTATION VALUES(45,'Delivering DBaaS for End User Customers on Oracle SuperCluster','','','Engineered Systems','SuperCluster','Case Study/Real Life Experience','This discusses secure end-to-end isolation-based multitenant container database cloud solutions on Oracle SuperCluster. It uncovers the unique security capabilities, architectural strategies, and deployment topologies for delivering multitenant container database applications on the Oracle SuperCluster platform made possible by seamless integration of database security, SPARC hardware–assisted cryptography and virtualization, and high-performance networking on the encrypted immutable Oracle Solaris Zones feature of Oracle Solaris. Furthermore, the session shares best practices for secure end-to-end isolation and delivery of cloud-enabled multitier applications on the Oracle SuperCluster platform.','All Experience Levels','50 Minutes',3,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Systems 1','15:10:00','16:00:00',50,'Hall 6A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Andy' AND LASTNAME ='Harrison'));
INSERT INTO PRESENTATION VALUES(46,'How to Evaulate the 12c In-Memory Option','','','Database','12c New Features','Traditional Presentation','This session follows a POC which covers the evaluation of the 12c In-Memory for a large BI analytic warehouse. The aim of the session is to demonstrate how the In-Memory feature was evaluated and measured by looking deep into the setup and performance metrics gathered throughout the POC. It demonstrates in details the challenges and benefits when using this feature and quantifies that into benefits to end users in terms of real world performance gains.','All Experience Levels','50 Minutes',3,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Database 3','15:10:00','16:00:00',50,'Hall 11A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Philip' AND LASTNAME ='Brown'));
INSERT INTO PRESENTATION VALUES(47,'Logging '||CHR(38)||' Exception Handling in PL/SQL','','','APEX '||CHR(38)||' Database Development','Development Practices/Tips','Traditional Presentation','Logging and exception handling play a crucial role in the delivery of reliable PL/SQL applications.  Yet our systems often implement these functions poorly.  This session will cover the philosophy of logging and exception handling as well as actual code examples.  Attendees will will learn how good practice can help them eliminate bugs during development and diagnose issues in live environments.','Beginner/Exploratory','50 Minutes',2,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'APEX '||CHR(38)||' Database Development','15:10:00','16:00:00',50,'Hall 11B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Andrew' AND LASTNAME ='Clarke'));
INSERT INTO PRESENTATION VALUES(48,'Simplify '||CHR(38)||' Accelerate Connectivity with SaaS '||CHR(38)||' On-Premise Through Oracle Adapters','Markus Grünewald - Opitz','Markus.Gruenewald@opitz-consulting.com','Integration '||CHR(38)||' Collaboration','Integration','Traditional Presentation','This session is your opportunity to take a very close look at Oracle''s suite of rich adapters that simplify and accelerate integration with Saas, On-premise or just about any application. These adapters are built on a powerful Adapter SDK and can run anywhere - on-premise or in the cloud! Whether you are connecting to Oracle Sales Cloud, CPQ Cloud, Salesforce.com, E-Business Suite, SAP, FTP, JMS or Database, Adapters enable powerful, quick and easy integration with zero coding. We will also show-case a real life closed-loop order management system implemented by our partner Opitz demonstrating why Oracle SOA Suite and the new Oracle adapters for SAP and Salesforce.com are the perfect solution for this use case. Additionally, we will discuss the sophisticated feature set of the error hospital and EM to support tracking and tracing requirements and demonstrate how to to search for custom attributes in messages in EM, such as customer IDs from any integrated system.','Intermediate','50 Minutes',3,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Integration '||CHR(38)||' Collaboration','15:10:00','16:00:00',50,'Hall 10A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Simone' AND LASTNAME ='Geib'));
INSERT INTO PRESENTATION VALUES(49,'Supercharge Your SQL Skillset','','','Database','SQL and PL/SQL','Traditional Presentation','Cloud and virtualisation services now take care of many of the day to day concerns for organisations - keeping infrastructure up to date, ensuring the integrity of backup/recovery, resource capacity and high availability. Finally IT professionals can focus on the true art of software development - writing quality SQL to provide data to upstream services. This session covers some of the SQL techniques available in the Oracle database, to allow developers to supercharge their SQL skillset.','Intermediate','50 Minutes',2,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Database 1','15:10:00','16:00:00',50,'Hall 1','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Connor' AND LASTNAME ='McDonald'));
INSERT INTO PRESENTATION VALUES(50,'Why Mobile Needs a Cloud','','','Web '||CHR(38)||' Mobile Apps','Cloud','Traditional Presentation','Cloud and Mobile - two "hot" terms that are spearheading many new development initiatives. But why does mobile need a cloud? What does it do? How can it help you deliver cutting edge and successful mobile projects. In this presentation you will see demos of how Oracle Mobile Cloud Service can be used to develop mobile specific APIs on top of you legacy enterprise systems. You will learn how MCS automatically provides mobile analytics on how your mobile application is being used, by who, at what location, and how they are interacting with that application. And you''ll see how features such as push notifications, storage, connectors and of course, security are all key elements that the cloud provides for your mobile initiatives.','All Experience Levels','50 Minutes',4,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Web '||CHR(38)||' Mobile Apps','15:10:00','16:00:00',50,'Media Suite B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Grant' AND LASTNAME ='Ronald'));
INSERT INTO PRESENTATION VALUES(51,'Increasing User Adoption Through Effective Data Visualisation Design '||CHR(38)||' Mobile BI','','','Business Analytics','Agenda Theme - Embrace','Traditional Presentation','Effectively designed data visualisations, dashboards and reports make data more accessible and attractive. They help increase user adoption and make a key contribution to the success of our BI projects.  The challenge is how to create effective and engaging visualisations that have the right balance of aesthetics and function. Achieving this goal requires us to be familiar with a broad spectrum of design principles from the fields of industrial design, graphic design, cognitive science and statistics.   Complete with real world examples, this presentation provides an introduction on how industrial and graphic design principles complement the more adopted science orientated aspects of data visualisation design. It will explore how designing for desktop and mobile platforms is different, and how specific features in OBIEE dashboards and Oracle MAD support the realisation of the different platform designs. It will finish by discussing the specific role that Mobile BI can play in driving user adoption. ','All Experience Levels','50 Minutes',4,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Analytics','16:20:00','17:10:00',50,'Executive Room 2','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Steve' AND LASTNAME ='Devine'));
INSERT INTO PRESENTATION VALUES(52,'A Year in the Life of a Council DBA '||CHR(38)||' Solaris Sysadmin','','','Operating Systems','Oracle Solaris','Traditional Presentation','Problems we have had, plans we have made and changed, migrations we have done.   Some things we have learned.    We are an Oracle site, Oracle hardware, Solaris and database since Oracle 6.    Last year we presented on how we migrated all our hardware and databases to the latest stuff!   This presentation would be on how we learnt to run with all our new stuff, databases and Solaris. This is for both Solaris and DBA folk.    This presentation would cover the things we have found, the tricky bits, the gotchas, how we have made things work better.    Our first attempts with 12c database, our live application testing experiments, flashback , recycle bin, flashback archive. Disk and IO - how to find out what is killing your system.  Running an APEX system securely and with decent performance.  Automatic overnight refresh of test databases from live using RMAN.  There will also be things we have yet to find as an issue between now and December.  If it is possible and I have adequate tech, there will be demos as well as PowerPoint slides.  ','All Experience Levels','50 Minutes',3,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Systems 2','16:30:00','17:20:00',50,'Media Suite A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Mark' AND LASTNAME ='Johnston'));
INSERT INTO PRESENTATION VALUES(53,'An Introduction to Indexing','','','Database','Performance '||CHR(38)||' Internals','Traditional Presentation','Indexing you database is key to performance. Too few or the wrong types and your SQL will not benefit from them and be slow. Too many and your inserts, updates and deletes will be slow.  I will review the types of indexes available to us, their potential benefits and flaws, when to use them and when not.','Beginner/Exploratory','50 Minutes',2,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Database 2','16:30:00','17:20:00',50,'Hall 9','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Martin' AND LASTNAME ='Widlake'));
INSERT INTO PRESENTATION VALUES(54,'Building a Mobile-Optimized API','','','Web '||CHR(38)||' Mobile Apps','Mobile','Traditional Presentation','In this session you will learn how to use on-premise SOAP web services, and transform and optimize them for mobile consumption using Oracle Mobile Cloud Service (MCS).     Step-by-step, Steven will explain how to define the mobile API contract in MCS, create the SOAP connector, and how to implement this contract using a so-called MCS custom     API that will provide the REST-JSON resources for the mobile application.','All Experience Levels','50 Minutes',3,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Web '||CHR(38)||' Mobile Apps','16:30:00','17:20:00',50,'Media Suite B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Steven' AND LASTNAME ='Davelaar'));
INSERT INTO PRESENTATION VALUES(55,'DBAs Can Use Oracle Application Express?  Poppycock!','','','APEX '||CHR(38)||' Database Development','APEX','Live Demo','DBAs aren''t Developers.  They only setup and manage and monitor systems.  They aren''t Web developers.  Right????  Wrong!  Oracle Application is an easy-to-use framework for those people who are comfortable with SQL.  And who uses more SQL than a DBA?  This session will be a live demonstration of the numerous ways a DBA can exploit Oracle Application Express to their benefit - from simple database management tasks to monitoring the performance and activity of an Oracle Database.  The Oracle Database contains a wealth of information, and you will see how easy it is to graphically visualize this in a modern Web application.  No CSS or HTML experience required!','Intermediate','50 Minutes',2,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'APEX '||CHR(38)||' Database Development','16:30:00','17:20:00',50,'Hall 11B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Joel' AND LASTNAME ='Kallman'));
INSERT INTO PRESENTATION VALUES(56,'How Oracle Single/Multitenant will Change a DBA''s Life','','','Database','12c Upgrades '||CHR(38)||' Migrations','Traditional Presentation','Oracle has announced deprecation for the traditional stand-alone database architecture. What does this mean? And why should you start testing and evaluation at least with an Oracle Single Tenenat (one PDB) environment today? What would be the benefits of using Oracle Multitenant now and where would it fit into your landscape? And how will this change a typical DBA''s life?     Many processes need to be adjusted to deal with Oracle Single- or Multitenant environments. Some things will work different, some put well-known concepts upside down. But there''s also a big chance.    This talk will explain WHY you need to start testing at least with Oracle Single Tenant environments NOW - and highlight main changes but will also explain the typical migration strategies into the world of pluggable databases.','Intermediate','50 Minutes',2,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Database 3','16:30:00','17:20:00',50,'Hall 11A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Mike' AND LASTNAME ='Dietrich'));
INSERT INTO PRESENTATION VALUES(57,'Optimizer Roundtable','','','Database','Performance '||CHR(38)||' Internals','Roundtable','What people like and do not like about the Cost Based Optimizer  What the CBO team is planning to deliver next  What customers want from the CBO team','All Experience Levels','50 Minutes',3,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Roundtables','16:30:00','17:20:00',50,'Hall 4 Foyer Level 5','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Tony' AND LASTNAME ='Hasler'));
INSERT INTO PRESENTATION VALUES(58,'Powering Digital Transformation – Integrating Your Systems with the Cloud Using Oracle SOA','Christian Silva - Infomentum','christian.silva@infomentum.co.uk ','Integration '||CHR(38)||' Collaboration','Integration','Case Study/Real Life Experience','The Prince’s Trust has transformed the lives of 1 million young people in the past 40 years. In order to meet their vision to change 1 million young lives in the next decade, they needed to transform themselves.     As part of this digital transformation journey, a complex integration of Oracle products including WebCenter Sites, SOA, Business Intelligence and Service Cloud was implemented, enabling The Prince’s Trust to overhaul their website, internal reporting and business processes; and ultimately improving the customer journey for the thousands of young people who contact the charity every year.     During this session, attendees can expect to learn the main aspects of the Oracle product integrations used during The Prince’s Trust’s digital transformation. Attendees will hear how the integration of Oracle Service Cloud to WebCenter Sites, Corporate Data Warehouse and applications using SOA can be easily realised, alongside understanding the key challenges faced during the integration, and how they were resolved. ','All Experience Levels','50 Minutes',3,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Integration '||CHR(38)||' Collaboration','16:30:00','17:20:00',50,'Hall 10A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Fabio' AND LASTNAME ='Persico'));
INSERT INTO PRESENTATION VALUES(59,'Real Life Experience Of Database Migration to Oracle SuperCluster','','','Engineered Systems','SuperCluster','Case Study/Real Life Experience','In this presentation I will share my experience of migrating Oracle Database 12c from IBM AIX to Oracle SuperCluster. I will give a brief introduction into Oracle Engineered systems and reasons why SuperCluster was chosen. Several migration approaches was tested and the one with least downtime was picked up. This method will be explained and problems discovered during testing and migration process will be mentioned. This presentation will be valuable for decision makers as well for technical people.','All Experience Levels','50 Minutes',3,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Systems 1','16:30:00','17:20:00',50,'Hall 6A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Juris' AND LASTNAME ='Troshins'));
INSERT INTO PRESENTATION VALUES(60,'Real-Time SQL Monitoring in Oracle Database 12c','','','Database','12c New Features','Traditional Presentation','In this session you will learn how to use Oracle SQL Monitoring reports and its underlying Active Session Data. The SQL Monitoring features have been significantly improved in Oracle 12c. For example, you can see more important metrics at execution plan line level and you can also report SQL monitoring data from past problematic SQL executions. We will go through multiple real-life SQL Monitoring report examples from various Oracle databases.','All Experience Levels','50 Minutes',2,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Database 1','16:30:00','17:20:00',50,'Hall 1','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Tanel' AND LASTNAME ='Poder'));
INSERT INTO PRESENTATION VALUES(61,'SE DBA’s Life a Bed of Roses?','','','Database','Oracle Standard Edition','Case Study/Real Life Experience','Yes, it can be - you just need to beware of the thorns. SE - JUST LOVE IT. In this talk I will show you how I created solutions for managing the challenges that Standard Edition DBAs face in their daily work. In year 2007 I was given the task of tackling customer complaints of a poorly performing software, and as normally the Oracle Standard Edition Database was put to blame (zero2production). That is how the Healthcare Service for PDM/PLM software was born, and soon it became a proven concept for its value as a preventive service. I had the full responsibility for this service between 2007 and 2013 (planning, programming, management, customer care, and other DBA tasks both remote and onsite).','All Experience Levels','50 Minutes',3,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Standard Edition','16:30:00','17:20:00',50,'Hall 10B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Ann' AND LASTNAME ='Sjökvist'));
INSERT INTO PRESENTATION VALUES(62,'A Manly Man''s Guide to Open-Source Database Tuning Tools: Life Without EM12c','','','Database','Performance '||CHR(38)||' Internals','Live Demo','Instance and SQL tuning with EM12c Cloud Control is so easy, it is not even much fun anymore. Also, not every customer may have the appropriate license or database edition, or all you have available remotely is a command-line login to a database. This presentation showcases a few open-source database tuning tools such as Snapper and ASH replacements that DBAs can use to gather and review metrics and wait events from the command line and even in standard edition. This is done by dissecting the familiar performance pages in EM12c, explaining the underlying statistics and showing how similar observations can be made in other tools.','All Experience Levels','30 Minutes',2,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Standard Edition','17:30:00','18:20:00',50,'Hall 1','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Bjoern' AND LASTNAME ='Rost'));
INSERT INTO PRESENTATION VALUES(63,'APIs, Microservices, Cloud Integration? What do They Have in Common '||CHR(38)||' How to Implement Them?','','','Integration '||CHR(38)||' Collaboration','Service Bus '||CHR(38)||' Service Enablement (REST on SOAP etc.)','Masterclass','Given the benefits that new digital trends such as APIs, iPaaS, MBaaS, DevOps bring to the business, organizations are rushing to adopt their related technologies but very often tactically and without a clear strategy and almost no governance. This is resulting in similar integration challenges to those experienced in the early days of SOA but in a much larger scale as the spectrum extends beyond on-premise systems into the cloud, mobile and devices. As the IT landscape becomes more and more complex so will the TCO.     This presentation will provide tips, reference models and processes that if applied, will help organisations successfully implement a digital platform and avoid cloud spaghettis, siloed API’s landscape and microservices mess.    Audience for this presentation is Solution Architects, Technical Architects and/or SOA / API practitioners in general.','All Experience Levels','50 Minutes',3,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Integration '||CHR(38)||' Collaboration','17:30:00','18:20:00',50,'Hall 10A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Luis' AND LASTNAME ='Weir'));
INSERT INTO PRESENTATION VALUES(64,'Choosing The Right Virtualisation Technology','','','Virtualisation','LDOMs / Zones','Traditional Presentation','This talk will cover the various options for virtualising Solaris.  It will focus on the differences and similarities between kernel zones and traditional non global zones and how to make the most appropriate choice.  It will also cover new zones features introduced in Solaris 11.3 including live reconfiguration and secure live migration, and verified boot.','Intermediate','30 Minutes',3,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Systems 2','17:30:00','18:20:00',50,'Hall 6A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Darren' AND LASTNAME ='Moffat'));
INSERT INTO PRESENTATION VALUES(65,'Date Ranges: Time for Oracle 12c SQL','','','Database','SQL and PL/SQL','Traditional Presentation','SQL developers, it''s time to develop your Oracle 12c SQL skills. More and more often, you deal with data containing dates or date ranges. From finding free time in calendars to joining tables based on overlapping date ranges to identifying currently valid data, challenges are legion - especially in Data Warehouses and Big Data in general, where a time dimension is very common. Oracle 12c offers new tools for solving date-related problems, including Temporal Validity support and the MATCH_RECOGNIZE and LATERAL clauses. This session will provide you with: tips about proper use of datetime data types; concepts and terms to help you think clearly about date ranges; common use cases; and solutions made possible by new 12c features.','Experienced/Expert','50 Minutes',2,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Database 3','17:30:00','18:20:00',50,'Hall 11A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Stew' AND LASTNAME ='Ashton'));
INSERT INTO PRESENTATION VALUES(66,'Interactive Reports in APEX - Watch out for the Pitfalls','','','APEX '||CHR(38)||' Database Development','APEX','Live Demo','Interactive Reports is one of the most popular features in Oracle APEX and has been around since Version 3.1 (2008).  But do you really know what''s going on when using Interactive Reports?  We''ll start in the beginning and look at all the features of an IR plus also look at what''s happening behind the scenes.  This will show you how important it is to control which features are allowed for end users and how you can tune performance.  After this session you might run back to work to fix all your IR''s. Your users will welcome faster reports and getting rid of features they scarcely used.','All Experience Levels','50 Minutes',3,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'APEX '||CHR(38)||' Database Development','17:30:00','18:20:00',50,'Hall 11B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Peter' AND LASTNAME ='Raganitsch'));
INSERT INTO PRESENTATION VALUES(67,'Keeping Mobile Enterprise Data Secure','Sumit Gupta - K21 Technologies','sumit.gupta@k21technologies.com','Web '||CHR(38)||' Mobile Apps','Mobile','Traditional Presentation','The use of mobile devices has increased drastically over the period of last 5-10 years. There is an Mobile App for almost everything, People find it convenient to have the freedom of accessing the corporate data from their own personal mobile device rather than carrying separate devices, leading to Bring Your Own Device policy. Oracle Mobile Security Suite provides secure access to the enterprise data without compromising the user experience. This session will bring you up-to-date with the security improvements that have happened in the mobile world and how you can use OMSS to containerise and protect iOS and Android mobile applications. With the range of policies and features (including remote wipe-out) provided by OMSS, organisation is always in control of the corporate data. ','All Experience Levels','50 Minutes',3,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Web '||CHR(38)||' Mobile Apps','17:30:00','18:20:00',50,'Media Suite A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Atul' AND LASTNAME ='Kumar'));
INSERT INTO PRESENTATION VALUES(68,'Oracle Standard Edition Roundtable','Ann Sjokvist - Self Employed','ann.se.sjokvist@gmail.com','Database','Oracle Standard Edition','Roundtable','Round table on the features, restrictions, best practices, solutions and workarounds and latest developments for developers and administrators running Oracle Standard Edition.','All Experience Levels','50 Minutes',2,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Roundtables','17:30:00','18:20:00',50,'Hall 4 Foyer Level 5','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Joel' AND LASTNAME ='Goodman'));
INSERT INTO PRESENTATION VALUES(69,'Real Life Backup '||CHR(38)||' Recovery for Exadata '||CHR(38)||' Super Cluster on the ZFSSA','','','Engineered Systems','ZFS Storage Appliance','Traditional Presentation','Backing up and recovery of large databases on Engineered Systems can be accelerated by the ZFS Storage appliance (ZFSSA). In order to use this best the database administrator needs to dive a little deeper into the ZFSSA archicture, and understand how to optimise the network connectivity between the engineered system and the appliance for optimal performance. At the end of this talk the interested audience should know how the ZFSSA works, how to best configure it from a performance point of view especially with regards to Exadata and the SuperCluster. ','Experienced/Expert','50 Minutes',2,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Systems 1','17:30:00','18:20:00',50,'Media Suite B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Martin' AND LASTNAME ='Bach'));
INSERT INTO PRESENTATION VALUES(70,'Using SQL Translation Framework to Rewrite Bad SQL on the Fly','','','Database','Performance '||CHR(38)||' Internals','Traditional Presentation','Oracle 12c introduced a new feature, SQL Translation Framework (STF), that allows the database to replace SQL statements on the fly. That is to say, the database can be set up to recognize specific SQL statements and replace them with other SQL statements or make programmatic changes to all SQL. The feature was designed to allow applications written for other databases to run without changes, via the ability to replace non-compatible syntax with Oracle equivalent syntax. For example, there is a pre-built Sybase ASE translation package that is designed to translate the Sybase dialect of SQL into the Oracle SQL dialect. When I saw the feature my first thought was that I might be able to use it to fix badly written SQL behind the scenes (i.e. without changing the application code). And as it turns out, SFT gives us the tool kit we need to do just that. This presentation digs into the techniques used to implement this capability with real world examples.','Intermediate','50 Minutes',2,'Monday 7th December 2015',TO_DATE('07/12/2015','DD/MM/YYYY'),'Database 1','17:30:00','18:20:00',50,'Hall 9','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Kerry' AND LASTNAME ='Osborne'));
INSERT INTO PRESENTATION VALUES(71,'Advanced ASH Analytics: ASHmasters ','Marcin Przepiorowski - Delphix','marcin.przepiorowski@delphix.com','Database','Performance '||CHR(38)||' Internals','Traditional Presentation','Learn about ASH Masters a github repository of queries against Average Active Sessions (ASH). Learn about ASH math, average active sessions and the power and pitfalls of ASH queries. ASH queries will be shown that display over database performance from on high to diving deep down into the nitty gritty of performance bottleneck''s internal workings. Active Session History (ASH) is the most powerful source of performance analytic data in Oracle. Querying ASH can be difficult with a number of pitfalls but the rewards of correct data analysis of ASH are the most powerful tool a DBA has for performance analysis. Learn how to query ASH correctly and learn where to get pre-written powerful ASH queries. ','Experienced/Expert','50 Minutes',1,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Database 1','09:00:00','09:50:00',50,'Hall 9','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Kyle' AND LASTNAME ='Hailey'));
INSERT INTO PRESENTATION VALUES(72,'Common Mistakes when Implementing 12c OEM','','','Database','Oracle Enterprise Manager','Traditional Presentation','12c OEM is an enterprise class monitoring solution. The plan for many 12c OEM implementations is usually one dimensional; have we installed all the Oracle Agents.  The result of this implementation approach is a sudden avalanche of monitoring alerts; constant back peddling and reconfiguration which is a waste of time and effort.  None of the key features and benefits are used from the outset.  This session looks at the common mistakes and missed opportunities when implementing 12c OEM. I detail the key administration features with real world examples (emcli + jython / administration groups / UDMs / configuration extensions / groups / credentials / sudo setup and more) which demonstrate all the benefits that 12c OEM should be bringing.  ','All Experience Levels','50 Minutes',3,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Database 4','09:00:00','09:50:00',50,'Hall 6A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Philip' AND LASTNAME ='Brown'));
INSERT INTO PRESENTATION VALUES(73,'Community Keynote: Revolutionizing Application Development with Oracle Cloud ','','','Web '||CHR(38)||' Mobile Apps','Cloud','Traditional Presentation','The Oracle Cloud platform changes not just the runtime platform but also the way you develop and extend applications. Learn how Oracle is changing both JavaScript and mobile development, and reducing the load on IT shops by empowering business users to be self-sufficient and helping them to collaborate with professional programmers leveraging the latest technology standards. Join this session for live demos that illustrate how new and upcoming cloud services improve IT and users’ collaborations resulting in faster applications delivery.','All Experience Levels','50 Minutes',5,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Web '||CHR(38)||' Mobile Apps','09:00:00','09:50:00',50,'Hall 11B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Duncan' AND LASTNAME ='Mills'));
INSERT INTO PRESENTATION VALUES(74,'Deep Dive into Oracle Database Appliance using Oracle Database 12c Architecture','','','Engineered Systems','Oracle Database Appliance','Traditional Presentation','Ready to move your database infrastructure to Oracle Database 12c?  Looking for a simple, fast, and efficient method to migrate, deploy and maintain your databases?  The Oracle Database Appliance provides a single command to upgrade those Oracle Database 11g databases to Oracle Database 12c and be able to create a Test/Dev environment in minutes.  Join this session to learn about the latest Oracle Database Appliance Architecture and the latest Enterprise Manager Plug-In to monitor and manager your Database Appliance environments.','All Experience Levels','50 Minutes',3,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Systems','09:00:00','09:50:00',50,'Hall 7A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Tammy' AND LASTNAME ='Bednar'));
INSERT INTO PRESENTATION VALUES(75,'Faster Than Ever; Development with Oracle Application Express 5.0','','','APEX '||CHR(38)||' Database Development','APEX','Live Demo','Oracle Application Express (APEX) 5.0 introduces Page Designer, a lightning fast new way to build web applications. Page Designer is a rapid and intuitive browser-based IDE, allowing you to focus on what’s important and get the job done faster than ever. Better visual representation of page layout, intuitive drag and drop, enhanced code editing, undo / redo capability and tons of productivity features built-in. If you want to know what Page Designer is all about, direct from the people who built it, and see how much faster you can be, this session is for you.','All Experience Levels','50 Minutes',2,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'APEX '||CHR(38)||' Database Development','09:00:00','09:50:00',50,'Hall 10A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Anthony' AND LASTNAME ='Rayner'));
INSERT INTO PRESENTATION VALUES(76,'How to Upgrade Your 11g RAC Cluster to 12c with (Near-) Zero Downtime','','','Database','12c Upgrades '||CHR(38)||' Migrations','Traditional Presentation','Oracle announced the end of premier support for Oracle11gR2 at the start of this year (2015). Since then BT has been deploying new RAC clusters using Oracle12  c but still has many RAC clusters running at older versions. This presentation will cover a largely automated method of performing a rolling upgrade from Orac  le 11gR2 RAC clusterware to Oracle 12c including enlarging and replacing voting disks, converting to FlexASM and FlexCluster and configuring the GI Management   Repository with (near)-zero downtime. Whilst the process is fairly involved Oracle have made this a largely pain-free affair. This presentation will describe   this process and any pitfalls in detail.    Topics covered will include:    - how to perform rolling upgrades of RAC clusterware from 11gR2 to 12c  - how to downgrade from 12c to 11gR2 (with caveats!)  - how to ensure your newly upgraded cluster uses the new Oracle12c features such as FlexASM and FlexCluster (and why you want to!)  ','Intermediate','50 Minutes',3,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Database 3','09:00:00','09:50:00',50,'Hall 10B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='David' AND LASTNAME ='Hickson'));
INSERT INTO PRESENTATION VALUES(77,'Knowledge Sharing - Why Do It?  What''s In It For Me?','','','Database','People (WIT, Team Management, Dealing with other Tech Groups, Outsourcing etc.)','Traditional Presentation','This presentation takes you through my journey in knowledge sharing.  It covers:     1.  The different types of knowledge sharing you can do  2.  The pros and cons of each type of knowledge sharing  3.  What you gain from it, and what it costs.','All Experience Levels','50 Minutes',3,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Database 2','09:00:00','09:50:00',50,'Hall 11A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Pete' AND LASTNAME ='Sharman'));
INSERT INTO PRESENTATION VALUES(78,'Maximize Performance, Optimize Resource Usage '||CHR(38)||' Minimize Downtime with IT Analytics','','','Business Analytics','Oracle Enterprise Manager','Traditional Presentation','Traditional IT tools used for monitoring and management are not designed to meet the strategic needs of businesses, such as, the impact of an acquisition on systems or preparing for the launch of new products and services. Operations Analytics is a new discipline of business analytics that can help IT analyze the impact of these business events. In this session, learn about the new IT Analytics solutions built on the next generation Enterprise Manager Big Data platform to help business analysts with performance analysis, capacity planning and infrastructure assessment.','Intermediate','50 Minutes',3,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Big Data '||CHR(38)||' Data Warehousing','09:00:00','09:50:00',50,'Hall 6B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Jagan' AND LASTNAME ='Athreya'));
INSERT INTO PRESENTATION VALUES(79,'What''s Stopping You from Upgrading to Oracle SOA Suite 12c?','','','Integration '||CHR(38)||' Collaboration','Upgrades/New Feature','Case Study/Real Life Experience','New adapters for cloud, SAP and more, Managed File Transfer, Enterprise Scheduling Service, enhanced mobile support as well as increased developer productivity. A lot of great features in Oracle SOA Suite 12c but you are still not 100% convinced? Join us and get insights from our 11g to 12c case studies that we collected in real life projects for different customers. Based on certain best practices and tips we will explain why and how we moved to a highly scalable and innovative SOA platform. Learn how to leverage from a complete product stack. The session will give you an excellent overview to choose the right migration approach for your project and a kick-start to build your Oracle middleware solutions. Judging Note: proposed co-speaker - Simon Haslam, Veriton; Simone Geib, Oracle.','Intermediate','50 Minutes',3,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Integration '||CHR(38)||' Collaboration','09:00:00','09:50:00',50,'Media Suite B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Danilo' AND LASTNAME ='Schmiedel'));
INSERT INTO PRESENTATION VALUES(80,'A Beginners Guide to Oracle Mobile Application Framework','','','Web '||CHR(38)||' Mobile Apps','Mobile','Live Demo','"Mobile is eating the world" might seem a little dramatic, but the fact is that more and more businesses require a mobile presence and mobile access for their workforce. And its not just about accessing business applications from a mobile device''s browser. You should be making the most of the power of the device: GPS, working offline, integrating with your phones features such as camera and contacts. Oracle Mobile Application Framework (Oracle MAF) is Oracle''s strategic technology for developing on-device mobile application for platforms such as Android and iOS with a single, shared codeline. In this demo driven presentation you will see Oracle MAF in action: how to develop application features, integrate with device services, call remote web services and how to work off-line.','Beginner/Exploratory','50 Minutes',3,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Web '||CHR(38)||' Mobile Apps','10:00:00','10:50:00',50,'Hall 10B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Grant' AND LASTNAME ='Ronald'));
INSERT INTO PRESENTATION VALUES(81,'Building Your Private Cloud with Oracle ExaLogic: Bringing all Oracle Public Cloud Services into the Box','','','Engineered Systems','Exalogic','Traditional Presentation','What''s new with Oracle Exalogic - hardware enhancements, software innovations, and advances in the platform? What’s most exciting with Oracle Exalogic – bringing all Oracle Public Cloud services into Exalgoic!  Come hear from and ask question to Oracle Product Management regarding future directions and objectives for Oracle''s Engineered Systems, the cloud strategy on that runs the world''s biggest enterprises and datacenters.','Intermediate','50 Minutes',3,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Systems','10:00:00','10:50:00',50,'Hall 11B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Frances' AND LASTNAME ='Zhao-Perez'));
INSERT INTO PRESENTATION VALUES(82,'Business Analytics for Applications, Delivering Real Business Benefit','','','Business Analytics','OTBI / OTBI-E (Saas Cloud)','Traditional Presentation','In this session Oscar will describe Oracle’s Business Analytical strategy for delivering business value to its application customers.  He will share his experience of working with customers across EMEA who are using business analytics with Applications to deliver real business benefits through greatly improved decision making.  Oscar will then go on to explain how you can maximize your ongoing investments to ensure your business analytics meets not only your needs today but provides you with a path to the future.  In doing so he will share Oracle’s roadmap, describe the current available solutions for on-premise, cloud or hybrid deployed applications, and suggest how you can reduce TCO, reduce time to value and greatly improve your project success rate drastically.','All Experience Levels','30 Minutes',3,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Business Analytics 1','10:00:00','10:30:00',30,'Executive Room 2','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Oscar' AND LASTNAME ='Colino Garcia'));
INSERT INTO PRESENTATION VALUES(83,'HL7 Real Time Integration with Oracle SOA for Healthcare 12c – A Case Study','Lonneke Dikmans - eProseed, ACE Director','lonneke.dikmans@eproseed.com','Integration '||CHR(38)||' Collaboration','SOA incl. BPEL','Case Study/Real Life Experience','HL7 is an industry standard. It provides a framework for the exchange, integration, sharing, and retrieval of electronic health information. ADT (Admit, Discharge, Transfer) Messages carry patient demographic information and are one of the most widely used of all HL7 message types. It is typically initiated by the HIS (Hospital Information System) and exchanged between different systems within a hospital application landscape. In this case study we show how a hospital moved from a Sun JCAPS environment to an Oracle SOA Suite 12c and Oracle Healthcare integration to dynamically route ADT messages from the Hospital Information System to over 100 different hospital systems using the Healthcare adapter, business rules, XSLTs, BPEL etc. These routing rules can be maintained by users, without having to redeploy code. This session covers the solution architecture and how we addressed requirements like performance (100,000 messages per day), sequence management, message acknowledgement and fault handling.','All Experience Levels','50 Minutes',3,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Integration '||CHR(38)||' Collaboration','10:00:00','10:50:00',50,'Hall 11A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Bruno' AND LASTNAME ='Alves'));
INSERT INTO PRESENTATION VALUES(84,'Why Use PL/SQL?','','','APEX '||CHR(38)||' Database Development','PL/SQL','Traditional Presentation','The success of any serious software system depends critically on adhering to the principles of modular decomposition – principles that are as old as computer science itself. A module encapsulates a coherent set of functionality, exposing it using an interface that exactly maps the functions it supports, and scrupulously hiding all implementation details. No-one would dream of challenging these notions – unless one of the major modules is a relational database!    The structure of the tables, the rules that constrain their rows, and the SQL statements that read and change the rows are the implementation details. And Oracle Database provides PL/SQL subprograms to express the interface.    Yet many customers avoid stored procedures. They claim that PL/SQL in the database can''t be patched without unacceptable downtime; that the datatypes for passing row sets between the client-side code and the database PL/SQL are cumbersome to use and bring performance problems; and that it''s impractical to give each developer a private sandbox within which to make changes to database PL/SQL. These notions are myths; they are no less defensible than the myth that technology whose name doesn''t start with "J" or "No" is too old-fashioned to be useful.    Customers who do hide their SQL behind a PL/SQL interface are happy with the correctness, maintainability, security, and performance of their applications. Ironically, customers who follow the NoPlsql religion suffer in each of these areas.    This session provides PL/SQL devotees with unassailable arguments to defend their beliefs against attacks from skeptics. I hope that skeptics who attend will experience an epiphany.','All Experience Levels','50 Minutes',3,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'APEX '||CHR(38)||' Database Development','10:00:00','10:50:00',50,'Hall 9','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Bryn' AND LASTNAME ='Llewellyn'));
INSERT INTO PRESENTATION VALUES(85,'Oracle BI Cloud Service - Moving Your Complete BI Platform to the Cloud','','','Business Analytics','BICS (PasS Cloud)','Traditional Presentation','Oracle BI Cloud Service has now been enhanced to include Visual Analyzer, an analysis tool for rapidly visualizing BI datasets, the ability to connect to Oracle Database-as-a-Service, and new options to upload RPDs and datasets from on-premise installations. In this session, we''ll see how it''s now possible to create complete BI applications in Oracle''s cloud environment, migrate existing BI platforms and start to benefit from the TCO, manageability and scalability benefits of running BI in the cloud. We''ll also discuss connectors to Oracle''s cloud-based applications, and how you can create hybrid on-premise/cloud BI platforms for capacity "burst-out" and more agile development processes.','Beginner/Exploratory','50 Minutes',3,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Business Analytics 1','11:10:00','12:00:00',50,'Executive Room 2','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Mark' AND LASTNAME ='Rittman'));
INSERT INTO PRESENTATION VALUES(86,'Better Together: Building Great iOS '||CHR(38)||' Android Apps with Oracle APEX '||CHR(38)||' Oracle MAF','','','Web '||CHR(38)||' Mobile Apps','Mobile','Traditional Presentation','Oracle Application Express (APEX) is a great tool for building mobile web applications; however, it is not possible to run those applications in offline mode on a phone or tablet. Thus, to build on-device iOS and Android applications, Oracle offers the Oracle Mobile Application Framework (MAF). In this session, you will learn how to leverage PL/SQL and APEX applications from Oracle MAF. Specifically, you will see how to call PL/SQL logic through web services and how to integrate remote APEX mobile webpages in a MAF application.','Intermediate','50 Minutes',3,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Web '||CHR(38)||' Mobile Apps','11:20:00','12:10:00',50,'Hall 11A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Frédéric' AND LASTNAME ='Desbiens'));
INSERT INTO PRESENTATION VALUES(87,'Community Keynote: Oracle Integration Strategy: Cloud, Mobile, Events, and API Management','Simone Geib - Oracle','simone.geib@oracle.com','Integration '||CHR(38)||' Collaboration','Integration','Traditional Presentation','Join this headliner session from Oracle Product Management to learn how to best leverage Oracle’s recent innovations within Oracle Integration Cloud Service, Oracle SOA Suite, Oracle SOA Suite Cloud Service, the Oracle Stream Explorer tool, and Oracle API Manager. Accelerate the pace of your transition from an on-premises–only solution to a hybrid cloud/on-premises solution to keep up with the increased requirements of mobile, cloud, and the Internet of Things integration. Get the integration big picture and join in the collaborative Q'||CHR(38)||'A discussion to learn what you need to know in order to maintain integration leadership.','All Experience Levels','50 Minutes',5,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Integration '||CHR(38)||' Collaboration','11:20:00','12:10:00',50,'Hall 11B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Vikas' AND LASTNAME ='Anand'));
INSERT INTO PRESENTATION VALUES(88,'Database as a Service Catalog Design','','','Database','Oracle Enterprise Manager','Traditional Presentation','Database as a Service (DBaaS) opens a whole new world of possibilities, both to users of the databases and the DBA''s that administer them.  When moving to DBaaS, it''s important to create a well defined service catalog that users can select from, to ensure we minimize database sprawl.  This presentation walks you through an example of designing a DBaaS catalog that meets both user and administrator requirements.','Beginner/Exploratory','50 Minutes',3,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Database 4','11:20:00','12:10:00',50,'Media Suite B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Pete' AND LASTNAME ='Sharman'));
INSERT INTO PRESENTATION VALUES(89,'Explore the Charting Capabilities of Oracle Application Express 5.0','','','APEX '||CHR(38)||' Database Development','APEX','Live Demo','The most simple and immediately effective way to make your data easy to understand, is through the design of your graphs and charts.  In this session, we will explore the various charting capabilities available with APEX 5.0, from native Flash and HTML5 charts, through to our array of chart plug-ins now incorporated in our Packaged applications. See how you can integrate great looking Flash, HTML5 and CSS charts, to tell a story in your application.','All Experience Levels','50 Minutes',3,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'APEX '||CHR(38)||' Database Development','11:20:00','12:10:00',50,'Hall 10A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Hilary' AND LASTNAME ='Farrell'));
INSERT INTO PRESENTATION VALUES(90,'Just What is Multitenant '||CHR(38)||' Oracle Data Guard?','','','Database','High Availability and Replication','Traditional Presentation','Confused about how Multitenant Databases in Oracle 12c work with Oracle Data Guard?  Wondering how you create standbys and perform role transitions?  Completely skeptical about how all the Clone and Plug-In of PDBs work when you have a Data Guard Standby?  And just what is STANDBYS=NONE anyway?  Come and find out in this deep dive into Multitenant and Oracle Data Guard.','Intermediate','50 Minutes',1,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Database 2','11:20:00','12:10:00',50,'Hall 9','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Larry' AND LASTNAME ='Carpenter'));
INSERT INTO PRESENTATION VALUES(91,'Oracle Database 12c Consolidation: Why and How to Manage CPU Resources','','','Database','Management and Administration','Traditional Presentation','Nowadays, it is common to find multiple databases on a server. In order to manage CPU resources, you can limit the CPU usage of a database, and/or reserve CPUs for one or more databases. This session shows and compares two resource management options integrated into the Oracle database:     - Instance Caging   - processor_group_name     For each of them, the session focuses on: Facts: Describing the features and a quick overview on how to implement them.     Observations: Logical IO performance, memory distribution across NUMA nodes, etc... OEM and AWR views with CPU pressure. Real life customer cases: One database uses too much CPU and affects other instances’ performance, guarantee CPU resource for some databases at the database level, guarantee CPU resource for one group (or more) of databases. You''ll also learn in this session how you could make efficient usage of large machines: That is to say mix on the same machine customers that pay for guaranteed CPU resources and those that don''t pay for.','All Experience Levels','50 Minutes',2,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Database 3','11:20:00','12:10:00',50,'Hall 10B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Bertrand' AND LASTNAME ='Drouvot'));
INSERT INTO PRESENTATION VALUES(92,'Oracle Flashback','','','Database','Agenda Theme - Embrace','Traditional Presentation','With Flashback Data Archive now available as part of the core product, it''s worth exploring this and all of the other flashback facilities available in the database engine. Flashback options are rarely considered in day to day practice, because of blinkered view that it is only for when an "accident" occurs. However, there are countless other value use cases that will be covered in this session. All of the variations: - flashback table - flashback drop - flashback query - flashback database - flashback transaction - flashback data archive will all be covered.','Intermediate','50 Minutes',2,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Database 1','11:20:00','12:10:00',50,'Hall 1','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Connor' AND LASTNAME ='McDonald'));
INSERT INTO PRESENTATION VALUES(93,'Oracle Security Roundtable','','','Database','Compliance, Audit '||CHR(38)||' Security','Roundtable','Following the great success of previous years Oracle security round tables I invite all attendees to come along and pose questions relating to Oracle Security for discussion or join in answering and exploring other conference goers questions.    I expect lively and interesting discussions and questions in the area of oracle database security. The session will be guided and lead by Pete Finnigan who has years of experience securing databases and teaching others to do the same.','All Experience Levels','50 Minutes',3,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Roundtables','11:20:00','12:10:00',50,'Hall 4 Foyer Level 5','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Pete' AND LASTNAME ='Finnigan'));
INSERT INTO PRESENTATION VALUES(94,'Software in Silicon - Ground Breaking Performance Improvements','','','Operating Systems','Oracle Solaris','Traditional Presentation','The new processors from Oracle include Software in Silicon (SWiS) with features that enable big performance improvements in Oracle DB in-memory performance. This presentation will explain what SWiS features are available with the new M7 processor and the systems that contain it. It will then show the performance gains that can be demonstrated using the new processor. Finally some of the features can be used to help safeguard the system from software violations, both accidental and malicious.','Intermediate','50 Minutes',3,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Systems','11:20:00','12:10:00',50,'Media Suite A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Terry' AND LASTNAME ='Smith'));
INSERT INTO PRESENTATION VALUES(95,'Adaptive Dynamic Sampling','','','Database','Performance '||CHR(38)||' Internals','Traditional Presentation','Based on object statistics stored in the data dictionary, the query optimizer can’t always accurately estimate the cost of an operation or predicate. When the query optimizer recognizes such a case, in some situations it can gather additional statistics through dynamic sampling. The original implementation of dynamic sampling was introduced in Oracle Database 9.2 and, up to 11.2.0.3, only marginally improved. However, Oracle Database 11.2.0.4 and 12.1 introduces a new implementation that completely changes the way dynamic sampling works. The aim of this presentation is to explain and demonstrate how the new implementation works. ','Experienced/Expert','50 Minutes',2,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Database 1','12:20:00','13:10:00',50,'Hall 9','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Christian' AND LASTNAME ='Antognini'));
INSERT INTO PRESENTATION VALUES(96,'Community Keynote: Modern Application Development with the Oracle Database','','','APEX '||CHR(38)||' Database Development','APEX','Traditional Presentation','The Oracle Database has always been a viable application development platform.  And as each new computer era has unfolded, the Oracle Database has evolved with it, through continuous innovation.  The key drivers of modern application development (REST, Responsive, Mobile, Cloud) will be explained and how the Oracle Database platform is rapidly evolving to meet these needs.','Beginner/Exploratory','50 Minutes',5,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'APEX '||CHR(38)||' Database Development','12:20:00','13:10:00',50,'Hall 10B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Joel' AND LASTNAME ='Kallman'));
INSERT INTO PRESENTATION VALUES(97,'Data Guard Roundtable','Uwe Hesse - Oracle','Uwe.Hesse@Oracle.com','Database','High Availability and Replication','Roundtable','Round table discussion on the latest in Data Guard technology','All Experience Levels','50 Minutes',2,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Roundtables','12:20:00','13:10:00',50,'Hall 4 Foyer Level 5','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Joel' AND LASTNAME ='Goodman'));
INSERT INTO PRESENTATION VALUES(98,'Deep Dive into Parallel Database Upgrades - with or without Oracle Multitenant','','','Database','12c Upgrades '||CHR(38)||' Migrations','Traditional Presentation','catctl.pl is the upgrade tool since Oracle Database 12c. But apart from being able to upgrade a stand-alone database to Oracle Database 12c catctl.pl has way more power and options, especially when it comes to Single/Multitenant upgrades.     This talk will deep dive into the tech secrets of catctl.pl, from an architectural view into all the switches and tweaks to the power if upgrading hundreds of PDBs in parallel in the most efficient way balancing between speed and contention.','Experienced/Expert','50 Minutes',1,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Database 4','12:20:00','13:10:00',50,'Hall 6A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Mike' AND LASTNAME ='Dietrich'));
INSERT INTO PRESENTATION VALUES(99,'Fraud '||CHR(38)||' Anomaly Detection Using Oracle Advanced Analytics','','','Database','Agenda Theme - Embrace','Traditional Presentation','The cost of fraud is impossible to quantify but is estimated well into the many billion dollars range.  Given this high cost, how can you combat fraud and successfully find those costly needles hidden in your haystacks of enterprise data?  Oracle Advanced Analytics (OAA) helps you find suspicious expense reports, non-compliant tax submissions, and healthcare fraud and realize huge savings. OAA, a Database 12c option, sifts through massive amounts of data, detects patterns and relationships and reduces information latency to hours/mins/secs.  Oracle Big Data SQL adds new data sources and helps cast a wider data net.  Presentation and demos will show how to use Oracle Advanced Analytics to develop analytical methodologies for fraud and anomaly detection using the Oracle Data Miner GUI, SQL and R integration. Customer use cases i.e. healthcare fraud, Turkcell pre-paid phone cards, Fiserv money transactions and check fraud will be discussed. ','All Experience Levels','50 Minutes',2,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Database 2','12:20:00','13:10:00',50,'Hall 11A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Charles' AND LASTNAME ='Berger'));
INSERT INTO PRESENTATION VALUES(100,'Infiniband for Engineerd Systems','','','Engineered Systems','Exadata','Traditional Presentation','Engineers Systems are more common all around the world, customers are buying multiple Exadata''s Exalogic, BDA etc. and want maximum performance when working together. Infiniband is key in making this too a success. This session will help you understand Infiniband. Normally you don''t have to look at your Infiniband infrastructure, it just works but what if it suddenly stops working? Do you think you have a misconfigured infiniband subnet but you don''t know what to check? See how you can use infiniband tools to test, troubleshoot and diagnose your fabric. Furthermore we will take a look at on a range of protocols that can be used on Infiniband like RDMA, RDS, IPoIB and how they interact with each other.','Intermediate','50 Minutes',2,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Systems','12:20:00','13:10:00',50,'Media Suite A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Klaas-Jan' AND LASTNAME ='Jongsma'));
INSERT INTO PRESENTATION VALUES(101,'Introduction to the REST Adapter: REST '||CHR(38)||' JSON for Dummies','','','Integration '||CHR(38)||' Collaboration','Development Technologies (REST, JavaScript etc.)','Live Demo','One of the new features of the Oracle SOA Suite 12c is the REST Adapter. This enables you to expose a SOAP service as a REST (JSON/XML) service, or to expose a REST service as a SOAP service. This session explains the different concepts in REST that you need to understand before you can build a REST service using the REST adapter:  •Parameter types (templates, query, header)  •Methods and the resource  •WADL  This is illustrated with a real life example, where we exposed some services from the Human workflow component to a MAF application, using the REST adapter. After this session, delegates with no experience in REST JSON or REST XML services will be able to use the REST adapter and will know the common patterns and expectations from a mobile perspective. This will enable traditional web service developers to get started quickly. ','Beginner/Exploratory','50 Minutes',3,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Web '||CHR(38)||' Mobile Apps','12:20:00','13:10:00',50,'Hall 11B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Lonneke' AND LASTNAME ='Dikmans'));
INSERT INTO PRESENTATION VALUES(102,'Moving Data In '||CHR(38)||' Out of the Cloud, Highway to Heaven or Hells Kitchen','John Mullis - Oracle','John.mullis@oracle.com','Big Data '||CHR(38)||' Data Warehousing','Cloud','Traditional Presentation','Are you looking to adopt a cloud based solution Database as a Service, Business Intelligence in the Cloud or  Software as a Service and yet still need to maintain an on-premise database or data warehouse? Whether you choose run in Oracle Cloud, Amazon Cloud, Azure Cloud or Salesforce.com data integration with cloud to on-premise is still a challenge. In this session learn how to integrate these cloud services with your on-premise databases. In this session we will explore how GoldenGate can synchronise cloud databases with on premise databases and how Oracle Data Integrator can integrate with cloud databases and applications.','All Experience Levels','50 Minutes',3,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Big Data '||CHR(38)||' Data Warehousing','12:20:00','13:10:00',50,'Hall 6B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Noel' AND LASTNAME ='Sidebotham'));
INSERT INTO PRESENTATION VALUES(103,'Troubleshooting Goldengate','','','Database','High Availability and Replication','Traditional Presentation','Goldengate is a complex product, and things will go wrong. How do you work out what went wrong?   The basic outputs and instrumentation could be better, especially when you have heterogeneous environments.    This talk will take you through how to troubleshoot Goldengate to fix broken replication and how to configure and setup structures within Goldengate to help you identify and resolve problems within Goldengate when they occur.  ','Intermediate','50 Minutes',2,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Database 3','12:20:00','13:10:00',50,'Hall 10A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Neil' AND LASTNAME ='Chandler'));
INSERT INTO PRESENTATION VALUES(104,'Unified Event Processing Architecture','Guido Schmutz - Trivadis, ACE Director','Guido.Schmutz@trivadis.com','Integration '||CHR(38)||' Collaboration','Service Bus '||CHR(38)||' Service Enablement (REST on SOAP etc.)','Traditional Presentation','Independent of the source of data, the integration of event streams into an Enterprise Architecture gets more and more important in the world of sensors, social media streams and Internet of Things. Events have to be accepted quickly and reliably, they have to be distributed and analyzed, often with many consumers or systems interested in all or part of the events. Dependent on the size and quantity of such events, this can quickly be in the range of Big Data. In this session an architecture with one central log structured storage (a.k.a. event bus) is presented where anybody can publish and subscribe to events. This can be implemented using frameworks such as Kafka, Oracle Service Bus, Oracle Event Processing and Oracle Stream Explorer.','Intermediate','50 Minutes',3,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Integration '||CHR(38)||' Collaboration','12:20:00','13:10:00',50,'Media Suite B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Simone' AND LASTNAME ='Geib'));
INSERT INTO PRESENTATION VALUES(105,'Insight in the Cloud: Inoapps’ Journey with Oracle Business Intelligence Cloud Service (BICS)','Jordan Wilson - Inoapps','Jordan.Wilson@inoapps.com','Business Analytics','BICS (PasS Cloud)','Case Study/Real Life Experience','During this session you will learn why Inoapps decided to purchase and implement Oracle BICS to boost their already extensive deployment of Oracle Cloud technologies. In addition to sharing their experience as a customer, they will also be presenting a demonstration of BICS to show how easy it is to get real business insight and value from self-service, visually appealing dashboards. This demonstration will be carried out live and the floor will be opened to questions at the close of the presentation. During this session we plan to show how non-consultant/IS users can deliver rapid insights from BICS without the need for expensive external assistance.    About the partner: Inoapps is a platinum partner who are specialised in Business Analytics technologies and offer pre-packaged rapid start delivery options for most BA solutions, as well as a wider set of services on the entire Oracle Stack.','Beginner/Exploratory','30 Minutes',3,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Business Analytics 1','13:10:00','13:40:00',30,'Executive Room 1','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Ed' AND LASTNAME ='Jeavons'));
INSERT INTO PRESENTATION VALUES(106,'Oracle Analytic Applications - Rolls Royce or Ford Transit?','','','Business Analytics','Analytic Applications (OBIA)','Case Study/Real Life Experience','Oracle Analytics Applications (BI Applications) have a reputation for being a Rolls Royce reporting solution for large organisations who use Oracle Applications, but most organisations are not in a position to buy a Roll Royce. Most are still relying on an old Mini to do their reporting (sorry, Discoverer or Mini fans). We will show, using a customer case study, that BI Applications can be a pragmatic solution to address a common reporting challenge without inappropriate investment risk; a practical and reliable Ford Transit. Using an Accelerated approach, including training, user adoption, flexfield collection and custom dashboards, our client has replaced ineffective reporting software with BI Applications, reaped business benefits within 6 weeks and will have saved money within 3 years compared with the old and untrusted approach. ','Beginner/Exploratory','50 Minutes',3,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Business Analytics 1','13:50:00','14:40:00',50,'Executive Room 8','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Toby' AND LASTNAME ='Price'));
INSERT INTO PRESENTATION VALUES(107,'Avoid migration '||CHR(38)||' upgrade downtime on your critical Oracle systems--Dell did and saved $38M','','','Database','12c Upgrades '||CHR(38)||' Migrations','Traditional Presentation','Dell’s Siebel CRM, known internally as Delta, is one of the largest implementations in world. Delta is the transaction engine that enables technical support for systems ranging from mission critical enterprise scale servers and storage to the individual with a tablet. Downtime on this particular system is estimated at $2 million per hour. An older version of Oracle needed to be upgraded along with infrastructure changes. In all, Dell was facing some 20 hours of downtime. Using database replication, the downtime was reduced to less than 40 minutes, a 97% reduction in downtime with a savings of $38.8 million. The versatility of such an approach has provided tremendous benefits around availability, scalability and data integration. In an age of “always on” expectations, the strategy described can meet the needs of most medium to global enterprises.','All Experience Levels','50 Minutes',3,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Database 4','14:10:00','15:00:00',50,'','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Bill' AND LASTNAME ='Brunt'));
INSERT INTO PRESENTATION VALUES(108,'Interpreting AWR Reports - Straight to the Goal','','','Database','Performance '||CHR(38)||' Internals','Traditional Presentation','In this presentation, focusing on Oracle Database tuning, you will discover how to get the most relevant information from a Statspack or AWR report - in less than an hour.   We will show you how to read the report efficiently, focusing only on the details that can be tuned and have a positive impact on the user response time. We also calculate the expected gain. This presentation features a practical example covering some commonly encountered cases.','Intermediate','50 Minutes',1,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Database 3','14:10:00','15:00:00',50,'Hall 10B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Franck' AND LASTNAME ='Pachot'));
INSERT INTO PRESENTATION VALUES(109,'It’s Always the Network.  Exonerating the Database','','','Database','Management and Administration','Case Study/Real Life Experience','The database is not working properly! Fix it! This is often heard by DBAs and, as is often the case, it is not the database that is the problem but it is merely showing symptoms caused by other underlying issues. In this session I will show 2 cases were the root cause was the network and the efforts made to prove to the client that the database was not the problem. The 2 issues were intermittent problems, one over a database link and one about the shipping of archive logs','All Experience Levels','50 Minutes',3,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Database 2','14:10:00','15:00:00',50,'Hall 11A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Luke' AND LASTNAME ='Davies'));
INSERT INTO PRESENTATION VALUES(110,'Middleware Roundtable','','','Integration '||CHR(38)||' Collaboration','Architecture','Roundtable','This is question and answer chat with Middleware users and experts.   Please come along and share your experiences and questions.  Submit questions on Twitter @pbainbri #Tech15 #OEMMT','All Experience Levels','50 Minutes',3,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Roundtables','14:10:00','15:00:00',50,'Hall 4 Foyer Level 5','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Paul' AND LASTNAME ='Bainbridge'));
INSERT INTO PRESENTATION VALUES(111,'Monitoring Oracle SOA Suite','','','Integration '||CHR(38)||' Collaboration','SOA incl. BPEL','Traditional Presentation','Oracle SOA Suite is key to the middleware infrastructures of many large organisations, but it is often seen as a black box that is either working or broken. This session will look at the information that is available in SOA suite, and how it can help you not only pre-empt faults, but make capacity planning and resource decisions. We will look at the various tools and technologies that are available for monitoring Oracle SOA Suite, and their advantages and disadvantages, giving you the tools and information you require to select the most appropriate monitoring approach for your application. We will also look at the key areas that should be monitored in a SOA Suite infrastructure, and some of the common indicators of potential failures or performance problems.','All Experience Levels','50 Minutes',4,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Integration '||CHR(38)||' Collaboration','14:10:00','15:00:00',50,'Media Suite B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Matt' AND LASTNAME ='Brasier'));
INSERT INTO PRESENTATION VALUES(112,'Oracle Database In-Memory Option- Under the Hood','','','Database','12c New Features','Masterclass','Oracle Database In-Memory introduces a new in-memory only columnar format and a new set of SQL execution optimizations such as SIMD processing, column elimination, storage indexes and In-Memory Aggregation all of which are designed specifically for the new column format. With the combination of the new format and these optimizations Oracle provides a solution for accelerating database-driven business decision-making to real-time.   This deep-dive session describes in detail the technology underlying Oracle Database In-Memory. It begins with an explanation on what motivated Oracle to develop this new technology, before providing a clear understanding of how this unique “dual-format” architecture works. It will also illustrative how the new In-Memory functionality interacts with key database performance features like RAC, Partitioning, parallel execution, etc. As well as offering insights on how you can scale-up or scale out this solution to best fit your unique requirements.  ','All Experience Levels','1hr 50mins - Masterclass or Hands on Lab',2,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Database 1','14:10:00','15:00:00',50,'Hall 9','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Maria' AND LASTNAME ='Colgan'));
INSERT INTO PRESENTATION VALUES(113,'Real-Life Oracle MAF: Things You Don’t Learn from Oracle’s Developer’s Guide','','','Web '||CHR(38)||' Mobile Apps','MAF','Case Study/Real Life Experience','Oracle Mobile Application Framework enables you to create apps for both iOS and Android. When you''re building your first Oracle Mobile Application Framework app, you''ll run into issues you can''t solve by reading Oracle''s Developer''s Guide. Think of skinning, creating custom springboards and more. It can all be done, but there are many different ways. You will learn solutions for these and other real-life Oracle Mobile Application Framework challenges. ','Intermediate','50 Minutes',3,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Web '||CHR(38)||' Mobile Apps','14:10:00','15:00:00',50,'Hall 6A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Luc' AND LASTNAME ='Bors'));
INSERT INTO PRESENTATION VALUES(114,'The Future of Oracle Development','','','Web '||CHR(38)||' Mobile Apps','Development Practices/Tips','Traditional Presentation','This presentation examines all of the most important development tools and technologies available from Oracle today, discussing the strong and weak points of each: Application Express (declarative development in web browser,  PL/SQL business logic, data-driven design); Application Development Framework (declarative development with JDeveloper, Java business logic, user interface driven design; Oracle Forms (the classical Oracle development tool, PL/SQL logic, data-driven design). The presentation is concluded with an overview and recommendation for how to choose the right tool and application development approach.','All Experience Levels','50 Minutes',5,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'APEX '||CHR(38)||' Database Development','14:10:00','15:00:00',50,'Hall 10A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Sten' AND LASTNAME ='Vesterli'));
INSERT INTO PRESENTATION VALUES(115,'The Top jQuery Plugins That Can be Used to Enhance APEX 5','Matt Mulvaney - Explorer','Matthew.Mulvaney@explorer.uk.com','APEX '||CHR(38)||' Database Development','APEX','Traditional Presentation','With the introduction of the great looking Universal theme, APEX applications have suddenly been brought in line in with the newest web development frameworks while still retaining the power and speed of Oracle application development found in older versions of APEX.  This presentation will discuss further improving the look and features of your application using some of our favourite jQuery plugins.  ','All Experience Levels','50 Minutes',3,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Systems','14:10:00','15:00:00',50,'Media Suite A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Craig' AND LASTNAME ='Sykes'));
INSERT INTO PRESENTATION VALUES(116,'Three Sides of the Coin with Oracle Data Integration','','','Big Data '||CHR(38)||' Data Warehousing','Data Integrator (ODI)','Traditional Presentation','This session is focused on the tight integration of Oracle Data Integrator 12c with Oracle GoldenGate 12c and Oracle Enterprise Data Quality 12c. It demonstrates how Oracle GoldenGate enables Oracle Data Integrator to leverage the power of real-time data integration. The session introduces how to set up and use Change Data Capture as well as Oracle Enterprise Data Quality jobs in Oracle Data Integrator. Attend the session to learn how easy and valuable it is to configure the three tools work together in the real world.','All Experience Levels','50 Minutes',3,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Big Data '||CHR(38)||' Data Warehousing','14:10:00','15:00:00',50,'Hall 11B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Maria' AND LASTNAME ='Gyurova'));
INSERT INTO PRESENTATION VALUES(117,'How Finance Can Leverage the Business Analytics Functionality within the Oracle Stack to Enhance Decision Making '||CHR(38)||' Strategy','','','Business Analytics','OBI (Foundation Suite/Enterprise Edition)','Case Study/Real Life Experience','The purpose of this session is to discuss the role business analytics plays within the finance department of a company. How can finance leverage the functionality available within the Oracle Stack to deliver their key management, statutory and regulatory reporting. How can Business Analytics play a key role in driving the decision making that takes place within the finance department in order to successfully grow the business also as being used to improve productivity and drive efficiencies across the group.','Experienced/Expert','30 Minutes',4,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Business Analytics 1','15:20:00','16:10:00',50,'Media Suite B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Michelle' AND LASTNAME ='Clarke'));
INSERT INTO PRESENTATION VALUES(118,'Auditing in Oracle Database 12c','Zoran Pavlovic - Parallel, ACE','z.m.pavlovic@gmail.com','Database','Compliance, Audit '||CHR(38)||' Security','Live Demo','Unified Auditing is a new security feature in Oracle Database 12c. Its purpose is to:     • Consolidate all audit trails into single unified audit trail   • Simplify audit configuration   • Increase security of audit trail   • Improve audit performance The aim of this presentation is to cover technical aspects of unified auditing and fine-grained auditing (FGA) in Oracle Database 12c    In this session you will learn how new audit architecture works and the following topics will be covered as well:     • Mixed auditing mode  • How to enable the unified auditing mode  • New audit roles   • Using Auditing in Multitenant environment  • Audit RMAN operations (for example: backup, restore and recover)  • Audit Oracle Data Pump operations (for example: export and import)  • Audit Oracle Database Vault violations   • Create audit policies to audit privileges, actions and roles under specified conditions  • How to disable and drop audit policies  • How to clean up audit data  • Using Fine-Grained Auditing','All Experience Levels','50 Minutes',2,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Database 2','15:30:00','16:20:00',50,'Hall 11A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Maja' AND LASTNAME ='Veselica'));
INSERT INTO PRESENTATION VALUES(119,'Do an Oracle Data Guard Switchover without Your Applications Even Knowing','','','Database','High Availability and Replication','Traditional Presentation','Oracle Data Guard provides a rapid and efficient means of database replication.  But even the short downtime period during a standby switchover can become a challenge as a maintenance window is planned, users notified, applications shut down and restarted, and verifications done.  But now with Oracle Database 12c Application Continuity, switchovers can be done transparently to applications, avoiding the need for application-level restarts.  The ability to do standby switchovers outside maintenance windows opens new possibilities for frequent disaster recovery testing, live data migration, and datacenter moves. And yes, it works for failovers too.  Learn how this technology works and see a live demo of a failover in action ','All Experience Levels','50 Minutes',2,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Database 4','15:30:00','16:20:00',50,'Hall 11B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Marc' AND LASTNAME ='Fielding'));
INSERT INTO PRESENTATION VALUES(120,'Enterprise Manager High Availability - The State of the Art','Jim Viscusi - Oracle','james.viscusi@oracle.com','Database','Oracle Enterprise Manager','Traditional Presentation','For several years Oracle has provided a solid solution to protect organisations against loss of service for their Enterprise Manager installations due to unplanned outages and component failures though the Maximum Availability Architecture. The solution architecture has been through several iterations and in this session we’ll discuss the latest designs for High Availability with Enterprise Manager. We’ll discuss the decisions that have to be made, assess the trade-offs between different solution designs. We’ll also discuss how to cope with monitoring during Enterprise Manager outages. The session will incorporate essential tips and tricks for the benefit of those implementing a highly available Enterprise Manager solution    ','All Experience Levels','50 Minutes',3,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Database 3','15:30:00','16:20:00',50,'Hall 10B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Andrew' AND LASTNAME ='Bulloch'));
INSERT INTO PRESENTATION VALUES(121,'Evolve Your Migration Strategy to Oracle 12c '||CHR(38)||' 12c New Features with Zero Downtime','Davinder Mundy - Oracle','davinder.mundy@oracle.com','Big Data '||CHR(38)||' Data Warehousing','Goldengate','Traditional Presentation','Eliminating database downtime poses a significant challenge for IT organizations that need to upgrade or migrate mission-critical database environments running older versions of Oracle to Oracle 12c, taking advantage of multitenant and in-memory features. This is particularly true for applications that must provide continuous or near-continuous operations to users who increasingly expect uninterrupted availability of online services. Any outage of an application or website has an impact on the revenue and reputation of the business.     Learn how organizations can upgrade or migrate from Oracle Database 8i, through Oracle Database 11g to Oracle Database 12c directly, without downtime. Using Oracle GoldenGate’s real-time data replication capabilities, businesses can perform rolling upgrades, keep transactions in sync across the databases, manage partial or phased migrations and upgrades, conduct post upgrade/migration data verification, and implement a reliable failback strategy. ','All Experience Levels','50 Minutes',3,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Big Data '||CHR(38)||' Data Warehousing','15:30:00','16:20:00',50,'Hall 6B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Zulfikar' AND LASTNAME ='Qureshi'));
INSERT INTO PRESENTATION VALUES(122,'Grid Infrastructure '||CHR(38)||' RAC Roundtable','Uwe Hesse - Oracle','Uwe.Hesse@oracle.com','Database','High Availability and Replication','Roundtable','Round table on the latest in technology for CLusterware, ASM, ACFS and RAC Database','All Experience Levels','50 Minutes',3,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Roundtables','15:30:00','16:20:00',50,'Hall 4 Foyer Level 5','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Joel' AND LASTNAME ='Goodman'));
INSERT INTO PRESENTATION VALUES(123,'Instrumenting, Analyzing, '||CHR(38)||' Tuning the Performance of Oracle ADF Applications','','','Web '||CHR(38)||' Mobile Apps','ADF','Traditional Presentation','In this session will be discussed and demonstrated how you can monitor the performance and resource related behavior of an ADF application by instrumentation. Instrumenting gives visibility and insight of what is happening inside the application. What ADF, SOA, Java, and database transactions are executed, when and how often? What is the health of the components of your system? What is the type/severity of errors? Are there memory, network and infrastructure problems or blockages? What is the end-user experience? This end-to-end visibility and insight is very effective in identifying and resolving performance and health problems quickly by DevOps teams. Learn how you can make instrumentation an integral part of your ADF development process.','Experienced/Expert','50 Minutes',1,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Web '||CHR(38)||' Mobile Apps','15:30:00','16:20:00',50,'Hall 6A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Frank' AND LASTNAME ='Houweling'));
INSERT INTO PRESENTATION VALUES(124,'Just Don''t Do It.','','','Database','Performance '||CHR(38)||' Internals','Traditional Presentation','The fastest way of performing a task is to avoid performing it at all - 2nd best is to reduce the number of times you perform the task. In this session I''ll examine a small number of recent examples of production code where careful analysis of the requirements showed how to re-engineer to avoid redundant work, allowing significant performance improvements.','All Experience Levels','50 Minutes',2,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Database 1','15:30:00','16:20:00',50,'Hall 9','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Jonathan' AND LASTNAME ='Lewis'));
INSERT INTO PRESENTATION VALUES(125,'Oracle Forms 12c - The Beginning of a New Day','Mia Urman  - AuraPlayer','miaurman@auraplayer.com','Web '||CHR(38)||' Mobile Apps','Forms','Traditional Presentation','It''s a new day for Oracle Forms and it''s time to wake up and smell the coffee. There''s no reason to reinvent the wheel, that''s already been done. Your Oracle Forms application is already powerful and has faithfully done its job for years.  But, could it be made even better? Using the latest features and using some of the added power offered by Oracle''s supporting Partners, your application can be better than it''s ever been before. Interested in mobilizing your Forms application? What if you could do it without changing a single line of Oracle Forms code?  Oracle Partner AuraPlayer''s, Mia Urman (CEO) will join me to explain how it can be done.  How about Oracle Public Cloud? Where does Oracle Forms fit into this space?  We''ll cover this topic too.','All Experience Levels','50 Minutes',3,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'APEX '||CHR(38)||' Database Development','15:30:00','16:20:00',50,'Hall 10A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Michael' AND LASTNAME ='Ferrante'));
INSERT INTO PRESENTATION VALUES(126,'Snapshots on Exadata','','','Engineered Systems','Exadata','Traditional Presentation','The ability to rapidly create snapshots - or thin clones - for non production databases has been missing on Exadata till the 12.1.0.2 releases. In this talk we give a brief introduction in the topic of provisioning snap clones, show how it works on Exadata systems and discuss why this feature is of huge value for the software development lifecycle of the kind of large scale systems typically deployed on Exadata.','All Experience Levels','30 Minutes',3,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Systems','15:30:00','16:20:00',50,'Executive Room 2','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Peter' AND LASTNAME ='Brink'));
INSERT INTO PRESENTATION VALUES(127,'Tips '||CHR(38)||' Tricks for Oracle SOA Suite from Oracle A-Team '||CHR(38)||' Engineering','Yogesh Sontakke - Oracle','yogesh.sontakke@oracle.com','Integration '||CHR(38)||' Collaboration','Integration','Traditional Presentation','Effectively implementing a service-oriented architecture and leveraging the Oracle service integration platform can be hugely effective for an enterprise, but involves many sophisticated components, including adapters, service bus, BPEL, monitoring, hybrid cloud environments, etc. At this session, hear tips, tricks, lessons learned and anti-patterns from the Oracle engineering team and the A-team, famous for helping customers worldwide use Service Integration patterns more effectively. Building on last year''s hugely popular presentation, this session will again provide a large number of backup slides for attendees to leverage on their current and future SOA projects, as well as an opportunity to learn from the teams that know more about making Oracle integration customers successful than any others in the world. Come prepared with your questions and challenges to share during the Q'||CHR(38)||'A section!','All Experience Levels','50 Minutes',2,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Integration '||CHR(38)||' Collaboration','15:30:00','16:20:00',50,'Executive Room 1','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Simone' AND LASTNAME ='Geib'));
INSERT INTO PRESENTATION VALUES(128,'What’s the Best Way to Solve Our Reporting Challenge? E-Business Suite Extensions for Endeca or OBI Apps?','','','Business Analytics','Analytic Applications (OBIA)','Case Study/Real Life Experience','With the end of life of Oracle Discoverer there’s a question around what should be the replacement.  E-Business Suite extensions for Endeca is embedded into EBS and has many cool features to make your users’ life easier. OBI Apps is a full suite that users a pre-built datamart and dashboarding capabilities ready to unleash the power of data for the decision making process.   Attend this session to answer these questions: how to compare these two reporting tools? how does licensing work? How the implementation plan looks like and how easy is to tailor it to your needs?  Lead by IT Convergence CTO and Oracle ACE Director, this session will help you to understand how Oracle E-Business Suite extension for Endeca and OBI Apps compared to Oracle Discoverer. What are the pros-cons and actually how you can start your Reporting strategy now.  It will also walk you through the high-level implementation steps for E-Business Suite extension for Endeca and OBI Apps requiring new hardware and setups within the applications.','All Experience Levels','50 Minutes',3,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Business Analytics 1','16:20:00','17:10:00',50,'Executive Room 8','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Gustavo' AND LASTNAME ='Gonzalez'));
INSERT INTO PRESENTATION VALUES(129,'Evolution of Performance Management: Oracle 12c Adaptive Optimization','','','Database','12c New Features','Traditional Presentation','On version 12c Oracle introduced new features to allow Adaptive optimizations: Adaptive Plans and Adaptive Statistics.  After a quick presentation of concepts, this session will explore the interaction of these features with other performance management techniques using examples, like SPM and SQL profiles.   Attendees will get an updated picture of tools available to troubleshoot performance issues, and how to get the most of these new features.','All Experience Levels','50 Minutes',2,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Database 4','16:30:00','17:20:00',50,'Hall 10A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Nelson' AND LASTNAME ='Calero'));
INSERT INTO PRESENTATION VALUES(130,'Experts Panel: What Does the Future Hold for Your Oracle Forms Systems? ','','','APEX '||CHR(38)||' Database Development','Forms','Panel Session','Hearing conflicting reports about the future of Oracle Forms? Are you on the fence between migrating existing applications or just leaving systems existing systems in maintenance mode and doing new development in a new technology? We hope to help users with the critical decision of how not to re-invent the wheel but also not get stuck in the stone ages. We will briefly discuss Oracle''s vision for the future of Oracle Forms including - can you squeeze a few more years out of your systems or do you need to migrate to a new technology. And even include a sneak peak of new feature coming soon in Forms 12c. We will hear various views from our panel experts including Stay in Forms, Migrate to APEX, Migrate to ADF, Build Hybrid environments etc... ','All Experience Levels','50 Minutes',4,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Roundtables','16:30:00','17:20:00',50,'Hall 4 Foyer Level 5','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Mia' AND LASTNAME ='Urman'));
INSERT INTO PRESENTATION VALUES(131,'Java '||CHR(38)||' SOA Cloud Service for the Middleware Administrator','','','Integration '||CHR(38)||' Collaboration','Cloud','Traditional Presentation','Oracle''s lower level PaaS services offer all the power and flexibility of Oracle software but run as a managed service in the Oracle Cloud. For example, Java Cloud Service runs WebLogic, Traffic Director and Coherence for you, whereas SOA Cloud Service is the equivalent for SOA Suite, Service Bus and API Manager.    Does this mean your job as a Fusion Middleware Administrator will disappear? No, far from it - you''ll be able to put your skills to far more valuable use! Instead of worrying about how much hardware you need, tracking down patches, or just keeping the systems running, with JCS and SOA CS your focus will be different: liaising with your development teams to deploy new versions of applications safely into production, shaking out and fixing performance issues, scheduling patching and planning for future growth while maintaining consistent service levels - all tasks of high value to your users.    In this session hear an administrator''s view of full Java Cloud Service (i.e. not just JCS SaaS Extension) and its, recently launched, sibling SOA Cloud Service. This presentation will also include a live "under the covers" demo of SOA CS, and discuss findings of a recent survey carried out amongst the presenter''s production administrator friends. Come along to find out how these Oracle Cloud Services can work for you!','All Experience Levels','50 Minutes',3,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Integration '||CHR(38)||' Collaboration','16:30:00','17:20:00',50,'','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Simon' AND LASTNAME ='Haslam'));
INSERT INTO PRESENTATION VALUES(132,'Me, Myself '||CHR(38)||' JavaScript','','','Web '||CHR(38)||' Mobile Apps','ADF','Traditional Presentation','Traditionally ADF application developers have kept away from decorating their applications with JavaScript and sadly on many occasions, even when they do use it can all go wrong.  So how can you successfully mix the power of ADF with the responsiveness of JavaScript?  As we move into the realm of richer and richer UIs with a demand for responsive user interfaces, this whole topic is gaining in importance, so it''s something you will need to know.  In this session, based on extensive experience within Oracle''s own development processes, I''ll be running through the dos and don''ts of ADF and JavaScript integration and passing on some of the key techniques and practices for a happy future. ADF and JavaScript can co-exist and here''s how...','Intermediate','50 Minutes',2,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Web '||CHR(38)||' Mobile Apps','16:30:00','17:20:00',50,'Hall 11B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Duncan' AND LASTNAME ='Mills'));
INSERT INTO PRESENTATION VALUES(133,'Oracle Data Integrator - Development Lifecycle '||CHR(38)||' Data Governance','','','Big Data '||CHR(38)||' Data Warehousing','Data Integrator (ODI)','Live Demo','Oracle Data Integrator 12c is a great ELT tool with the ability to work efficiently on different environments. It might be the traditional Development, Test and Production environments but there can be much more. After looking at the different architectures we will see what are the promotion mechanisms available in Oracle Data Integrator 12c and how we can keep track of the changes using the built-in versioning functionality or a third-party tool. We will also see how different development teams can work efficiently without impacting each other. The core part of this session will focus on the automation of the promotion and the versioning. You won''t waste any more time doing this manually!','Intermediate','50 Minutes',3,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Big Data '||CHR(38)||' Data Warehousing','16:30:00','17:20:00',50,'Hall 6B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Mark' AND LASTNAME ='Rittman'));
INSERT INTO PRESENTATION VALUES(134,'Oracle DataGuard Fast-Start Failover: Live Demo','','','Database','High Availability and Replication','Live Demo','This session will focus on real world implementation of Oracle DataGuard Fast-Start Failover with UK retail bank and why they chose DataGuard Fast-Start Failover to protect their mission critical databases. We will discuss the benefits of DataGuard Fast-start Failover and why it can be beneficial to your organization. We will also discuss what the requirements are to be implemented and some common pitfalls. With live demonstration this presentation will help you get better understanding on how DataGuard Fast-Start Failover works. ','All Experience Levels','50 Minutes',3,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Database 2','16:30:00','17:20:00',50,'Hall 11A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Svetoslav' AND LASTNAME ='Gyurov'));
INSERT INTO PRESENTATION VALUES(135,'Oracle Distributed Transactions','','','Database','Management and Administration','Traditional Presentation','This presentation examines remote and distributed queries and transactions over database links. The problem of multiple transaction branches involving RAC database instances are discussed followed by Oracle Single Phase and Two Phase commit processing over DB Links including: Prepare, Response to Prepare, Commit/Rollback and Forget phases. It is followed by a discussion of two phase commit in-doubt failures and resolution using the Recoverer Process (RECO) or DBA manual resolution. Finally, the implications of Point in Time Recovery on Distributed Databases is examined.','Intermediate','50 Minutes',2,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Database 1','16:30:00','17:20:00',50,'Hall 9','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Joel' AND LASTNAME ='Goodman'));
INSERT INTO PRESENTATION VALUES(136,'Oracle Exadata '||CHR(38)||' Database Memory','','','Engineered Systems','Exadata','Traditional Presentation','This session is an in-depth look into the memory usage of the Oracle database. Proper use of operating system memory facilities is key for performance on the Oracle Exadata platform, but not limited to that. At Enkitec we have seen a lot of incorrectly configured memory settings on both the operating system layer and the database, sometimes with drastic performance implications as a result. Understanding how the database manages memory becomes even more important with database consolidation, which is regularly seen on Exadata. The session details the memory settings of the operating system layer (Linux, as used on Exadata). It also explains the differences of the database private and shared memory areas, and the different memory models of the Oracle database (AMM, ASMM, manual). Everything is presented with clear method of diagnosis, which can be reused by the attendee.','Intermediate','50 Minutes',2,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Systems','16:30:00','17:20:00',50,'Executive Room 2','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Frits' AND LASTNAME ='Hoogland'));
INSERT INTO PRESENTATION VALUES(137,'The Great Leap Forward: Migrating to Universal Theme','','','APEX '||CHR(38)||' Database Development','APEX','Live Demo','Universal Theme in Application Express 5 includes several new features such as a responsive grid, improved accessibility, more capable and declarative template, and Theme Roller for easy customization. But what about your existing applications using older themes? How can you take advantage of these powerful, new capabilities without having to rewrite your user interface or having to start from scratch? In this session I will walk through the process of switching your application to the Universal Theme, starting from the Theme Switch wizard, customizing your navigation, explaining the new responsive grid layout for your regions and items, to using Theme Roller to customize the look and feel of your application so it fits in better with your company''s brand.','All Experience Levels','50 Minutes',3,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'APEX '||CHR(38)||' Database Development','16:30:00','17:20:00',50,'Hall 6A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Shakeeb' AND LASTNAME ='Rahman'));
INSERT INTO PRESENTATION VALUES(138,'Using Oracle NoSQL to Prioritise High Value Customers','','','Database','Big Data','Case Study/Real Life Experience','Oracle NoSQL makes a superb highly available, scalable engine for web transactions. In this use case we will show how Oracle NoSQL can be used as the engine to drive an online web site, with both session state management and shopping basket managed within NoSQL. We will also use it to drive a priority experience for high value customers, identifying them across multiple devices before they even login. Finally we will show the integration with the Oracle database and how web click information from NoSQL can then be used from within the oracle database.','Intermediate','50 Minutes',2,'Tuesday 8th December 2015',TO_DATE('08/12/2015','DD/MM/YYYY'),'Database 3','16:30:00','17:20:00',50,'Hall 10B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='James' AND LASTNAME ='Anthony'));
INSERT INTO PRESENTATION VALUES(139,'A Primer on Web Components in APEX','','','APEX '||CHR(38)||' Database Development','APEX','Traditional Presentation','Web components are the next big thing in web development. You can think of Web Components as reusable user interface widgets that are created using open Web technology. They are part of the browser and so they do not need external libraries like jQuery. This presentation will go over the concepts of Web Components with a lot of demos and integration points in APEX. ','All Experience Levels','50 Minutes',3,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'APEX '||CHR(38)||' Database Development','09:00:00','09:50:00',50,'Hall 11B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Dimitri' AND LASTNAME ='Gielis'));
INSERT INTO PRESENTATION VALUES(140,'Best Practices for Virtualizing Oracle Database','','','Virtualisation','Virtualisation','Traditional Presentation','According to a recent IOUG survey, over 65% of Oracle customers today are virtualizing their mission-critical Oracle databases. This session reviews key best practices learned from EMC and VMware to maximize Oracle database performance, simplify provisioning and provide comprehensive data protection, including describing 2 independent studies performed by Principled Technologies for deploying Oracle DBaaS. This session also covers important topics such as Oracle Support and Licensing Considerations when running VMware.','All Experience Levels','50 Minutes',3,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Systems 1','09:00:00','09:50:00',50,'Hall 10A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Peter' AND LASTNAME ='Herdman-Grant'));
INSERT INTO PRESENTATION VALUES(141,'HA for Single Instance Databases without Breaking the Bank','','','Database','Agenda Theme - Embrace','Traditional Presentation','Oracle has long supported active/passive or cold failover clusters - indeed Oracle clusterware excels in this area. This presentation will show how to use clusterware to provide HA for single instance databases without falling foul of licensing restrictions. It will also show how to integrate cold-failover targets into Enterprise Manager and list some common pitfalls of a non-traditional setup such as this.  ','Intermediate','50 Minutes',2,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Database 2','09:00:00','09:50:00',50,'Hall 11A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Niall' AND LASTNAME ='Litchfield'));
INSERT INTO PRESENTATION VALUES(142,'Maximising ROI in Oracle E-Business Suite by Utilising Metric-Driven Data Analytics','Reggie Kelley - PwC','reggie.kelley@uk.pwc.com','Business Analytics','Agenda Theme - Embrace','Traditional Presentation','Organisations that run Oracle often struggle to understand how efficient and standardised their processes are across their various business units, where they can reduce operating costs and how they can effectively manage risks.         This submission will discuss how organisations can overcome challenges of performance, compliance and risks by helping them efficiently run their Oracle E-Business Suite system.  By providing deeper, quicker, relevant and actionable insight into business processes, events and risks, an organisation is able to improve business performance, ensure efficient compliance and reduce risks to business.          Optimised Oracle EBS process performance is a factor of three key components:        Processes: The way in which processes have been designed, implemented and are monitored after go- live impacts process standardisation, control and efficiency.        People: The way in which users interface with Oracle and operate Oracle processes highlights many of the root causes of poor process performance/consistency.        Technology: The configuration of the system influences what people can do within Oracle and what they can see. The challenge is to maximise the use of Oracle technology and functionality to automate processes, therefore making people more efficient and effective.        We will talk about how using a metric-driven (KPI) analytics and monitoring approach can help organisations optimise the above three components. The methodology relies on extracting and analysing transaction, configuration and usage data against a standard set of KPIs. The outputs are then analysed to uncover root causes for process inefficiencies, control gaps and data quality issues.        The benefits this approach can bring include:    • Efficient and standardised processes operating across an organisation;    • Identification of opportunities to improve the use of Oracle within specific business functions, ultimately reducing costs;    • Improving the quality of data processed within the Oracle system;    • Improving and optimising controls across key business processes;     • Providing the ability to demonstrate efficiency and control environment improvement over time; and    • Benchmarking Oracle usage across the organisation, as well as against other industry peers running Oracle.','Intermediate','50 Minutes',4,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Business Analytics 2','09:00:00','09:50:00',50,'Hall 7A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Gautam' AND LASTNAME ='Prakash'));
INSERT INTO PRESENTATION VALUES(143,'Migrate to the Cloud with Logical Replication Tools','','','Database','Integration','Traditional Presentation','Learn how to migrate your Oracle database to the Cloud with little or no downtime.  Avoid the traditional methods of migration an embrace what logical replication tools can do for you.  We will discuss the differences between physical and logical replication.  We will the discuss the many different logical replication tools such as Streams, Oracle GoldenGate, Shareplex and Dbvisit.    As we go through step by step how a migration is done we will delve into the exact methods to get into the cloud.    We will finish up with some pitfalls and how to avoid them.  ','All Experience Levels','50 Minutes',3,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Database 3','09:00:00','09:50:00',50,'Hall 10B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Chris' AND LASTNAME ='Lawless'));
INSERT INTO PRESENTATION VALUES(144,'Oracle Analytics '||CHR(38)||' Big Data: Unleash the Value','','','Big Data '||CHR(38)||' Data Warehousing','Big Data','Traditional Presentation','Big data is all the rage in a world of ever-changing opinions, tweets, and behaviors. Organizations around the globe are attempting to capture and corral data as best they can, but few know what to do next. It’s like the dog chasing the car: what happens if he catches it? What matters is the value and insight your data reveals. Discover patterns and relationships you never knew existed. Predict future behaviour and events before they happen. Leverage fact-based knowledge to drive better decisions. Come to this session to listen to real-world examples of organizations realizing true value and results. Big data isn’t about the data; it’s about the value you glean from it. It’s about better and faster decisions you can now make to gain that competitive edge.   ','Beginner/Exploratory','50 Minutes',5,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Business Analytics 1','09:00:00','09:50:00',50,'Executive Room 7','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Lisa' AND LASTNAME ='Dearnley-Davison'));
INSERT INTO PRESENTATION VALUES(145,'Oracle IAM Overview for Beginners : Everything You Must Know to Start Your Oracle IAM Journey','Neha Mittal - K21 Technologies','neha.mittal@k21technologies.com','Web '||CHR(38)||' Mobile Apps','Identity Management','Masterclass','Are you confused about so many products in Oracle IAM portfolio like OAM, OIM, OID, OVD, OUD, OAAM, OIF, eSSO, OMSS, OES, OIA, OPAM and list goes on ? Do you come across complimenting functionality with-in Oracle IAM products and confused which one to pick when and Why ? Come and have best of your 50 minute in 3 days and to kickstart your Oracle IAM journey. We will start with overview of all 20+ products that are part of Oracle IAM suite. We''ll cover background of these products and role of each product in Oracle IAM. We''ll also cover common deployments in which these products are used and how you and your team and learn quickly to start implementing/managing these . I''ll share my person tips on how we do rapid implementation (weeks) for some of these products and common implementations customer''s ask for Oracle IAM products.','Intermediate','50 Minutes',3,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Integration '||CHR(38)||' Collaboration','09:00:00','09:50:00',50,'Hall 6A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Atul' AND LASTNAME ='Kumar'));
INSERT INTO PRESENTATION VALUES(146,'Oracle Licensing Roundtable','','','Integration '||CHR(38)||' Collaboration','Licensing','Roundtable','This is question and answer chat with Oracle users and License experts.     Please come along and share your questions and best practice.    Submit questions on Twitter @pbainbri #Tech15 #LicecneRT','Intermediate','50 Minutes',3,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Roundtables','09:00:00','09:50:00',50,'Hall 4 Foyer Level 5','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Paul' AND LASTNAME ='Bainbridge'));
INSERT INTO PRESENTATION VALUES(147,'Oracle WebCenter '||CHR(38)||' ADF – The Digital Transformation of Oracle Forms Applications','','','Web '||CHR(38)||' Mobile Apps','ADF','Traditional Presentation','More and more companies are adopting Oracle WebCenter '||CHR(38)||' ADF as they look to modernise their legacy enterprise Oracle Forms applications. This presentation will outline the rationale for such a strategy and illustrate how companies are evolving their Oracle Forms applications with the aid of Oracle ADF.    We will share experiences from a number of companies with Forms solutions that are typically 15-20 years old with 100s if not 1000s of Forms in their applications. The session will illustrate how organisations are adopting a multi-year and multi-phase approach to the modernisation leveraging the interoperability of Forms and ADF.     We will consider the issues in refactoring PL/SQL code for use within a WebCenter  application and how well ADF data visualisations cope with replicating the complex and rich functionality found in mature Forms Applications, moreover, we will then show how these UXs can be extended to tablets and mobiles using the underlying ADF framework.   ','All Experience Levels','50 Minutes',4,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Web '||CHR(38)||' Mobile Apps','09:00:00','09:50:00',50,'Media Suite B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Mark' AND LASTNAME ='Waite'));
INSERT INTO PRESENTATION VALUES(148,'Real Business Value from Big Data '||CHR(38)||' Advanced Analytics','','','Big Data '||CHR(38)||' Data Warehousing','Data Science','Live Demo','When attending this session, delegates will learn about real case studies where Big Data and Advanced Analytics can deliver significant return-on-investment to a variety of Oracle customers. These are solutions that can pay for themselves within 1 year. Customer case studies include:   - Predicting Employees likely to leave within the next 12 months   - Predictive which sales outlets are likely to suffer from out-of-stock products   - Predicting which Students are likely to withdraw early from their courses.    A live demonstration will describe for you the high-level process for implementing Predictive BI and its best-practices.','All Experience Levels','50 Minutes',3,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Big Data '||CHR(38)||' Data Warehousing','09:00:00','09:50:00',50,'Hall 6B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Antony' AND LASTNAME ='Heljula'));
INSERT INTO PRESENTATION VALUES(149,'SQL Magic - Tricks to Demonstrate SQL Features You''ve Probably Never Used','','','Database','SQL and PL/SQL','Live Demo','In this fun session you’ll see SQL versions of classic magic tricks. These include the cup and balls trick, where rows inserted into one table magically reappear in another, a card trick where a randomly selected “card” (row) from a “deck” (table) floats to the top of the deck and the magically changing row trick where the value returned by a query changes just by issuing a select statement!    Unlike real magicians however, I’ll show you how the tricks are done. This will enable you to perform your own SQL “magic” and apply these principles when building Oracle database applications.    This session is intended for developers, DBAs and data modelers looking to expand their SQL skills, highlighting features that are new to 12c as well as little used existing options.    The magically changing row trick demonstrates how you can use a new 12c feature, temporal validity, to control which rows are returned by a query using the DBMS_FLASHBACK_ARCHIVE package.     The cup and balls trick uses different views over one table to restrict which rows are visible. It then goes on to discuss how the “disappearing” rows are simply a side effect inserting rows that don’t match the where clause for the view. The trick finishes by showing how to prevent this by adding the “with check option” to views.     The card trick exploits the ordered nature of index-organized tables to make a card chosen at random “float” to the top of the deck. This enables it to appear when issuing a “where rownum = 1” query. It does this by setting an invisible column which forms part of the primary key to a new value, ensuring that this appears first.','Intermediate','30 Minutes',3,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Database 1','09:00:00','09:50:00',50,'Hall 9','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Chris' AND LASTNAME ='Saxon'));
INSERT INTO PRESENTATION VALUES(150,'Using the Oracle Database Appliance Manager','','','Engineered Systems','Oracle Database Appliance','Hands on Lab','<Font color=red><B>You will require a laptop or tablet that can connect to a wireless network and VNC Viewer software.  It will work best if the tablet has an external keyboard.</font></b>    You may have heard how the Oracle Database Appliance automates the deployment, provisioning, and maintenance of highly available database and application environments.  How would you like to see first hand yourself on how the Oracle Database Appliance Manager works?  Join this hands on session, with your laptop and VNC to see how the database appliance manager has integrated the manual steps to quickly deploy databases and applications.','All Experience Levels','1hr 50mins - Masterclass or Hands on Lab',3,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Systems 2','09:00:00','10:50:00',110,'Media Suite A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Tammy' AND LASTNAME ='Bednar'));
INSERT INTO PRESENTATION VALUES(151,'An Post - BA, Big Data '||CHR(38)||' Cloud Journey','','','Business Analytics','Big Data','Case Study/Real Life Experience','We will outline how An Post have progressed from their initial BA (OBI, Essbase, Financial Planning) projects to a "Big Data - Data Warehouse", with:  Advanced Analytics, Oracle 12c Multitenant DB, Exadata and of course DIS (ODI, Goldengate), We will cover the business value attained by An Post from this journey.','All Experience Levels','50 Minutes',3,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Business Analytics 1','10:00:00','10:50:00',50,'Executive Room 8','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Tony' AND LASTNAME ='Cassidy'));
INSERT INTO PRESENTATION VALUES(152,'Database Password Security','','','Database','Compliance, Audit '||CHR(38)||' Security','Traditional Presentation','In this session we will explore all of the ideas and issues related to database passwords and their security. We will include a look at the current algorithms and how they work and also their strengths and weaknesses of each.     We will also look at how to enable the strongest algorithms without hanging onto the weakest and why that is an issue. The talk then goes on to discuss designing strong passwords and implementing rules (profiles) to enforce those.     The presentation will include demonstrations and finally a discussion on password safe software that is available','All Experience Levels','50 Minutes',2,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Database 2','10:00:00','10:50:00',50,'Hall 11A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Pete' AND LASTNAME ='Finnigan'));
INSERT INTO PRESENTATION VALUES(153,'Introduction to R, for Big Data Analysis - Part 1','','','Big Data '||CHR(38)||' Data Warehousing','Big Data','Hands on Lab','  More and more companies are implementing big data solutions, many with the prospect of someday doing something with the data that is being collected. In this hands-on session we''ll get down to brass tacks. Beginning with the setup of core tools and a run through of the R language, and get familiar with Oracle R offerings. Begin manipulating data in R and derive useful statistics from sample data. Go over where this data can be sourced and how results can be displayed into useful graphs. A great way for beginners to R to get a jump start.','Beginner/Exploratory','1hr 50mins - Masterclass or Hands on Lab',1,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Big Data '||CHR(38)||' Data Warehousing','10:00:00','10:50:00',50,'Hall 6B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Harold' AND LASTNAME ='Dost'));
INSERT INTO PRESENTATION VALUES(154,'Mobile Strategy Open Forum ','Martin  Cookson - Oracle','martin.cookson@oracle.com','Web '||CHR(38)||' Mobile Apps','Mobile','Roundtable','Mobile isn''t simply an alternative delivery channel for your business applications.  It fundamentally impacts how businesses run and compete.  Whilst mobile devices offer up new opportunities, they also bring their own challenges around security, development skills, governance and backend integration to name only a few.  Are you prepared for mobile?  Have you even though about mobile? Are you even asking "why mobile?". At this open session you''ll have the chance for an open discussion with others who are asking the same questions and you''ll have a chance to put your questions to a range of mobile experts on any aspects of mobile development ensuring you get the right answers to make an informed decision for your business','All Experience Levels','50 Minutes',3,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Roundtables','10:00:00','10:50:00',50,'Hall 4 Foyer Level 5','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Grant' AND LASTNAME ='Ronald'));
INSERT INTO PRESENTATION VALUES(155,'Monitoring Oracle Business Intelligence '||CHR(38)||' Oracle Essbase Made Simple Using Enterprise Manager Cloud Control','','','Business Analytics','Oracle Enterprise Manager','Traditional Presentation','Join this session to...    1) How to integrate Oracle BI and Essbase with Enterprise Manager Cloud Control..   2) Overview of Oracle Business Intelligence Targets You Can Monitor   3) Discovering Oracle Business Intelligence Instance and Oracle Essbase Targets   4) Monitoring Oracle Business Intelligence Instance and Essbase Targets   5) Administering Oracle Business Intelligence Instance and Essbase Targets Optimally   6) Implement Metrics for efficient monitoring.','All Experience Levels','50 Minutes',3,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Business Analytics 2','10:00:00','10:50:00',50,'Executive Room 7','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Dhananjay' AND LASTNAME ='Papde'));
INSERT INTO PRESENTATION VALUES(156,'Oracle 12c New Features - The Lesser Spotted Variety ','','','Database','SQL and PL/SQL','Traditional Presentation','Oracle12c comes with a raft of new features. This presentation covers some of the less well known that the author has encountered during testing and development. Examples of topics that will be covered are approximate functions, LATERAL joins, APPLY functions, subqueries within top-n queries, adaptive joins, enhanced outer joins, procedural roles, valid time support, data pump improvements and WITH clause enhancements.','All Experience Levels','50 Minutes',2,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Database 3','10:00:00','10:50:00',50,'Hall 9','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Carl' AND LASTNAME ='Dudley'));
INSERT INTO PRESENTATION VALUES(157,'Oracle Application Express 5.1 New Features','','','APEX '||CHR(38)||' Database Development','APEX','Live Demo','Released in April 2015, Oracle Application Express (APEX) 5.0 represented the greatest advancement of APEX in its 10 year history, enabling customers to develop, design and deploy beautiful, responsive, database-driven desktop and mobile applications using only a browser. APEX 5.1 will build on the success of 5.0, introducing a small number of new features, and enhancements to existing functionality, and is currently planned to incorporate a new multi-row edit region, master / detail / detail wizard built pages, and improved packaged applications. In this session you will see demonstrations of the important new features of APEX 5.1. ','All Experience Levels','50 Minutes',3,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'APEX '||CHR(38)||' Database Development','10:00:00','10:50:00',50,'Hall 11B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Anthony' AND LASTNAME ='Rayner'));
INSERT INTO PRESENTATION VALUES(158,'Oracle Application Performance Monitoring Cloud Service: Visibility from Browser to Back-end','Pete Sharman - Oracle','pete.sharman@oracle.com','Web '||CHR(38)||' Mobile Apps','Cloud','Live Demo','The Oracle Application Performance Monitoring Cloud Service is a software-as-a-service (SaaS)-based solution that provides deep visibility into the performance of your WebLogic and Java EE applications from the end user''s browser, across web service and database calls, to application logs. In this session, see how to use Oracle Application Performance Monitoring Cloud Service to isolate problems before they impact your business. Break down the barriers between development and operations and give DevOps the data to solve problems faster and to deliver better applications.','All Experience Levels','50 Minutes',2,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Systems 1','10:00:00','10:50:00',50,'Media Suite B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='James' AND LASTNAME ='Kao'));
INSERT INTO PRESENTATION VALUES(159,'Pluggable Databases : What They Will Break '||CHR(38)||' Why You Should Use Them Anyway!','','','Database','12c Upgrades '||CHR(38)||' Migrations','Traditional Presentation','The multitenant architecture was "the" headline feature announced in Oracle Database 12c. On the surface pluggable databases sounds great, but are they really? This presentation will explain the parts of your systems that will break if you move to pluggable databases, but why you should probably use them anyway.','Intermediate','50 Minutes',3,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Database 1','10:00:00','10:50:00',50,'Hall 10B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Tim' AND LASTNAME ='Hall'));
INSERT INTO PRESENTATION VALUES(160,'Why Identity is More Important Than Ever Before','','','Web '||CHR(38)||' Mobile Apps','Identity Management','Traditional Presentation','As we see traditional markets change and evolve, transforming into a Digital Business is well underway for many organizations. However, security remains the key concern of many executives, with Identity Management being firmly embedded in those discussions. Having a strong Identity Management strategy that can incorporate your on-premise enterprise applications as well as your Cloud services, whilst delivering the foundations required for a great customer experience such as a seamless cross-channel experience is critical during this time of transformation. In this session you will discover how Oracle Identity Management enables you to manage all of your Identities whilst providing the capabilities required to meet this rapidly evolving market, whether on-prem, in the Cloud, or more commonly, across both. You will hear what Oracle is doing to innovate with its on-premise software as well as within its up and coming Identity Cloud Service.','All Experience Levels','30 Minutes',4,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Integration '||CHR(38)||' Collaboration','10:00:00','10:50:00',50,'Hall 10A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Paul' AND LASTNAME ='Toal'));
INSERT INTO PRESENTATION VALUES(161,'10 Real-World Customer Configurations on the Oracle Database Appliance','','','Engineered Systems','Oracle Database Appliance','Case Study/Real Life Experience','The Oracle Database Appliance is a powerful machine yet its name hides its versatility. Certainly it provides a great place to run Oracle databases but, given that it runs virtualisation, it also offers much more for the Oracle-centric platform builder. This session presents 10 different real-world customer implementations: from various database configurations, to middleware infrastructures such as WebLogic and SOA Suite, through to application deployments like JDE. For each example the approach chosen is discussed, as well as lessons learned, to provide the audience with a clear path to move forward with the Oracle Database Appliance. Note: Oracle OpenWorld 2015 presentation','All Experience Levels','50 Minutes',4,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Systems 2','11:20:00','12:10:00',50,'Media Suite A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Simon' AND LASTNAME ='Haslam'));
INSERT INTO PRESENTATION VALUES(162,'Best of RMAN: Selected Features From Four Releases','','','Database','Management and Administration','Traditional Presentation','RMAN got new features with every release, but often it is still used like in 8i. Here I will show '||CHR(38)||' explain some of the most remarkable enhancements:  Block corruption detection '||CHR(38)||' recovery (9i)  The recommended backup strategy with image copies and merged incremental backups (10g)  Multisection backups (11g)  Duplicate from active database with compressed backupsets (12c)  Table Point In Time Recovery (12c)    Everything will be demonstrated live with additional explanations presented on slides    An Oracle DBA who is responsible for B '||CHR(38)||' R will most likely benefit from the shown topics.','All Experience Levels','50 Minutes',2,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Database 1','11:20:00','12:10:00',50,'Hall 11A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Uwe' AND LASTNAME ='Hesse'));
INSERT INTO PRESENTATION VALUES(163,'Connecting Oracle '||CHR(38)||' Hadoop','','','Database','Big Data','Masterclass','In this masterclass we will explore the many options for moving data between Oracle and Hadoop-world, querying Hadoop data in Oracle and vice versa. Keywords: Hive/Impala, sqoop, incremental extract, HDFS replication. This session is intended for Oracle professionals who are Hadoop-beginners and gives you a quick overview of how Hadoop-based SQL engines are different from traditional RDBMS and how to get data in/out of Hadoop.','All Experience Levels','1hr 50mins - Masterclass or Hands on Lab',3,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Database 3','11:20:00','12:10:00',50,'Hall 9','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Tanel' AND LASTNAME ='Poder'));
INSERT INTO PRESENTATION VALUES(164,'Customer Presentation: ACCA Champions Excellence with Real-time Reporting Tool for Business Users','Paul Slowey - ACCA','Paul.slowey@accaglobal.com','Business Analytics','Reporting '||CHR(38)||' BI Publisher','Traditional Presentation','The Association of Chartered Certified Accountants (ACCA) is no stranger to the importance of data integrity. But as an Oracle EBS user, their mix of SQL Developer extracts and restrictive reporting with GL Wand were not enabling them to fully live up to their high standard of excellence. Finance had to rely on the Systems Accountant and IT for highly customised reports that were making month end and quarter end reporting a challenge.  Attend this session and hear how insightunlimited champion, Paul Slowey, implemented a real-time, end user reporting tool that worked directly with their ERP. Now the whole finance team can perform ad hoc inquires or run reports in seconds over any data within Oracle. This means data is always accurate, always timely, and most importantly, always relevant!','All Experience Levels','50 Minutes',3,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Business Analytics 2','11:20:00','12:10:00',50,'Executive Room 7','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Julie' AND LASTNAME ='Bowen'));
INSERT INTO PRESENTATION VALUES(165,'Introduction to R, for Big Data Analysis - Part 2','','','Big Data '||CHR(38)||' Data Warehousing','Big Data','Hands on Lab','More and more companies are implementing big data solutions, many with the prospect of someday doing something with the data that is being collected. In this hands-on session we''ll get down to brass tacks. Beginning with the setup of core tools and a run through of the R language, and get familiar with Oracle R offerings. Begin manipulating data in R and derive useful statistics from sample data. Go over where this data can be sourced and how results can be displayed into useful graphs. A great way for beginners to R to get a jump start.  ','Beginner/Exploratory','1hr 50mins - Masterclass or Hands on Lab',1,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Big Data '||CHR(38)||' Data Warehousing','11:20:00','12:10:00',50,'Hall 6B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Harold' AND LASTNAME ='Dost'));
INSERT INTO PRESENTATION VALUES(166,'Managing Personal Test Databases with Tools like Virtualbox '||CHR(38)||' Vagrant','','','Virtualisation','Virtualisation','Traditional Presentation','Learn how you can scrap your old database and have a new clean test database on your laptop in matter of minutes. Using tools like VirtualBox and Vagrant, managing your personal test databases becomes an easy and quick task. You want an additional database? Just copy your configuration files, change 2-3 settings (port, ip-adresse, name of the new node etc) and buckle up. What about developers and automatic deployment? Sure. Our developers use these tools togheter with deployement tools like FlywayDB, Jenkins '||CHR(38)||' Git. ','All Experience Levels','50 Minutes',3,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Systems 1','11:20:00','12:10:00',50,'Media Suite B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Lasse' AND LASTNAME ='Jenssen'));
INSERT INTO PRESENTATION VALUES(167,'Oracle WebLogic Server Strategy '||CHR(38)||' Roadmap','','','Web '||CHR(38)||' Mobile Apps','WebLogic '||CHR(38)||' CAF','Traditional Presentation','This session will summarize the WebLogic Server product and investment strategy in areas such as cloud and mobile computing, application development, manageability, and engineered systems. We will review new features available in WebLogic Server 12.2.1, including Java EE 7 support, multi-tenancy capabilities, built-in elasticity, a REST-based management infrastructure, disaster recovery improvements, and more. If you want learn how to leverage Weblogic Server today and in the future, come to this session!','All Experience Levels','50 Minutes',3,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Integration '||CHR(38)||' Collaboration','11:20:00','12:10:00',50,'Hall 10A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Frances' AND LASTNAME ='Zhao-Perez'));
INSERT INTO PRESENTATION VALUES(168,'Secure Oracle ADF Applications with Oracle Entitlements Server','Ganesh Kamble - K21 Technologies','ganesh.kamble@k21technologies.com','Web '||CHR(38)||' Mobile Apps','Identity Management','Traditional Presentation','This session gives the insights of how you can use Oracle Entitlements Server (OES) and Oracle Internet Directory (OID) to manage the security of Oracle Application Development Framework (ADF) applications. Externalising the security of applications is one of the key requirements of organizations these days as it gets very difficult to manage the security as the size of the application grows. ADF application leverages Oracle Entitlements Server to manage access policies at a fine-grained level. This presentation gives you the best in the market solution to reduce the time spent in managing the security during the development phase as the application does not need to be changed if there are any changes in the access rights of users.','All Experience Levels','50 Minutes',3,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Web '||CHR(38)||' Mobile Apps','11:20:00','12:10:00',50,'Hall 6A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Atul' AND LASTNAME ='Kumar'));
INSERT INTO PRESENTATION VALUES(169,'The Database Maturity Model - Where Do You Rank?','','','APEX '||CHR(38)||' Database Development','Development Practices/Tips','Case Study/Real Life Experience','I work in a dedicated Oracle performance tuning team at a large bank in London. We see a lot of databases both good and bad and needed a way to rapidly evaluate what we are dealing with when called in to investigate problems and recommend the right solutions. Step forward the Database Maturity Model and accompanying SQL*Plus HTML report… In this session, I will present the Database Maturity Model. It takes its inspiration from other long-standing Maturity Models like the Capability Maturity Model and provides a quick, visual (and dare I say entertaining) way to rank general database design and use. Database Maturity is ranked through five levels (Baseline to Optimised) on an axis of a low (or ‘gauche’) maturity through to a high (or ‘urbane’) maturity…     Step forward the Database Maturity Model and accompanying SQL*Plus HTML report…    In this session, I will present the Database Maturity Model.  It takes its inspiration from other long-standing Maturity Models like the Capability Maturity Model and provides a quick, visual (and dare I say entertaining) way to rank general database design and use.  Database Maturity is ranked through five levels (Baseline to Optimised) on an axis of a low (or ‘gauche’) maturity through to a high (or ‘urbane’) maturity…    To help inform this ranking, we have also developed a simple companion SQL*Plus script that gathers together information on the underlying data model, the types of objects used (or not) as well as general database feature adoption.  This data is output in a friendly HTML format by the SQL*Plus script.  This can be easily navigated and emailed around to the many interested parties.    I will present a copy of the report that will contain examples of the typical issues we see.    As for the top three things that the audience will take away:    1. A copy of the SQL*Plus HTML report they can run back at base! (I’ll provide a link they will need to download the report)    2. A model and idea that can be adapted and used by attendees in their own organisations – fundamentally we see it as a way to spread good database practice – we hope you do too    3. Some humorous, technical, yet educational anecdotes on what the report has found on previous systems.    Will you be a mature and urbane or gauche and immature database user?  ','All Experience Levels','30 Minutes',2,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'APEX '||CHR(38)||' Database Development','11:20:00','12:10:00',50,'Hall 11B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Ben' AND LASTNAME ='Weber'));
INSERT INTO PRESENTATION VALUES(170,'Tips '||CHR(38)||' Technniques for Oracle Big Data Discovery','','','Big Data '||CHR(38)||' Data Warehousing','Big Data Discovery','Traditional Presentation','Oracle Big Data Discovery is a new tool from Oracle to catalog, explore and visualize data in your Hadoop '||CHR(38)||' NoSQL data reservoir. Built on Endeca technology but with the ability to load and process Hadoop data directly on the cluster using Apache Spark, Big Data Discovery complements Oracle Business Intelligence by providing a data discovery and faceted search tool for the data reservoir.    In this session, we''ll look at tips, techniques and approaches we have taken on successful Big Data Discovery projects, including techniques for refreshing data samples,  data transformation tips and and approach for successful data visualizations across multiple datasets. We''ll also share what we feel are the key use-cases for Big Data Discovery, and where it fits into the big data project lifecycle.','Beginner/Exploratory','50 Minutes',3,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Business Analytics 1','11:20:00','12:10:00',50,'Executive Room 9','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Mark' AND LASTNAME ='Rittman'));
INSERT INTO PRESENTATION VALUES(171,'Universal Theme Roundtable','','','APEX '||CHR(38)||' Database Development','APEX','Roundtable','Universal Theme is a responsive, versatile and customizable user interface for your APEX apps and enables developers to build world-class applications without becoming experts in HTML, CSS or JavaScript. Join Shakeeb Rahman, the lead developer of Universal Theme, in this roundtable to discuss all things about this new UI. We can cover anything from key features, best practices, practical approaches, responsive design, and so much more. ','All Experience Levels','50 Minutes',3,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Roundtables','11:20:00','12:10:00',50,'Hall 4 Foyer Level 5','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Shakeeb' AND LASTNAME ='Rahman'));
INSERT INTO PRESENTATION VALUES(172,'12c Upgrades: Live!','','','Database','12c Upgrades '||CHR(38)||' Migrations','Live Demo','This will feature a live demo of upgrading a database from 11gR2 to 12c. It will also feature a discussion of the various methods for upgrading or migrating to 12c.    The presentation will discuss the merits of various approaches of getting your database to 12c and attendees will learn issues to watch out for in the upgrade process.','All Experience Levels','50 Minutes',3,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Database 2','13:10:00','14:00:00',50,'Hall 11A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Jason' AND LASTNAME ='Arneil'));
INSERT INTO PRESENTATION VALUES(173,'Accelerate High Quality Development with Data Virtualisation','','','Integration '||CHR(38)||' Collaboration','Testing','Traditional Presentation','Development teams are under constant pressure to accelerate their development cycle while improving the quality of each release. Delivering on this expectation whilst containing cost is a major challenge. One of the biggest obstacles is to get quality Test Data quickly in sufficient size and realistic representation of production data, without taking days or weeks or spending a fortune on storage and possibly exposing copies of sensitive production data to less secure environments.    This session will review the challenges of test data provision and the impact to time, quality, security and cost that are typically associated. It will then introduce how modern platforms like Actifio can address each of those challenges. This technology enables developers self-service access to test data as a space-efficient virtual copy of production data, optionally with sensitive data masked. Use cases will be reviewed to demonstrate the value in every stage of the development process from the earliest sandbox environment through QA, including final staging to pre-production. Real-world examples of common development cycles will be reviewed to examine the dramatic impact that Data Virtualisation can have.    If you are interested in faster and more economic access to high-quality test data to facilitate development, testing, and training processes, join this session.    ','All Experience Levels','50 Minutes',3,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Database 3','13:10:00','14:00:00',50,'Hall 10B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Mike' AND LASTNAME ='Salins'));
INSERT INTO PRESENTATION VALUES(174,'APEX Customer Story - HR Rostering System','','','APEX '||CHR(38)||' Database Development','APEX','Case Study/Real Life Experience','This customer story will show how Inoapps and Technip developed a web-based Crew Management System using Oracle Application Express (APEX), integrated with Oracle e-Business Suite and Oracle Access Manager. Technip required a solution to provide a scheduling and tracking tool to help the business schedule and manage their fleet of vessel resources to the available crew members. Find out how Inoapps and Technip delivered an APEX application which ultimately changed a lot of spreadsheets into an automated system that provide employees with access to: a real-time single source of data; intuitive, flexible tools to administer the data; and a suite of customisable reports.','All Experience Levels','50 Minutes',3,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'APEX '||CHR(38)||' Database Development','13:10:00','14:00:00',50,'Hall 11B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Drew' AND LASTNAME ='Edgar'));
INSERT INTO PRESENTATION VALUES(175,'Data Warehousing with Hadoop '||CHR(38)||' Integration with OBIEE 11g Leveraging Oracle Big Data Discovery (BDD) '||CHR(38)||' Big Data SQL','','','Big Data '||CHR(38)||' Data Warehousing','Hadoop','Case Study/Real Life Experience','Increasing interest in using Hadoop for data management, transformation, and analysis had led to significant development efforts by companies to enhance and extend Hadoop framework and offer a range of different Hadoop solutions. Many of these solutions can be used to enhance and extend the current BI and data warehousing environment. However, architecting such a system requires understanding of not just Hadoop but a broad range of related projects in the Hadoop ecosystem such as Flume, Hive, Impala, Oozie, Sqoop, etc. It also requires an understanding of the existing Enterprise Data Warehousing systems but more importantly how they integrate with various tools in the Hadoop ecosystem.    Also the newest release of Oracle Business Intelligence 11.1.1.7 shows Oracle''s continued efforts in trying to integrate its Oracle Business Intelligence Platform with big data technologies such as Hadoop and Hive. This topic will also cover OBIEE 11g''s ability to integrate with a Hadoop data source.','All Experience Levels','50 Minutes',3,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Business Analytics 1','13:10:00','14:00:00',50,'Executive Room 8','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Pravin' AND LASTNAME ='Patil'));
INSERT INTO PRESENTATION VALUES(176,'Enterprise Use Cases for Internet of Things','Luc Bors - eProseed, ACE Director, Lancy  Silveira - Oracle','luc.bors@eproseed.com, lancy.silveira@oracle.com','Integration '||CHR(38)||' Collaboration','Agenda Theme - Explore','Traditional Presentation','Apart from consumer applications,  IoT can also offer great opportunities in the Enterprise. eProseed and Oracle organized a hack-a-thon to elicit use cases from industries. Different types of people were invited: students, Oracle professionals and industry specialists. The starting situation consisted of services to start back-end processes, Oracle PaaS services to easily connect to these services and a starter kit to generate signals. We started the day with a kick off and an explanation of the rules. Then everyone started working on his or her use case. The Oracle office stayed open, so people could continue working if they liked. The teams had to check in the code the next day, at 3 pm. A profession jury evaluated the result of 27 hours of coding (for those who did not sleep). Judging criteria were: 1. Enterprise applicability, 2. Productizability and execution, 3. User experience and demonstrability.  This session is an in-depth report of this hack-a-thon, the use cases that were realized and technology that was used. After attending this session, delegates will have a good idea of what IoT can mean in the enterprise, how Oracle tooling and platforms facilitate this and how Cloud fits into this picture.','All Experience Levels','50 Minutes',3,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Web '||CHR(38)||' Mobile Apps','13:10:00','14:00:00',50,'Media Suite B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Lonneke' AND LASTNAME ='Dikmans'));
INSERT INTO PRESENTATION VALUES(177,'Going Full Circle - Building a Native JSON Database API','Mark Drake - Oracle, USA','mark.drake@oracle.com','APEX '||CHR(38)||' Database Development','Upgrades/New Feature','Live Demo','The latest Oracle database version introduced native JSON database functionality. Based on live examples and demo''s, this presentation will show all ins and outs, regarding storage, the query language, indexing and more, using this new JSON database functionality to demonstrate how to build your own first database JSON API from scratch.','Beginner/Exploratory','50 Minutes',3,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Systems 2','13:10:00','14:00:00',50,'Media Suite A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Marco' AND LASTNAME ='Gralike'));
INSERT INTO PRESENTATION VALUES(178,'Hybrid Cloud Management of Oracle Java Cloud Service and On-Premises WebLogic','Frances Zhao-Perez - Oracle','frances.zhao@oracle.com','Web '||CHR(38)||' Mobile Apps','Cloud','Traditional Presentation','Building and deploying with WebLogic Server in Java Cloud Service and on-premises has never been easier with the latest release of Oracle Enterprise Manager for Hybrid Cloud. With using Oracle EM capabilities, you can easily deploy to both Java Cloud Service and on-premises environment from same single interface of Oracle EM. You can move your Java EE assets between Public Cloud and on-premises infrastructure without any re-implementation or re-deployment. Come to this session to learn what Oracle Enterprise Management for Hybrid Cloud solution offers! Moreover, we will discuss the integrated cloud management for heterogeneous environments including Oracle and some third party products using Oracle EM with a real world customer case.','Experienced/Expert','50 Minutes',3,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Integration '||CHR(38)||' Collaboration','13:10:00','14:00:00',50,'Hall 10A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='James' AND LASTNAME ='Kao'));
INSERT INTO PRESENTATION VALUES(179,'Increase Your Revenue Using Oracle Real-Time Decisions (RTD)','','','Business Analytics','RTD','Live Demo','Oracle Real-Time Decisions is an extremely versatile tool that can deliver real business value to your Organization.....within weeks. For Oracle customers such as Ecell Global, the use of Oracle RTD has optimized their primary web-site (www.goheadcase.com) and given their customers a more personalized experience. The net result is higher click-thru rates and ultimately higher revenue. This presentation will show live demonstrations of RTD in action and discuss how RTD can learn in real-time together with best practices for achieving the same results with your own web-sites.','All Experience Levels','50 Minutes',3,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Business Analytics 2','13:10:00','14:00:00',50,'Executive Room 7','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Antony' AND LASTNAME ='Heljula'));
INSERT INTO PRESENTATION VALUES(180,'Interactive Docker Roundtable','James Anthony - RedStack, Guido   Schmutz - Trivadis, Bruno Borges - Oracle','james.anthony@redstk.com, Guido.Schmutz@trivadis.com, bruno.borges@oracle.com','Virtualisation','Agenda Theme - Evolve','Roundtable','An opportunity to learn about docker, its role in continuous integration, and understand it’s position within Oracle’s product suites.  Primarily an interactive Q'||CHR(38)||'A session with industry practitioners, using some examples of dockerised applications to facilitate debate and understanding.','Beginner/Exploratory','50 Minutes',3,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Roundtables','13:10:00','14:00:00',50,'Hall 4 Foyer Level 5','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Anthony' AND LASTNAME ='Macey'));
INSERT INTO PRESENTATION VALUES(181,'Mobilizing your Business – Moving the capability from the Desktop, to Your Hand','Barry Lui - Capgemini, Dimitar Sadinov - Capgemini','barry.lui@capgemini.com, dimitar.sadinov@capgemini.com','Web '||CHR(38)||' Mobile Apps','Mobile','Traditional Presentation','The Oracle e-Business Suite is no longer tied to your desktop. Oracle have produced a number of “out of the box” applications to allow you to approve purchase orders, enter time and a whole range of other functions. The power behind the e-Business suite has been the ability to customise and configure it to you business needs, and so Oracle have also provided a development toolkit so that you can develop your own applications. However, just like any software development, this process can be costly, both in resources and training, and then with maintaining an ongoing support team.   At Capgemini we have developed a process for taking your business requirement, and turning it into an easily supportable application. Through in-house development, training and knowledge sharing, we can empower any organisation to allow them to mobilize their workforce.  This presentation will cover the benefits and pit-falls of mobile applications, discuss our implementation methodology, and demonstrate some of the applications we’ve already written to solve customers’ business needs','All Experience Levels','50 Minutes',4,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Big Data '||CHR(38)||' Data Warehousing','13:10:00','14:00:00',50,'Hall 6B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Jason ' AND LASTNAME ='Lester'));
INSERT INTO PRESENTATION VALUES(182,'Oracle Data Guard '||CHR(38)||' the Cloud - Just What Does That Mean?','','','Database','High Availability and Replication','Traditional Presentation','The ''Cloud''.  We''ve all heard a lot about it.  There are advertisements about it on TV that tell us it will solve world hunger, well, it sounds like it.  In any event, data is data.  If it is in the Cloud how do you protect your data in the Cloud?  Can you use the Cloud to protect data that resides in-house?  If it''s data in an Oracle database the answer is yes, but you have to think about how you will protect it.  This session will discuss your options using Oracle Data Guard.  ','All Experience Levels','50 Minutes',2,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Database 1','13:10:00','14:00:00',50,'Hall 9','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Larry' AND LASTNAME ='Carpenter'));
INSERT INTO PRESENTATION VALUES(183,'Using OVM for Network Segregation on Exadata','','','Virtualisation','Oracle Virtual Machines (OVM)','Case Study/Real Life Experience','Can you achieve total isolation between clusters of databases on an Exadata?    In this presentation I will show how we used Oracle VM together with Exadata with VLAN trunking to achieve this at a customer. I will cover everything from solution architecture, to install and operation of such a platform, and how it differs from a physical Exadata installation.','Experienced/Expert','50 Minutes',2,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Systems 1','13:10:00','14:00:00',50,'Hall 6A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Magnus' AND LASTNAME ='Fagertun'));
INSERT INTO PRESENTATION VALUES(184,'Automating Predictive Analytics in Your Applications','','','Big Data '||CHR(38)||' Data Warehousing','Data Science','Traditional Presentation','What does your Oracle DBA and Oracle Developer need to know to implement Data Mining? How can the Oracle DBA and Oracle Developer use Data Mining.This presentation will look at what the Oracle DBA and Oracle Developer needs to know to deploying, implementing and integrating the predictive models produced by the Data Miner. These predictive models can be used in multiple databases and across their many applications. Examples will be given of the typical tasks data mining task for the DBA and for the Oracle Developer. These examples will include SQL, PL/SQL and embedded Oracle R Enterprise functions ','All Experience Levels','50 Minutes',3,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Big Data '||CHR(38)||' Data Warehousing','14:30:00','15:20:00',50,'Hall 6B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Brendan' AND LASTNAME ='Tierney'));
INSERT INTO PRESENTATION VALUES(185,'Bad Boys of On-line Replication - Changing Everything','Jan Karremans - JK-Consult, ACE Associate','j.karremans@jk-consult.nl','Database','High Availability and Replication','Case Study/Real Life Experience','There comes a time in every database’s life where things need to change. This is a report about a project where a customer needed to change everything at once! And this for their most mission-critical, multi-terabyte production database and it had to be done with little or no downtime. The included everything, from changing data-centers across the country, swapping hardware (including CPU-Architecture, operating system also including an Endian-change) and an upgrade of the RAC-cluster to 12c. And because that was not enough we also moved the migration date back by a few weeks, after the project was already started. As the ''Bad Boys of On-line Replication'', the authors will share how they turned this project around to create a success against all odds. During the presentation they will explain the methods and tools used and they will share concerns and considerations they faced during the project. The story gives an overview of how such a project can be handled in a real-world setting. ','All Experience Levels','50 Minutes',3,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Database 1','14:30:00','15:20:00',50,'Hall 9','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Bjoern' AND LASTNAME ='Rost'));
INSERT INTO PRESENTATION VALUES(186,'Challenges '||CHR(38)||' Approaches for Upgrading Oracle Fusion Middleware','','','Integration '||CHR(38)||' Collaboration','Strategy','Traditional Presentation','Maintaining an up to date, fully supported and maintainable technology estate should be a common goal of all IT departments and Oracle''s support policy encourages its customers to ensure they are set up for upgrades as new releases come along. However, the vendor support policy is not the only pressure point in maintaining a current system and frequently other, competing demands can take precedence, leading to delays in upgrades and a less than ideal production system.     In this talk I discuss the need for upgrading Oracle Fusion Middleware, why it might not be a straightforward activity to undertake, a process for evaluation and implementation of an upgrade and some configuration choices that make an upgrade process easier.    Three takeaways:  - Successful upgrades require business and IT to work together  - Upgrades need to be planned and executed to a plan  - Don’t expect an upgrade to solve all your product issues  ','All Experience Levels','50 Minutes',3,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Integration '||CHR(38)||' Collaboration','14:30:00','15:20:00',50,'Hall 10A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Paddy' AND LASTNAME ='Spencer'));
INSERT INTO PRESENTATION VALUES(187,'Determining the Position of a Needle in the Haystack - Location Intelligence in a Big Data Environment','','','Big Data '||CHR(38)||' Data Warehousing','Hadoop','Traditional Presentation','Location information is a common element in Big Data scenarios, whether it is explicitly expressed as coordinates from a GPS sensor or implicitly included in a postal code, a city or a landmark name. On the one hand it can be used to track assets or categorize entities based on proximity but more importantly it can be used link otherwise unrelated data sets. However, for these purposes geospatial processing capabilities are required on Big Data platforms. While spatial data types, spatial indexes and the corresponding operators are well-established in conventional databases, their support to date was rather limited in Big Data environments.    In this paper we will present a solution to process positional information as well as other geospatial data based on the hadoop platform. Results of geospatial processing can be used for interactive information discovery, visualization or further analysis in conventional database technologies. For location information in the form of place names or other descriptions of points of interest the solution includes a framework which determines the coordinates for a given place name and associates the result with a hierarchy of administrative boundaries or similar structures which can then be used to categorize or aggregate the data.    The presentation will cover the fundamentals of spatial processing using MapReduce technologies and will include demos of geo-enrichment and map visualization.  ','Beginner/Exploratory','30 Minutes',3,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Business Analytics 1','14:30:00','15:20:00',50,'Executive Room 7','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Hans' AND LASTNAME ='Viehmann'));
INSERT INTO PRESENTATION VALUES(188,'Engineered Systems Roundtable - Part 1','Uwe Hesse - Oracle','Uwe.Hesse@Oracle.com','Engineered Systems','Exadata','Roundtable','Round table group on Database Machine, and other Engineered Systems that use Exadata','Intermediate','50 Minutes',2,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Roundtables','14:30:00','15:20:00',50,'Hall 4 Foyer Level 5','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Joel' AND LASTNAME ='Goodman'));
INSERT INTO PRESENTATION VALUES(189,'How to Find Your Unknown Unknowns….','Chris Davenport - The Hackett Group','cdavenport@thehackettgroup.com','Business Analytics','Agenda Theme - Explore','Traditional Presentation','Make yourself appear smarter than Donald Rumsfeld…..  ‘Traditional BI’ helps you answer the known questions – we have defined the dimensionality and built the queries that let us monitor the items we have identified as key: our known knowns.  See how to move beyond this into the known unknowns and start to get value from your Big Data and take the final step to identify your unknown unknowns and use this to improve your BI going forwards.','All Experience Levels','50 Minutes',3,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Business Analytics 2','14:30:00','15:20:00',50,'Executive Room 9','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='John' AND LASTNAME ='Baker'));
INSERT INTO PRESENTATION VALUES(190,'New Features of Latches '||CHR(38)||' Mutexes in Oracle 12c','','','Database','Performance '||CHR(38)||' Internals','Traditional Presentation','Latches and Mutexes are the sub-microsecond timescale synchronization mechanisms in Oracle. In a high concurrency OLTP environment they can be one of the most complex DBA challenges today. Moreover, Oracle continues to enhance and evolve their usage.    This presentation explores how Oracle 12c latches and mutexes operate, spin, and sleep. I will discuss what is new in their wait schemes, instance parameters and statistics. The overall presentation objective is to convey how latches and mutexes work, how the DBA can monitor their activity, and how to tune their contention in an intense OLTP Oracle 12c environment.  ','Experienced/Expert','50 Minutes',1,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Database 2','14:30:00','15:20:00',50,'Hall 11A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Andrey' AND LASTNAME ='Nikolaev'));
INSERT INTO PRESENTATION VALUES(191,'ODI Meets DEVOPS - An Introduction to Continuous Integration','','','Integration '||CHR(38)||' Collaboration','Integration','Traditional Presentation','Data Integration tools such as Oracle Data Integrator, ODI, are really productive for developers, but all that GUI clicking does not sit well with corporate IT departments; they want a controlled and reproducible process to promote ETL code to the various environments from TEST through to PRODUCTION, and what''s more a process that keeps developers at arms length from production.  This presentation looks the various methods we can adopt to move towards scripted deployments and code promotion and how we can achieve that DEVOPS goal of Continuous Integration.  After a brief overview of the differences between ODI Design and Execution Repositories I will consider the ODI objects that form part of the deployment process and how we manage code promotion using the ODI Studio GUI. The main body of the presentation will look at various ways we can replace the GUI actions with ODI scripting and command line tools. Finally I will add the steps needed to integrate our scripted deployments into an automated continuous integration process tied into standard tools such as GIT, Jenkins and Ant.  Presentation attendees will learn:  Which ODI objects are needed to successfully promote code between platforms  Techniques to generate the needed XML files  How to incorporate ODI deployments into a continuous integration processes ','Intermediate','50 Minutes',2,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Systems 2','14:30:00','15:20:00',50,'Media Suite A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Peter' AND LASTNAME ='Scott'));
INSERT INTO PRESENTATION VALUES(192,'Oracle Clusterware '||CHR(38)||' Rapid Home Provisioning','','','Database','High Availability and Replication','Live Demo','Rapid Home Provisioning is a new Clusterware feature introduced in 12.1.0.2 that simplifies the management and deployment of Oracle homes in a Clustered environment. In this session you will discover the basics of this technology. Examples and live demos will complete the learning experience.','Intermediate','50 Minutes',3,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Database 3','14:30:00','15:20:00',50,'Hall 10B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Ludovico' AND LASTNAME ='Caldara'));
INSERT INTO PRESENTATION VALUES(193,'Powerful '||CHR(38)||' Easy ADF Data Control for XML '||CHR(38)||' Web Services','Richard Olrichs - MN, ACE','richard.olrichs@mn.nl','Web '||CHR(38)||' Mobile Apps','ADF','Traditional Presentation','Many organizations want to leverage their existing or newly developed web services in ADF applications. Oracle ADF’s Data Binding Layer provides a declarative way of accessing different types of data controls. Several of these data controls can be used for accessing XML content. In our experience they are either easy to implement or very powerful. As a result of the ADF community effort now there is a free open source XML ADF Data Control that combines best of both worlds, both simple and powerful. It can be used with SOAP web services, BPM human tasks or any other XML data. It is declarative without the need for JAX-WS proxies or custom beans, although it is extensible with custom code.','All Experience Levels','50 Minutes',2,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Web '||CHR(38)||' Mobile Apps','14:30:00','15:20:00',50,'Media Suite B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Wilfred' AND LASTNAME ='van der Deijl'));
INSERT INTO PRESENTATION VALUES(194,'Spot the Difference! Comparing Apex Applications','','','APEX '||CHR(38)||' Database Development','APEX','Live Demo','There are different ways of developing in Apex, but most of the times people come to a point where they have several versions of the same application and have lost track of the (important) differences between them.   If you have tried to use the standard reports that come with Apex you might have noticed there are some limitations.  Or maybe you have used a diff tool on the export files which actually are quite readable but not everyone''s cup of tea.    To investigate all declarations that make up your Apex application you need to dive into the meta data. We will have a look at the underlying data model and the dependencies between the objects and by the way learn something about how Apex was implemented.    With this knowledge it is possible to build a set of views and an Apex application on top of it which allows us to compare two applications with a comfortable drill-down GUI.    What are the main takeaways?  - Apex meta data is a great source of information, you just have to know how to use it  - How the Apex developers solved some tasks  - The comparison application itself  ','Intermediate','50 Minutes',1,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'APEX '||CHR(38)||' Database Development','14:30:00','15:20:00',50,'Hall 11B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Sabine' AND LASTNAME ='Heimsath'));
INSERT INTO PRESENTATION VALUES(195,'A Pragmatic View on the Future of Classic '||CHR(38)||' Deprecated Oracle (Middleware) Software','','','Web '||CHR(38)||' Mobile Apps','Strategy','Traditional Presentation','The product portfolio of Oracle has grown tremendously in the past ten years, with acquisitions and emerging technologies as the driving force.  In this presentation the future of a number of the "traditional" Oracle products, used by many organisations through the years, will be discussed. The advantages and disadvantages of successors, the need to replace or continue using a deprecated/unsupported product, the ease or pitfalls of migrating, and alternatives outside the Oracle arena will be discussed. The presentation focusses on Forms, Reports and Designer, on Oracle Discoverer and Portal, and on Identity Management products Oracle Internet Directory and Application Server Single Sign On.','All Experience Levels','50 Minutes',4,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Systems 2','15:30:00','16:20:00',50,'Media Suite A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Peter' AND LASTNAME ='de Vaal'));
INSERT INTO PRESENTATION VALUES(196,'Advanced Visualizations with Oracle BI '||CHR(38)||' Geo-Spatial Big Data','','','Business Analytics','OBI (Foundation Suite/Enterprise Edition)','Live Demo','The role of "Geo-Spatial" data is often overlooked when it comes to "Big Data" analytics. This presentation aims to demonstrate how Oracle Spatial can significantly extending the capabilities of Oracle BI by providing advanced visualizations with Geo-Spatial analytics. As well as understanding how maps and spatial can integrate into Oracle BI, delegates will see and learn a 5 step process for achieving advanced Geo-Spatial analysis and then to appreciate the real Business Value it can deliver.','All Experience Levels','50 Minutes',3,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Big Data '||CHR(38)||' Data Warehousing','15:30:00','16:20:00',50,'Hall 6B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Antony' AND LASTNAME ='Heljula'));
INSERT INTO PRESENTATION VALUES(197,'Big Data Governance with OEMM Using the New ODI 12c Big Data Connectors','','','Business Analytics','Oracle Enterprise Manager','Traditional Presentation','Most of the companies these days, are facing the problem of having a growing number of different systems - OLTP, OLAP, applications, big data, etc- that produce, consume or manage data. In these cases are quite complicated to realise which data is used by which system or application or if there is some system using obsolete data. This session will show how Oracle Enterprise Metadata Management can solve this problem, relating different sources and applications to tracing data lineage and perform impact analyses, focusing on Big Data, OBIEE and ODI mappings using the new ODI 12c Big Data Connectors','All Experience Levels','50 Minutes',3,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Business Analytics 1','15:30:00','16:20:00',50,'Executive Room 7','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Edelweiss' AND LASTNAME ='Kammermann'));
INSERT INTO PRESENTATION VALUES(198,'Engineered Systems Roundtable - Part 2','Uwe Hesse - ','Uwe.Hesse@Oracle.com','Engineered Systems','Exadata','Roundtable','Round table group on Database Machine, and other Engineered Systems that use Exadata and other engineered systems','Intermediate','50 Minutes',2,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Roundtables','15:30:00','16:20:00',50,'Hall 4 Foyer Level 5','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Joel' AND LASTNAME ='Goodman'));
INSERT INTO PRESENTATION VALUES(199,'It''s Raining Data! Oracle Databases in the Cloud','','','Virtualisation','Cloud','Traditional Presentation','Wherever you turn someone is talking about cloud databases or database as a service (DBaaS). This presentation will show you how you can run your Oracle databases in the cloud using a variety of providers (Amazon Web Services, Microsoft Azure and Oracle Cloud) and discuss the pros and cons of these services compared to your on-premise installations.','All Experience Levels','50 Minutes',5,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Systems 1','15:30:00','16:20:00',50,'Hall 6A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Tim' AND LASTNAME ='Hall'));
INSERT INTO PRESENTATION VALUES(200,'Mastering the APEX Universal Theme','','','APEX '||CHR(38)||' Database Development','APEX','Traditional Presentation','One of the most important features of Oracle Application Express 5 is the Universal Theme. This theme allows every database developer to create great looking applications without knowing any JavaScript, HTML or CSS. But how do you make changes to comply to your company branding in such a way you don''t break anything else? And how do you add new templates and template options? In this session you will learn how the Universal Theme works, what the components are and what you should and shouldn''t do when you make your changes.','Intermediate','50 Minutes',2,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'APEX '||CHR(38)||' Database Development','15:30:00','16:20:00',50,'Hall 11B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Roel' AND LASTNAME ='Hartman'));
INSERT INTO PRESENTATION VALUES(201,'Oracle Database Security: Top 10 Things You Could '||CHR(38)||' Should be Doing Differently','','','Database','Compliance, Audit '||CHR(38)||' Security','Traditional Presentation','Regardless of whether you have Oracle Database Standard Edition, Enterprise Edition, or any optional packs there is a wide variety of key database security features and mechanisms built right into the Oracle database and related components that are typically overlooked, under appreciated, not understood, or are unknown even to the experienced senior DBA.    This presentation goes well beyond the basic concepts such as simple role/privilege grants or database passwords.  And similarly isn''t about Oracle''s specialty additional cost products such as Database Vault, Audit Vault, Database Firewall, or the Advanced Security Option.    Instead this presentation covers lesser known features, tips and tricks, common pitfalls, surprising exposures, and exploits related to Oracle database security.  Whether you have a single standard edition on premise database or a large corporate enterprise using a public, private, or hybrid cloud, key database security features and strategies are explained to help DBAs and developers maximize the security, protection, operational efficiency, and compliance of the database product they already have.    Even the most expert DBA in your team is sure to learn plenty from this presentation.','All Experience Levels','50 Minutes',2,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Database 2','15:30:00','16:20:00',50,'Hall 11A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Simon' AND LASTNAME ='Pane'));
INSERT INTO PRESENTATION VALUES(202,'Oracle Fusion Middleware High Availability','Osama Hussein - Gurus Solutions','osama.mustafa.m@gmail.com','Web '||CHR(38)||' Mobile Apps','WebLogic '||CHR(38)||' CAF','Panel Session','A high availability is important demand for All Enterprise deployment, which protect its components and applications from unplanned down time And minimize planned downtime, this session describe best practice for Different Type of Fusion middleware Availability, One of the challenges in Designing an HA solution is examining and addressing all the possible causes of downtime. It is important to consider causes of both unplanned And planned downtime when designing a fault tolerant and resilient IT infrastructure. This session describe best practice for Different Type of Fusion middleware Availability, architecture for Active/passive, architecture for active/active and overview for prerequisites for each of them','All Experience Levels','30 Minutes',1,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Integration '||CHR(38)||' Collaboration','15:30:00','16:20:00',50,'Hall 10A','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Osama' AND LASTNAME ='Mustafa'));
INSERT INTO PRESENTATION VALUES(203,'RMAN 12c Live : It''s All About Recovery,Recovery,Recovery','','','Database','12c New Features','Live Demo','Oracle Recovery Manager (Oracle RMAN) has evolved since being released in version 8i. With the newest version of Oracle 12c , RMAN has great new features that will allow you to reduce your down time in case of a disaster. In this session you will learn about the new features that were introduced in Oracle 12c regarding recovery , configuration tips and we will go over several demos so that if you are ever faced with this adversity you come out on top.    Attendee will learn  1. Background  a) General Backup and Recovery–Overview of RMAN  b) Oracle RMAN 12c Newest Features    2 Recovering Tables and Table Partitions from RMAN Backups    3 Recovering CDBs and PDBs to a Point in Time from RMAN Backups    4 Dumping the controlfile to see what is happening throughout the recovery process','Intermediate','50 Minutes',2,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Database 3','15:30:00','16:20:00',50,'Hall 10B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='René' AND LASTNAME ='Antúnez'));
INSERT INTO PRESENTATION VALUES(204,'SQL - The Goto Language for Big Data Analytics!','','','Database','12c New Features','Live Demo','Want all the power of Oracle SQL to analyze your big data reservoir - You got it! The latest generation of SQL enhancements to the Oracle Database aim to make the big data discovery process both easier and significantly faster. This session involves live demonstrations of the most important new analytical features added to the latest generation of the Oracle Database. The primary aim of these new features is to speed up the data discovery process where “good-enough” answers are in usually good enough to help decide if a data set is in fact useful. The demonstrations will be based on the most popular big data discovery style use cases such as analysis of social media data sets, website traffic flow analysis and loyalty card data. ','Intermediate','50 Minutes',2,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Database 1','15:30:00','16:20:00',50,'Hall 9','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Keith' AND LASTNAME ='Laker'));
INSERT INTO PRESENTATION VALUES(205,'Team Development in the Cloud for Oracle Developers','','','Integration '||CHR(38)||' Collaboration','Agenda Theme - Explore','Live Demo','The Oracle Developer Cloud service provides a platform for development teams to manage their full development lifecycle including tracking requirements and bugs, code versioning and review, and automating build, testing and deployment processes. Whether you’re developing in the database, cloud, mobile, web apps in this demo focused session we''ll show you how easy it is to get started with the platform and discuss how it can improve your product quality and team collaboration.','All Experience Levels','50 Minutes',4,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Web '||CHR(38)||' Mobile Apps','15:30:00','16:20:00',50,'Media Suite B','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Susan' AND LASTNAME ='Duncan'));
INSERT INTO PRESENTATION VALUES(206,'User Adoption '||CHR(38)||' Retention in OBIEE for the IT Department','','','Business Analytics','Agenda Theme - Embrace','Traditional Presentation','Build it, and they will come! Maybe. But maybe they won''t stay very long, and maybe they''ll never return...and you may never know. Your users are the most valuable part of your OBIEE system;  without an active and engaged user base an OBIEE deployment is doomed to wither and die, to join the scrap heap of many a failed BI project. But it doesn''t have to be that way!     In this talk I will discuss how we can measure user engagement, collect performance metrics, and most importantly see how to action this information in order to proactively work with users to ensure the system is meeting their needs in terms of performance, functionality and data. The core data source for all of this is OBIEE''s Usage Tracking, and we will also discuss how log files can be configured and mined in order to provide an additional rich source of data.','All Experience Levels','50 Minutes',3,'Wednesday 9th December 2015',TO_DATE('09/12/2015','DD/MM/YYYY'),'Business Analytics 2','15:30:00','16:20:00',50,'Executive Room 9','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Robin' AND LASTNAME ='Moffatt'));
INSERT INTO PRESENTATION VALUES(207,'Live Mobile and Cloud Hacking by ACEs using an OFM 12c Red Stack','Lonneke Dikmans - eProseed, ACE Director Luc Bors - eProseed, ACE Director Steven Davelaar - Oracle Wilfred van der Deijl - The Future Group, ACE Director','','Inegration '||CHR(38)||' Collaboration','Cloud','Live Demo','Want to know more about Oracle''s Cloud products and how they work together and can be integrated into enterprise solutions? Interested in live development rather than slides? If so, join our Live Cloud Hacking Session on Super Sunday! In this session Oracle ACEs and A-Team members will develop a conference application that can be used by conference attendees and administrators to schedule sessions, register for sessions, track attendance and notify attendees in case of changes. The following Cloud products and technologies are used to build the conference app:  Java Cloud Service (JCS): Oracle''s Java PaaS for rapid, self-service provisioning of the Oracle WebLogic Server in the Cloud Mobile Cloud Service (MCS): MCS provides secure mobile access to all your data and applications Process Cloud Service (PCS): Collaborative set of tools for modelling business processes and decisions JavaScript Extension Toolkit (JET): Oracle''s framework for JavaScript UI development Mobile Application Framework (MAF): Hybrid mobile framework that enables developers to rapidly develop applications and deploy to both Apple''s iOS and Google''s Android platforms Each of the presenters will introduce one of these Cloud Products or technologies and show how development and deployment is done. The front-end applications are built using MAF and JET and include features such as push notifications, location aware services using iBeacons, and advanced data visualizations. MCS is used to expose back-end services as secured, optimized, and mobile-friendly APIs that are consumed by the mobile and desktop apps built in MAF and JET. The back end that provides services and exposes the conference data runs on JCS and uses EclipseLink JPA and JAX-* to expose RESTful and SOAP Web Services. The conference data is stored in Oracle Database Cloud Service (DBCS). PCS and its Workspace are used to model, deploy, and run the process for conference sessions.  After this session you have a good understanding of various Oracle Cloud products and technologies, and maybe even more importantly how they can be used together to rapidly create and deploy enterprise applications. The audience is encouraged to interact with the presenters and ask questions.','All Experience Levels','110 Minutes',3,'Sunday 6th December 2015',TO_DATE('6/12/2015','DD/MM/YYYY'),'Integration '||CHR(38)||' Collaboration','12:30:00','14:20:00',110,'Unknown','Activated',(SELECT ID FROM SPEAKER WHERE FIRSTNAME ='Ronald' AND LASTNAME ='van Luttikhuizen'));
